这是彼得·卡帕尔蒂主演的第三个也是最后一个常规系列，他饰演类人外星人第十二任博士，一位能够通过TARDIS穿越时空的时间领主。卡帕尔蒂于2017年1月宣布在本系列结束后会离开本剧。本系列引入了由珀尔·麦琪饰演的新同伴比尔·波茨。此外，马修·卢卡斯饰演纳多尔，他出现于2015年和2016年的圣诞特辑中。米歇尔·戈麦斯和约翰·西姆饰演法师的不同化身。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/AakvauuPTR1H1oJCQaTKPBcV8a4.jpg', '{4762,80893,12113}', '{CA,GB}', '2017-04-15 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.100', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');

朱迪·惠特克接替彼得·卡帕尔蒂饰演第十三任博士，一位通过塔迪斯穿越时空的外星人，是本剧自1963年开播以来的第一位女博士。同时引入全新角色格雷姆·奥布莱恩（布拉德利·沃尔什饰）、瑞恩·辛克莱（托辛·科尔饰）和娅斯敏·坎（曼迪·吉尔饰）作为博士的最新同伴。本系列紧承2018年圣诞特辑《曾有两次》的剧情，以重生后的博士寻找丢失的塔迪斯为开端，无意之中带领格雷姆、瑞恩和娅斯敏一同开始时空旅行。本系列中每集讲述一个相对独立的的完整故事，没有出现由连续多集组成的故事。

除克里斯·奇布诺尔执笔参与撰写包括特辑在内的7集剧本之外，玛洛丽·布莱克曼、维奈·帕特尔、皮特·麦克蒂格、乔伊·威尔金森和艾德·希姆各为其中1集编剧。杰米·蔡尔兹、马克·托德莱、萨利·阿帕拉哈米安和珍妮弗·佩罗特分别执导常规剧集中的两集，韦恩·叶执导新年特辑。本系列于2017年11月开拍，2018年8月完成拍摄，2018年10月7日首播，定于每周日播出。与重启以来传统的圣诞特辑不同，本系列相关的特辑《新年决心》于2019年的元旦播出。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/tFu6Or2wZP8xW5CBUy3MROtcF29.jpg', '{4762,80893,12113}', '{CA,GB}', '2018-10-07 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '6.300', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');

