在海岛上发生的事让一些奎因家族的一些黑暗历史浮出了水面，同时也使奥利弗的精神和身体受到了双重考验。他开始在众人前尽力掩藏真实的自我，一心要去补偿父亲当年对这座城市犯下的错。白天，他依然是富豪公子，夜晚却化身另一个存在，他以父亲的遗物为线索，四处寻找当年那些试图颠覆这座城市的人以伸张正义。奎因的一举一动在斯塔林市中掀起了阵阵波澜。', 'f', '2974.574', 'https://image.tmdb.org/t/p/original/pAdZsHyk7ROQqHzzK8QIM8OnR5f.jpg', '{27711,9993,1957}', '{US}', '2012-10-10 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.700', 5796, 2, '{"id": 1412, "imdb_id": "tt2193021", "tvdb_id": 257655, "tvrage_id": 30715, "twitter_id": "CW_Arrow", "facebook_id": "CWArrow", "freebase_id": null, "wikidata_id": "Q552314", "freebase_mid": "/m/0l170__", "instagram_id": "cw_arrow"}');

