维斯特洛大陆边境处发现远古传说中早已灭绝的生物，危险即将到来。而这片大陆的临冬城主暨北境统领艾德·史塔克的家族也迎来了老友兼国王劳勃·拜拉席恩的来访。国王希望艾德·史塔克能担任首相一职，对抗企图夺取铁王座的叛军。危情一触即发，整个王国看似平和的表面下却是波涛暗涌。权高位重的拜拉席恩家族、勇敢善良的史塔克家族、企图谋取王位的坦格利安家族、有着不可告人秘密的兰尼斯特家族。这些家族各怀鬼胎，国王的意外身亡，使国家马上陷入无尽的战乱之中。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/wgfKiqzuMrFIkU1M68DDDY8kGC1.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2011-04-18 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.300', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

艾德·史塔克死后，其属臣拥戴他的长子罗柏·史塔克为北境之王。由罗柏率领的北境大军与兰尼斯特实力相互对峙，蓝礼·拜拉席恩的南境雄兵则不断朝君临开拔，还有动向不明的史坦尼斯·拜拉席恩，以及西北黑海之上的铁群岛诸民。戍守北疆的守夜人与境外蛮族一决生死。龙之母丹妮莉丝·坦格利安带着老弱残兵组成的卡拉萨，跟随彗星的轨迹，穿越茫茫洪荒，朝遥远渺茫的复国大业进发。凛冬将至，冷风渐起。随着第二季剧情进入阴暗梦魇，艾莉亚·史塔克仍然处于兰尼斯特家族的囚禁之中；泰瑞欧尽自己最大的努力在君临城清除险恶之徒；蓝礼和史坦尼斯处于战争的边缘，尽管凯特琳·史塔克恳求两人联手对付共同的敌人；珊莎·史塔克仍然受困于残忍且越来越疯狂的乔佛里·拜拉席恩及他渴望权力的母亲手中；史塔克家族的男丁们则各自分散于从河间地到绝境长城之间的广袤土地上。与此同时，龙母丹妮莉丝和她衣衫褴褛的多斯拉克人在魁尔斯城看到了一线新希望。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/9xfNkPwDOqyeUvfNhs1XlWA0esP.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2012-03-31 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.200', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

故事紧接上一季，五王之战——罗柏·史塔克，巴隆·葛雷乔伊，蓝礼·拜拉席恩、乔佛里·拜拉席恩和史坦尼斯·拜拉席恩之间的战争——让七大王国陷入混乱。蓝礼已死，史坦尼斯在夺取君临时被兰尼斯特家族和提利尔家族的新联盟击败。马泰尔家族依然支持兰尼斯特家族。同时，大群野人在曼斯·雷德的指挥下向长城进军，只有微弱力量的守夜人防守。在远东，丹妮莉丝打算返回潘托斯组建一支能够夺回铁王座的军队。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/5MkZjRnCKiIGn3bkXrXfndEzqOU.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2013-03-31 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.200', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

红色婚礼扫平了史塔克家族的主要成员，兰尼斯特家族巩固了对铁王座的统治，但来自南方、北方和东方的威胁依然不可小视。当史坦尼斯在龙石岛重整旗鼓的时候，人送外号”多恩的红毒蛇“的奥柏伦·马泰尔来到了君临城，立刻成为兰尼斯特家族眼下最直接的威胁。奥柏伦表面上是来参加乔佛里和马格丽·提利尔的婚礼，事实上可能有着不为人知的动机。在北方，曼斯·雷德率领的野人大军正在朝绝境长城进发，守夜人军团不仅人数处于绝对劣势，而且失去了与维斯特洛大陆的联系，战争形势极为不利。更糟糕的是，可怕的不死生物异鬼选择在此刻现身，给七大王国带来巨大威胁。在狭海的另一边，丹妮莉丝在三条龙和无垢军队的保护下向奴隶湾最大的城市弥林进军，发誓要解放这座“奴隶之都”。一旦弥林被攻陷，她将有足够的战船和足够的军队横跨狭海重返维斯特洛大陆，夺回原本属于坦格利安家族的铁王座。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/jXIMScXE4J4EVHUba1JgxZnWbo4.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2014-04-06 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.400', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

杀死泰温·兰尼斯特后，瓦里斯带着提利昂·兰尼斯特一同踏上了逃亡之旅，并为他指引一位明主。红毒蛇的情妇艾拉莉亚·沙德决定携女儿们为其报仇。在山姆威尔·塔利的帮助下，琼恩成为了守夜人司令官，在来势汹汹的异鬼面前，琼恩做出了让所有守夜人吃惊的决定。托曼·拜拉席恩继承了王位，玛格丽终于成为了名副其实的王后，这让太后瑟曦·兰尼斯特感到地位受到威胁，烧脑宫斗与人鬼大战正式拉开了帷幕。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/7Q1Hy1AHxAzA2lsmzEMBvuWTX0x.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2015-04-12 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.100', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

提利昂和瓦里斯渡海投奔龙母丹妮莉丝，可后者却亦处于困境之中，复国计划停滞不前。另一边，太后瑟曦的权力被教会彻底架空，裸体游街的耻辱之后，迎来的是唯一的儿子——如今的国王托曼的背叛。北边，布兰·史塔克成为了三眼乌鸦，珊莎在骑士布蕾妮保护之下最终顺利同哥哥雪诺汇合，他们的下一步计划，即是夺回被“小剥皮”拉姆斯·波顿所占领的临冬城。狭海对岸，丹妮莉丝被多斯拉克部落活捉后，利用三条巨龙的优势逃离部落并取回对奴隶湾的控制权，在提利昂、瓦里斯、弥桑黛、雅拉·葛雷乔伊、席恩·葛雷乔伊、艾拉莉亚·沙德与提利尔家族的辅助下，丹妮莉丝率领着三条巨龙与无垢者军队、多斯拉克大军渡过狭海，准备反攻维斯特洛大陆。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/p1udLh0gfqyZFmXBGa393gk8go5.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2016-04-24 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.300', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

丹妮莉丝·坦格利安，带着她的无垢者、多斯拉克军与部分铁群岛军队的联盟，三条极具威胁的巨龙，以及她新任命的“国王之手”——提利昂·兰尼斯特，终于确定前往维斯特洛。琼恩·雪诺，被光之王的祭司梅丽珊卓复活，在“私生子之战”彻底击败了拉姆斯·波顿后，巩固了在北境的权力，重返临冬城并作为北境之王管理北境。君临城方面，瑟曦没有任何后代存活下来，在用野火将大麻雀和其他敌人烧死在贝勒大圣堂后，她成功占据了铁王座。而在北方，夜王逐渐形成对维斯特洛的最致命威胁，率领着一支死人军团准备摧毁北境的绝境长城而向南入侵。它们将会打破现状，毁灭掉那些人类之间渺小的斗争果实。', 'f', '1474.365', 'https://image.tmdb.org/t/p/original/oX51n32QyHeFP5kErksemJsJljL.jpg', '{76043,12525,5820,12526}', '{GB,US}', '2017-07-16 00:00:00', 0, 0, '{en}', 'Ended', '凛冬将至', 'f', '8.100', 23143, 2, '{"id": 1399, "imdb_id": "tt0944947", "tvdb_id": 121361, "tvrage_id": 24493, "twitter_id": "GameOfThrones", "facebook_id": "GameOfThrones", "freebase_id": "/en/game_of_thrones", "wikidata_id": "Q23572", "freebase_mid": "/m/0524b41", "instagram_id": "gameofthrones"}');

在心园市生活的主人公·九十九游马也热衷于卡片决斗，但水平只是初学者等级的连败者。以某事件为契机，游马与学校头号不良少年·神代凌牙以决斗对决。这场决斗，将游马的命运大大改变……！这场激斗中，总在游马的梦里出来的诡异大门突然出现。紧紧关闭的大门被打开的瞬间，无数光芒溢出，抬头一看身旁……那里站着从异世界来的神秘生命体·星光体（Astral）！为了取回星光丢失的记忆，取回99张“No.卡”，2人开始一起行动。

星光体出现的真正目的是什么？而新的怪兽“No.怪兽”这一存在又到底是何方神圣？强力竞争对手陆续在游马面前出现，而星光体身上的谜团也逐渐明朗化。由这个组合缔造的新决斗传说，如今揭开序幕！！', 'f', '972.154', 'https://image.tmdb.org/t/p/original/qkrGY4vrKpC1bWmGgaL7MvWHcLf.jpg', '{3034,55914,50879}', '{JP,US}', '2011-04-11 00:00:00', 0, 25, '{ja}', 'Ended', '', 'f', '6.000', 36, 2, '{"id": 45854, "imdb_id": "tt2363624", "tvdb_id": 248049, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q676287", "freebase_mid": "/m/0ndt459", "instagram_id": null}');

