在洛杉矶时，她的第一个守望者死了...她无意中烧毁了原来高中的体育馆...她的父母离婚了。

搬到桑尼戴尔本应给她和她的母亲乔伊斯一个全新的生活。但后来她遇到了学校图书管理员鲁珀特-贾尔斯，并很快意识到她无法逃避自己的命运。吉尔斯成为了她的新守望者，她不情愿地重新扮演起杀手的角色。但这次她不是一个人在战斗。她现在有了一群特殊的朋友--威洛、桑德、科迪丽亚和一个名叫安吉尔的神秘年轻人，他们随时准备加入战斗，必要时还会插上一两根木桩。', 'f', '1441.414', 'https://image.tmdb.org/t/p/original/AsnmRgMHZLwh0auGtbuJ8xc5smX.jpg', '{10567,2516,5842,1556,62934}', '{US}', '1997-03-10 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.400', 1628, 2, '{"id": 95, "imdb_id": "tt0118276", "tvdb_id": 70327, "tvrage_id": null, "twitter_id": null, "facebook_id": "", "freebase_id": "/en/buffy_the_vampire_slayer", "wikidata_id": "Q183513", "freebase_mid": "/m/0cskb", "instagram_id": null}');

很快瑞秋也与另一个男人约会了。但一次在瑞秋大醉时，在罗斯的电话留言机上说“我已经忘掉你了！”（Iamoveryou），并被罗斯发现。之后罗斯来到CentralPerk，生气地告诉瑞秋这本不应该告诉他，但罗斯离开之后咖啡馆又折回，这次他与瑞秋拥吻了。之后罗斯在瑞秋和Julie两人中无所适从，于是钱德勒建议用一张单子列出两人的优缺点之后决定。但罗斯知道自己真正爱的还是瑞秋，于是很快与Julie分手。不幸的是瑞秋发现了那张列有自己优缺点的单子，异常生气的她拒绝了罗斯。

后来，朋友们一起观看了一卷瑞秋和摩妮卡准备学校舞会的录像带。瑞秋看到这里被罗斯感动了，决定和罗斯重新开始。

乔伊由于在肥皂剧“我们的生活”（DaysofourLives）扮演雷莫瑞（Ramorey）医生大获成功，已经赚够了钱可以住进自己的公寓了。菲比此时找到了他同父异母的弟弟小弗兰克（Frank）。

