斯特凡被女巫昆特西亚所救，昆特西亚道出赛拉斯当年背叛了自己，同女仆阿玛拉生情，两人喝下了永生之水获得不死之身。昆特西亚得知遭背叛，她逼阿玛拉喝下了永生之水的解药并杀了她。昆特西亚对斯特凡下咒削弱了赛拉斯，她要让赛拉斯喝下解药变成凡人。赛拉斯道出自己追杀凯瑟琳的原因，原来凯瑟琳的血就是解药，她是阿玛拉的二重身。之后阿玛拉死了，邦妮替代了她成为了通往另一个世界的锚，然而邦妮复活。之后斯特凡与凯瑟琳旧情复燃，凯瑟琳成为人类面临死亡，凯瑟琳的女儿纳迪娅为了不让母亲死去帮助凯瑟琳进入埃琳娜的身体。', 'f', '1364.448', 'https://image.tmdb.org/t/p/original/uf01Ep3cn4TFphOr056zXtlux0G.jpg', '{1957,10067,2180,37423,1081}', '{US}', '2013-10-03 00:00:00', 0, 43, '{en}', 'Ended', '', 'f', '8.100', 8723, 2, '{"id": 18165, "imdb_id": "tt1405406", "tvdb_id": 95491, "tvrage_id": 21766, "twitter_id": "cwtvd", "facebook_id": "thevampirediaries", "freebase_id": null, "wikidata_id": "Q28537", "freebase_mid": "/m/05sy2k_", "instagram_id": "thecwtvd"}');

埃琳娜和泰勒回到了惠特莫尔大学读书，然而，看似平静的埃琳娜在失去挚爱后变得极具疯狂，她靠吸毒、嗜血来麻醉自己，引发达蒙存在的幻觉；而阿拉里克复活后成为了他们的教授；斯特凡选择离开这里去寻找拯救达蒙和邦妮以及解开旅行者咒语的方法；卡罗琳留在小镇边界与母亲福布斯警长一起共度时光，只是斯特凡的离开让她的感情逐渐变化；恩佐复活后千方百计的向斯特凡实行报复；马特在实习警察阶段，他告诉埃琳娜，杰里米在失去了邦妮之后一直过着浑浑噩噩的日子。但让他们惊奇的是被困的还有“另一个人”，双子巫师团的神秘巫师“凯”，他承诺能带达蒙和邦妮离开这里。', 'f', '1364.448', 'https://image.tmdb.org/t/p/original/eNcq9u5eBzYsaHFo35pzwzVakyq.jpg', '{1957,10067,2180,37423,1081}', '{US}', '2014-10-02 00:00:00', 0, 43, '{en}', 'Ended', '', 'f', '8.500', 8723, 2, '{"id": 18165, "imdb_id": "tt1405406", "tvdb_id": 95491, "tvrage_id": 21766, "twitter_id": "cwtvd", "facebook_id": "thevampirediaries", "freebase_id": null, "wikidata_id": "Q28537", "freebase_mid": "/m/05sy2k_", "instagram_id": "thecwtvd"}');

异教徒们不仅占领了小镇还霸占了塞尔瓦托兄弟的大房子。斯特凡和卡洛琳想阻止悲剧的发生，却也深陷其中。达蒙和邦妮合作杀了一个异教徒成员马尔科姆因此激怒了莉莉。恩佐在两方对立的情况下选择站在莉莉一边并且绑架了卡洛琳。斯特凡被异教徒们赶出了神秘瀑布镇。莉莉的两个异教徒女儿玛丽和诺拉特别享受折磨卡洛琳，还透露给卡洛琳了一个关于斯特凡初恋女友的秘密。原来在1863年斯特凡交的初恋女友就是异教徒中的一位成员瓦莱丽。', 'f', '1364.448', 'https://image.tmdb.org/t/p/original/h9b2u3z00BUexrvJGEe1G8N57IW.jpg', '{1957,10067,2180,37423,1081}', '{US}', '2015-10-08 00:00:00', 0, 43, '{en}', 'Ended', '', 'f', '7.000', 8723, 2, '{"id": 18165, "imdb_id": "tt1405406", "tvdb_id": 95491, "tvrage_id": 21766, "twitter_id": "cwtvd", "facebook_id": "thevampirediaries", "freebase_id": null, "wikidata_id": "Q28537", "freebase_mid": "/m/05sy2k_", "instagram_id": "thecwtvd"}');

藏在黑暗中的邪恶生物海妖茜波引诱达蒙和恩佐落入陷阱并占有了他们，将两人变成冷酷无情的杀人机器，捕获有罪恶的人以便达到嗜血化人形的目的。而海妖不止是一人，还有茜波的姐姐，藏匿在卡洛琳家里的保姆席琳。马特·多诺万看似离开了危险的黑暗世界，但他的父亲会回到神秘瀑布镇与他团聚，并引发出他家族的秘密。失去法力的邦妮在命悬一线的时刻重拾魔法。斯特凡、卡罗琳和阿拉里克三人一起帮助邦妮寻找对于她生命中的两个最重要的男人，达蒙和恩佐。斯特凡与卡罗琳会举行一场盛大的婚礼，关闭了人性的达蒙将回到神秘瀑布镇参加婚礼的泰勒残忍杀害。邦妮最终打破了诅咒将沉睡的埃琳娜唤醒；同时，邪恶的女王凯瑟琳也从地狱中走出。', 'f', '1364.448', 'https://image.tmdb.org/t/p/original/jJR1d2RjfzqFaabbPbdXlPw2CHm.jpg', '{1957,10067,2180,37423,1081}', '{US}', '2016-10-21 00:00:00', 0, 43, '{en}', 'Ended', '', 'f', '7.300', 8723, 2, '{"id": 18165, "imdb_id": "tt1405406", "tvdb_id": 95491, "tvrage_id": 21766, "twitter_id": "cwtvd", "facebook_id": "thevampirediaries", "freebase_id": null, "wikidata_id": "Q28537", "freebase_mid": "/m/05sy2k_", "instagram_id": "thecwtvd"}');

