INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (908, 45137, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '弗兰克失踪后出现在多伦多，他努力戒酒却没有成功，为了保护自己的残疾津贴，他不惜触犯法律；菲奥娜爱上了史蒂夫，一个拥有好车、大钱包和大秘密的英俊男人；伊恩开始接受自己的性取向，这让他爱动脑筋的弟弟利普非常懊恼；黛比在一个孩子的生日派对上做得太过分了；莫妮卡带着关于婴儿利亚姆的消息出现了。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/3L0ewQDnvgWdfL8rYi4fdHeiell.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2011-01-09 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.800', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (909, 45138, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '弗兰克和莫妮卡重新点燃了他们自毁的关系，因为弗兰克的母亲从监狱回来大肆破坏；菲奥娜被史蒂夫从里约带回来的惊喜吓了一跳；利普为迎接他和凯伦的孩子的到来做了很大的改变； 凯伦和希拉因为凯伦的新丈夫乔迪而发生冲突，乔迪是她在匿名性恋者协会认识的一个心地善良但性格怪异的人；伊恩试图进入西点军校；黛比为青春期的到来做准备；凯文和维罗妮卡考虑组建家庭。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/v7yEZZCMXgSMoGBr4DRcj4wwBGt.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2012-01-08 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.300', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (910, 45140, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '吉米努力平衡他与菲奥娜的关系和对埃斯特法尼亚的义务；菲奥娜找到了一份公司工作；弗兰克彻底疏远了他的孩子们，然后又试图赢回他们；凯伦回来了，并在利普和曼迪之间挑拨离间，后果不堪设想；希拉和乔迪试图抚养凯伦的孩子；伊恩爱上了米奇；黛比饱受生长痛的折磨；卡尔去参加夏令营；凯夫和V想出了一个非常规的方法来拥有自己的孩子。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/j4tFVJ926chUO9rWfHxCVw6WP18.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2013-01-13 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.500', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
