INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (911, 45141, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '菲奥娜与她的老板/男友的野蛮弟弟发生了感情纠葛，并在一次派对上出了大错，惹上了严重的法律纠纷；弗兰克与肝病作斗争，并与失散多年的家人重逢；利普在现实的大学生活中挣扎；伊恩迫使米奇正视自己的性取向；黛比和卡尔都找到了新的爱情；希拉试图收养一个美国原住民家庭；凯夫和小维面对大家庭的现实。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/xunL4azPNRRVYqPqLhxgezwAUBr.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2014-01-12 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.800', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (912, 63466, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '菲奥娜陷入了一段出人意料的三角恋，经历了一些性格塑造的成长阵痛；弗兰克爱上了一位垂死的医生；利普投身于大学生活，并与一位导师发生了恋情；伊恩和米奇努力控制伊恩的躁郁症；萨米仍然是每个人心中的一根刺；黛比以多种方式成为女人；卡尔陷入了严重的法律纠纷；凯文和小微经历了一段艰难的时期。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/hq3BoH2LJfwInCTn3Vc3k8NGfBC.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2015-01-11 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.200', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (913, 70404, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '加拉格尔一家终于振作起来，开始独立生活，但成长也意味着分离。有一件事是肯定的：如果你姓加拉格，没有什么事是容易的，除了麻烦。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/AnA6suQeG9vBF0tx3IFKCLPdq3m.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2016-01-10 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.100', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (914, 77841, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '加勒格家族一直对彼此忠心耿耿，但现在弗兰克做得太过分了，他愤怒的家人最终会宣战吗？可以肯定的是：只要你姓加拉格，就不会有无聊的时刻。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/eOqXdkg0flz99a0OXpNKoQTSp7Z.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2016-10-02 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.100', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (915, 91214, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '加勒格一家终于迎来了春天！弗兰克努力成为对社会有贡献的人，菲奥娜成功当上了房东，利普努力保持清醒，伊恩投身于一项事业，黛比作为单亲妈妈在工作与生活中游刃有余，卡尔发挥创意寻找学费，而利亚姆则发现了高卢家族有多么与众不同。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/1E6asdJoCpoalo8mrFerAHFKANj.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2017-11-05 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.800', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (916, 104861, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '政治狂热席卷南区，加拉格一家将正义掌握在自己手中。弗兰克在议员竞选中找到了赚钱门路，菲奥娜试图在自己公寓楼的成功基础上再接再厉，利普通过收留埃迪的侄女来分散自己对戒酒挑战的注意力，伊恩面临着他的 "同性恋耶稣 "罪行所带来的后果，黛比为同工同酬而奋斗并与骚扰作斗争，卡尔将目光投向了西点军校，而利亚姆则必须发展新的技能，才能在舒适的私立学校之外生存下去。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/von3HnQF4SokUopZV6FXt12NfXM.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2018-09-09 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.000', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (917, 128829, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '弗兰克的经历让他找到了一位老朋友，黛比用铁腕统治着加拉格一家，利普在与塔米的关系中游刃有余，卡尔面临着军校毕业后的生活，利亚姆在小微的指导下了解黑人历史和文化，凯文则面临着身份危机。此外，加拉维奇回归，伊恩和米奇在狱中以狱友和恋人的身份重燃爱火。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/acsjvSF7mNZcjsA1Q3bXMmWm1A2.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2019-11-10 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.300', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
