INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (918, 142132, NULL, 34307, '无耻之徒', 'https://image.tmdb.org/t/p/original/bFVx0ydejF6NE8SEAVz95ns0o6A.jpg', NULL, 0, '{18,35}', 'http://www.sho.com/shameless', 'en', 'Shameless', '这是加拉格家族的最后一次聚会，你将受邀参加这场终结所有聚会的派对。在经历了十年的混乱之后，南区最受欢迎的家族将以有史以来最大的轰动宣告解散。这将是一段疯狂的最后旅程，但即将发生的变化将迫使他们每个人要么挺身而出，要么离开。虽然在一个过犹不及的家庭里，"退化 "可能比 "进化 "来得更自然，但他们知道有一件事是肯定的是——加拉格一家可能会长大，但他们永远不会分开。', 'f', '4158.229', 'https://image.tmdb.org/t/p/original/9akij7PqZ1g6zl42DQQTtL9CTSb.jpg', '{37423,1512,1957,4343,168706,11842}', '{US}', '2020-12-06 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.100', 2556, 2, '{"id": 34307, "imdb_id": "tt1586680", "tvdb_id": 161511, "tvrage_id": 25117, "twitter_id": "SHO_Shameless", "facebook_id": "ShamelessOnShowtime", "freebase_id": null, "wikidata_id": "Q23599", "freebase_mid": "/m/0dll6_j", "instagram_id": "shameless"}');
