INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (996, 42567, NULL, 30984, '死神', 'https://image.tmdb.org/t/p/original/o0NsbcIvsllg6CJX0FBFY8wWbsn.jpg', NULL, 0, '{10759,16,10765}', 'https://bleach-anime.com', 'ja', 'BLEACH', '橘发少年黑崎一护是个正义感爆棚的高中生，与父亲、两个妹妹共同生活，从小他就有能看见鬼魂的本事，但并不以为意。一天夜里一只叫“虚”的怪物攻击了一护和他的家人，尾随怪物而来的死神朽木露琪亚身负重伤，只得将灵力转给一护，由他代死神之职。岂料“代职”一发不可收拾，一段时间后，尸 魂界发现露琪亚的违规行为，来人将她抓走。为救出朋友，一护在浦原商店店主浦原喜助的帮助下，集结了井上织姬、石田雨龙、茶渡泰虎几位好友，一同前往尸魂界。与此同时，尸魂界瀞灵廷内一场惊天阴谋也在慢慢掀开……', 'f', '3401.805', 'https://image.tmdb.org/t/p/original/mB6h4mlZXufkWtt58Bh1DiVvNgv.jpg', '{3234,2883,2918,3034,1778,187238}', '{JP}', '2004-10-05 00:00:00', 0, 24, '{ja}', 'Returning Series', '', 'f', '7.900', 1735, 2, '{"id": 30984, "imdb_id": "tt0434665", "tvdb_id": 74796, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q5362638", "freebase_mid": "/m/07tt9hk", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (997, 295738, NULL, 30984, '死神', 'https://image.tmdb.org/t/p/original/o0NsbcIvsllg6CJX0FBFY8wWbsn.jpg', NULL, 0, '{10759,16,10765}', 'https://bleach-anime.com', 'ja', 'BLEACH', '为了拯救遭到「无形帝国」袭击的尸魂界，死神代行·黑崎一护毫不犹豫地投身战斗。然而，由于接受了灭却师始祖·尤哈巴赫的命令，星十字骑士团的入侵导致许多死神接连惨死。星十字骑士团拥有夺取卍解的手段，护廷十三隊甚至连队长级别都在苦战，奋斗的一护也在尤哈巴赫面前力不从心，刀被折断。一心向失意的一护讲述了过去。了解自己，下定决心再次站起来的一护现在踏上了修炼之路。为了保护重要的伙伴和一切，他将新的力量掌握在手中。另一方面，与一护采取不同行动的灭却师末裔·石田雨龙。雨龙通过解读记录寻求真相，最终得到的答案是什么？尤哈巴赫指定的「继承人」在「无形帝国」引发涟漪，战局进入新阶段。', 'f', '3401.805', 'https://image.tmdb.org/t/p/original/AaYKA3SDMwab0QuHvNd9Ki7FUO8.jpg', '{3234,2883,2918,3034,1778,187238}', '{JP}', '2022-10-11 00:00:00', 0, 24, '{ja}', 'Returning Series', '', 'f', '8.300', 1735, 2, '{"id": 30984, "imdb_id": "tt0434665", "tvdb_id": 74796, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q5362638", "freebase_mid": "/m/07tt9hk", "instagram_id": null}');
