INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (999, 58468, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '2005年版的第九任博士是忧郁的战争幸存者，经历了时之战争，他封印了他的种族和敌人戴立克，是唯一活下来的人。  该剧讲述了名为“Doctor”（克里斯托弗·埃克莱斯顿 Christopher Eccleston 饰）的神秘外星时间旅行者，随着他的时空机器TARDIS的（Time And Relative Dimensions In Space）冒险故事，他的时空机器外观看上去像1950年代的警亭。博士带着他的伙伴罗斯（比莉·派佩 Billie Piper 饰）在时间、空间中探索悠游、打击邪恶力量、拯救文明、帮助人民、纠正错误、解决各类问题。 ©豆瓣', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/9Jt2FFCAME7eHDC28r4qCHErhhF.jpg', '{4762,80893,12113}', '{CA,GB}', '2005-03-26 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.700', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1000, 58469, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '这是第一个以大卫·坦南特为第十位博士的系列。他继续与他的同伴罗斯·泰勒（比莉·派珀饰）一起旅行，他与他的依恋越来越紧密。他们还与罗斯的男友米奇·史密斯（诺埃尔·克拉克饰）短暂旅行，卡米尔·科杜里重新扮演罗斯的母亲杰基。该系列由一个松散的故事弧连接起来，该故事弧由反复出现的单词“火炬木”组成。这也是第一个在圣诞节特别节目之前推出的系列，该特别节目旨在了解该节目在圣诞节的表现如何。“圣诞入侵”的成功使圣诞节特别节目成为一年一度的传统。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/oXVmsIkZCgJDNcZJJxzvV7zwyb1.jpg', '{4762,80893,12113}', '{CA,GB}', '2006-04-15 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.400', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1001, 58470, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '神秘博士第三季，电视剧名，主演David,Tennant，2007年在欧美发行，该剧是一个内容丰富、极具追看性的科幻历险故事。故事主人翁the Doctor是一个机智英勇，能穿越时间空间的冒险家。他与其亲密拍挡Rose在进行紧张刺激的宇宙探索之际，竟遇上了有意毁灭地球的外层空间怪物 Dalek。凭着the Doctor的机智及能力，究竟他能否阻止 Dalek 侵袭地球，避免这场浩劫的发生。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/67xbjSv353G2rqQIs6dnDKc6P11.jpg', '{4762,80893,12113}', '{CA,GB}', '2007-04-01 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.800', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1002, 58471, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '在第十任博士的故事里，他始终强烈的孤独。仿佛诅咒，他的同伴——所有的人总有一天离开他；自己并一个人地走向死亡。在他的生命最终结束的时候，坐着塔迪斯和过去的同伴一一告别。第十任是一个轻松健谈，随和机智的人，对敌人总会给予第二次机会却又绝不过分仁慈。曾经和女伴罗斯有过一场恋爱，最后以两人分隔在不同的宇宙告终，之后也和其它的同伴一起环游宇宙，拯救世界。第十任一般穿深褐色（蓝色条纹）或蓝色（铁锈红条纹）四个扣子的西装，衬衫和领带，浅棕色的人造麂皮大衣。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/h6hogh9U371q87XLhvrJbczg8lm.jpg', '{4762,80893,12113}', '{CA,GB}', '2008-04-05 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.800', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1003, 58472, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '第十一任博士第一次出现在特别篇《时之终结》的最后一分钟时，然后在《第十一小时 11th》中他第一次见到艾米，并调查墙上的一个神秘裂缝。然后艾米在她的结婚前夕，同意加入博士的旅行。而后博士也选择了第二个同伴罗利。在第六季博士获悉，艾米和罗利的孩子长大后会成为River Song，并在结婚仪式上阻止了博士的死亡，以防止世界崩溃。第十一任被描绘成一个充满活力，童心活泼的灵魂，拥有傲慢的脾气，性急但富有同情心的人。第十一任声称他是“一个愚蠢的自私的人”，甚至说，宇宙中没有人恨他，他恨自己。尽管他的自我厌恶，或许正因为如此，博士愿意牺牲自己，如果需要的话。River曾表示，博士总是领先一步，心中始终有一个计划。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/hUsQerEeMqsu9cVYzMEB2OGJjrw.jpg', '{4762,80893,12113}', '{CA,GB}', '2010-04-03 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.600', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1004, 58473, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '神秘博士再度归来！博士将踏足美国，与Amy和百夫长Rory展开全新征程，等等，还有！River Song，这个神秘莫测的女人将再次回到博士身边，River Song到底是谁？她和博士是什么关系？万众期待的“博士的妻子”一集也将在本季中播出，由科幻大师尼尔·盖曼亲自撰写的该集将会把剧情推向何处？又会揭开博士的哪些秘密？', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/xmfMcVkVer5r33QhA4e2DpIR78B.jpg', '{4762,80893,12113}', '{CA,GB}', '2011-04-23 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.500', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1005, 58474, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '新一季的《神秘博士》，Amy和Rory将伴随博士走完2012，他们将在今年播出的5集当中与博士告别，在圣诞节特别集中，我们将认识新的博士伙伴，并和她一起跨入神秘博士的第50个年头。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/6biGcR0OyFnKRxxUW7bGtK49wTd.jpg', '{4762,80893,12113}', '{CA,GB}', '2012-09-01 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.100', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1006, 58475, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '系列8共有12集，于2013年5月20日获得英国广播公司正式预订。[1]史蒂芬·莫法特担任本系列的首席编剧，与布瑞恩·明钦同为执行制片人。本系列于2005年复活后的第8季，整个系列的第34季。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1007, 64188, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '这是第二系列主演彼得作为第十二任博士，一个外星人时间领主们穿越时间和空间，通过他的TARDIS，看起来像是在英国警察岗亭。珍娜科尔曼将作为医生的伴侣克拉拉奥斯瓦尔德。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/AeFY6HsLGcanP2fhD6Feii9BhHW.jpg', '{4762,80893,12113}', '{CA,GB}', '2015-09-19 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.300', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
