INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1008, 76615, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '系列10共有14集，包括2016年和2017年的2集圣诞特辑和12集常规剧。本系列常规剧于2017年4月15日首播，7月1日完结。史蒂芬·莫法特继续担任首席编剧和执行制片人，这是他担任本剧首席编剧的第6个也是最后一个系列。本系列是2005年复活后的第10季，整个系列的第36季。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1009, 97100, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', 'BBC宣布续订《神秘博士》第十一季，不过重点在于，《神探夏洛克》编剧Steven Moffat将在第十季结束后退出该剧，将帅印交给《小镇疑云》编剧Chris Chibnall。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1010, 135741, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '本系列在剧情上承接2019年元旦播出的新年特辑《新年决心》，朱迪·惠特克继续饰演第十三任博士，一位通过塔迪斯穿越时空的外星人，是她主演博士的第2个常规系列。布拉德利·沃尔什、托辛·科尔和曼迪·吉尔继续饰演博士的同伴格雷姆·奥布莱恩、瑞恩·辛克莱和娅斯敏·坎。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1011, 175012, NULL, 57243, '神秘博士', 'https://image.tmdb.org/t/p/original/vcFW09U4834DyFOeRZpsx9x1D3S.jpg', NULL, 0, '{10759,18,10765}', 'http://www.bbc.co.uk/programmes/b006q2x0', 'en', 'Doctor Who', '《神秘博士》第13季宣布开拍。运作人Chris Chibnall透露新季将缩短为8集，因为该剧拍摄的复杂性，在新冠疫情下拍每一集所需的时间延长了，“不过《神秘博士》的雄心、幽默、乐趣和惊吓是不会少的。如今对全世界来说充满考验，但博士从不逃避挑战”。', 'f', '1848.802', 'https://image.tmdb.org/t/p/original/hnAwYE6NvC4UVdMRPd7FOX52PQy.jpg', '{4762,80893,12113}', '{CA,GB}', '2021-10-31 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.200', 2883, 2, '{"id": 57243, "imdb_id": "tt0436992", "tvdb_id": 78804, "tvrage_id": 3332, "twitter_id": "bbcdoctorwho", "facebook_id": "DoctorWho", "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/0wp920q", "instagram_id": "bbcdoctorwho"}');
