INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1013, 43878, NULL, 32608, '远古外星人', 'https://image.tmdb.org/t/p/original/yLzXkfBR0aYt00W3gboloVst98D.jpg', NULL, 0, '{99,9648,10765}', 'http://www.play.history.com/shows/ancient-aliens', 'en', 'Ancient Aliens', '如果地球上的生命开始于外太空呢？数百万人接受了这样的理论：智能生命体在几千年前访问了地球，并被原始人当作神来崇拜。像巨石阵和复活节岛这样的纪念碑是古代外星人访问的最后遗迹吗？从无法解释的超级结构，到太阳系的知识、数学，甚至是发电的能力，这部特别节目探讨了超人类对古代人类影响的证据，并开始在世界各地寻找答案。这是对一些人认为不可能是真的理论的调查，但许多人同意不能忽视。', 'f', '4274.761', 'https://image.tmdb.org/t/p/original/wiU96O5JeexTe26BCOta1xfsznm.jpg', '{11453}', '{US}', '2010-04-20 00:00:00', 0, 42, '{en}', 'Returning Series', '', 'f', '5.500', 245, 2, '{"id": 32608, "imdb_id": "tt1643266", "tvdb_id": 101501, "tvrage_id": 25490, "twitter_id": "AncientAliens", "facebook_id": "ancientaliens", "freebase_id": "/en/ancient_aliens", "wikidata_id": "Q2501910", "freebase_mid": "/m/0bs56ws", "instagram_id": "ancientaliens"}');
