INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1307, 3697, NULL, 1412, '绿箭侠', 'https://image.tmdb.org/t/p/original/6UvUlyxNrLStWARart544iFXTWF.jpg', NULL, 0, '{80,18,10759}', 'http://www.cwtv.com/shows/arrow', 'en', 'Arrow', '拥有上亿身价的花花公子奥利弗·奎因（Oliver Queen）遭遇翻船事故，被困在中国南海的一座小岛上。5年后，一艘偶然经过的渔船发现了奥利弗，并将他救出。当重返家乡斯塔林时，他受到了家人和朋友的热烈欢迎，但他们并不知道，眼前的奥利弗·奎因已不再是曾经的那个纨绔子弟。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1308, 3699, NULL, 1412, '绿箭侠', 'https://image.tmdb.org/t/p/original/6UvUlyxNrLStWARart544iFXTWF.jpg', NULL, 0, '{80,18,10759}', 'http://www.cwtv.com/shows/arrow', 'en', 'Arrow', '奥利弗化身绿箭侠来维护城市的治安，但在好友汤米因贫民窟爆炸事件死亡之后便从斯塔林城消失了。后随狄格和费莉希蒂回到斯塔林城后发现斯塔林城的情况比他想象的还要糟糕，这让他不得不重新回到治安维持者的位置。奥利弗与费莉希蒂和狄格一同开始打击各类犯罪案件，但为了纪念汤米，奥利弗决定不再杀人，而是制服那些罪犯，把审判和制裁的事情交给警察和法官。金丝雀莎拉也加入了绿箭团队，与绿箭侠一起打击犯罪。与此同时，与奥利弗在炼狱岛上相识的斯莱德也来到了斯塔林城，利用米拉库鲁血清制造出各类事件来夺走奥利弗身边珍爱的的人与物，为莎朵报仇，而奥利弗为保护自己身边的人从而与斯莱德之间展开了一场斗争。', 'f', '2974.574', 'https://image.tmdb.org/t/p/original/wF9HS0mLjO0rwjUYw9iCxlpy0KU.jpg', '{27711,9993,1957}', '{US}', '2013-10-09 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.900', 5796, 2, '{"id": 1412, "imdb_id": "tt2193021", "tvdb_id": 257655, "tvrage_id": 30715, "twitter_id": "CW_Arrow", "facebook_id": "CWArrow", "freebase_id": null, "wikidata_id": "Q552314", "freebase_mid": "/m/0l170__", "instagram_id": "cw_arrow"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1309, 62018, NULL, 1412, '绿箭侠', 'https://image.tmdb.org/t/p/original/6UvUlyxNrLStWARart544iFXTWF.jpg', NULL, 0, '{80,18,10759}', 'http://www.cwtv.com/shows/arrow', 'en', 'Arrow', '第三季的主题是“身份”，每个核心角色都会探索自己的身份问题。在《绿箭侠》的前两季中，奥利弗·奎恩在孤岛上成长、生存以及战斗的画面都是通过闪回的方式重现，而在他离开孤岛和回到星城之前，还有一段时间是在中国香港度过的，第三季也将讲述他的这段岁月。尽管仍将通过闪回的方式，但新一季中的闪回却与前两季不同，奥利弗在香港的这段岁月，将会解答前两季一些非常关键的问题，比如奥利弗与阿曼达·沃勒背后的那些故事，比如他是怎么学会开飞机的，这些都将在有关香港的闪回场景中交代清楚。', 'f', '2974.574', 'https://image.tmdb.org/t/p/original/uWwGLfG1SVeXseEo5VYO2IfT5VJ.jpg', '{27711,9993,1957}', '{US}', '2014-10-08 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.600', 5796, 2, '{"id": 1412, "imdb_id": "tt2193021", "tvdb_id": 257655, "tvrage_id": 30715, "twitter_id": "CW_Arrow", "facebook_id": "CWArrow", "freebase_id": null, "wikidata_id": "Q552314", "freebase_mid": "/m/0l170__", "instagram_id": "cw_arrow"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1310, 67989, NULL, 1412, '绿箭侠', 'https://image.tmdb.org/t/p/original/6UvUlyxNrLStWARart544iFXTWF.jpg', NULL, 0, '{80,18,10759}', 'http://www.cwtv.com/shows/arrow', 'en', 'Arrow', '绿箭侠归来，面对的是达米安·达克领导的“幽灵”组织。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1311, 79710, NULL, 1412, '绿箭侠', 'https://image.tmdb.org/t/p/original/6UvUlyxNrLStWARart544iFXTWF.jpg', NULL, 0, '{80,18,10759}', 'http://www.cwtv.com/shows/arrow', 'en', 'Arrow', '绿箭小队在失去劳蕾尔·兰斯之后失去了控制，但奥利弗·奎恩受到了费莉希蒂·斯莫克的鼓舞，他们决定在约翰·迪格尔重新回到军队以及他的妹妹西娅·奎恩不再与他一同当治安维持者的情况下寻找新的团队成员。奥利弗投身于其他的工作，而西娅只能一个人处理市长事务，于是西娅决定任命昆汀·兰斯为星城市副市长。
