INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1345, 51045, NULL, 39793, '呼叫助产士', 'https://image.tmdb.org/t/p/original/aV17NN99u4dYUPlxqsmxOOKr3Xc.jpg', NULL, 0, '{18}', 'http://www.bbc.co.uk/programmes/p0118t80', 'en', 'Call the Midwife', '这一季，Chummy、PC Noakes和婴儿Freddy回到了东区，Jenny在个人和职业上都面临巨大的挑战。', 'f', '1804.471', 'https://image.tmdb.org/t/p/original/gHVlpiYSJ12WzwB9d89mRDtY582.jpg', '{3324,1522}', '{GB}', '2014-01-19 00:00:00', 0, 52, '{en}', 'Returning Series', '在1950年的伦敦，他们为所有人带来了希望。', 'f', '6.600', 206, 2, '{"id": 39793, "imdb_id": "tt1983079", "tvdb_id": 255192, "tvrage_id": 30579, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q172230", "freebase_mid": "/m/0gyj6kp", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1346, 64031, NULL, 39793, '呼叫助产士', 'https://image.tmdb.org/t/p/original/aV17NN99u4dYUPlxqsmxOOKr3Xc.jpg', NULL, 0, '{18}', 'http://www.bbc.co.uk/programmes/p0118t80', 'en', 'Call the Midwife', '第四季发现社区准备进入一个新的十年--1960年代。Trixie护士收到了年轻英俊的牧师Tom Hereward的求婚。Cynthia护士开始认真考虑加入修女会，这让Trixie和Patsy都很震惊。一系列意想不到的事件使Chummy接受了为未婚女孩经营母婴之家的挑战。', 'f', '1804.471', 'https://image.tmdb.org/t/p/original/qgxI3FUfouwnxey9SB9ze4mTnaA.jpg', '{3324,1522}', '{GB}', '2015-01-18 00:00:00', 0, 52, '{en}', 'Returning Series', '在1950年的伦敦，他们为所有人带来了希望。', 'f', '6.400', 206, 2, '{"id": 39793, "imdb_id": "tt1983079", "tvdb_id": 255192, "tvrage_id": 30579, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q172230", "freebase_mid": "/m/0gyj6kp", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1347, 72706, NULL, 39793, '呼叫助产士', 'https://image.tmdb.org/t/p/original/aV17NN99u4dYUPlxqsmxOOKr3Xc.jpg', NULL, 0, '{18}', 'http://www.bbc.co.uk/programmes/p0118t80', 'en', 'Call the Midwife', '在第五季中，Monica Joan修女在圣诞节期间失踪了，让修女和护士们心烦意乱。Shelagh急忙组建了一个儿童合唱团，以备BBC在教堂的广播。在其他地方，Trixie在与酒精作斗争后，在她的健身课程中找到了新的目标。牧师Tom Hereward和Barbara之间的友谊会不会变成更多的东西？', 'f', '1804.471', 'https://image.tmdb.org/t/p/original/9Ew3p4uAzo9DQPTY0vIeR45pjog.jpg', '{3324,1522}', '{GB}', '2016-01-17 00:00:00', 0, 52, '{en}', 'Returning Series', '在1950年的伦敦，他们为所有人带来了希望。', 'f', '7.500', 206, 2, '{"id": 39793, "imdb_id": "tt1983079", "tvdb_id": 255192, "tvrage_id": 30579, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q172230", "freebase_mid": "/m/0gyj6kp", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1348, 83078, NULL, 39793, '呼叫助产士', 'https://image.tmdb.org/t/p/original/aV17NN99u4dYUPlxqsmxOOKr3Xc.jpg', NULL, 0, '{18}', 'http://www.bbc.co.uk/programmes/p0118t80', 'en', 'Call the Midwife', '现在是1962年，Nonnatus之家的团队一如既往地致力于照顾白杨镇的人们。然而，外部世界的社会革命正反映在离家更近的变化和挑战上。当他们努力帮助母亲和家庭应对生育、残疾、疾病和社会偏见的要求时，我们亲爱的医护人员必须做出选择--并与他们自己的战斗战斗。第六系列将看到他们一起笑，一起哭，一起努力，以前所未有的方式相互支持。', 'f', '1804.471', 'https://image.tmdb.org/t/p/original/copB0FCkHyRS2K0PIJHmeAQmJs8.jpg', '{3324,1522}', '{GB}', '2017-01-22 00:00:00', 0, 52, '{en}', 'Returning Series', '在1950年的伦敦，他们为所有人带来了希望。', 'f', '7.400', 206, 2, '{"id": 39793, "imdb_id": "tt1983079", "tvdb_id": 255192, "tvrage_id": 30579, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q172230", "freebase_mid": "/m/0gyj6kp", "instagram_id": null}');
