INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1349, 98248, NULL, 39793, '呼叫助产士', 'https://image.tmdb.org/t/p/original/aV17NN99u4dYUPlxqsmxOOKr3Xc.jpg', NULL, 0, '{18}', 'http://www.bbc.co.uk/programmes/p0118t80', 'en', 'Call the Midwife', '在第七系列中，修女和护士们受到了前所未有的考验，无论是个人还是职业方面。在他们周围，他们看到旧的东区正在消失，因为贫民窟的清除为大胆的新塔楼让路，以适应不断扩大的社区。他们的工作使他们接触到各种各样的挑战，从麻风病和中风，到亨廷顿舞蹈症、白内障和未婚母亲。Trixie与Christopher的爱情继续发展，而Tom和Barbara则享受着已婚夫妇的生活。Crane护士发现她的权威受到了意想不到的质疑，Monica Joan修女被迫接受她的能力下降的事实。与此同时，当Shelagh决定雇用一名互惠生时，Turner夫妇的生活发生了翻天覆地的变化。', 'f', '1804.471', 'https://image.tmdb.org/t/p/original/dzKDpjpdAbqM6epuosjGd4CO82A.jpg', '{3324,1522}', '{GB}', '2018-01-21 00:00:00', 0, 52, '{en}', 'Returning Series', '在1950年的伦敦，他们为所有人带来了希望。', 'f', '5.800', 206, 2, '{"id": 39793, "imdb_id": "tt1983079", "tvdb_id": 255192, "tvrage_id": 30579, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q172230", "freebase_mid": "/m/0gyj6kp", "instagram_id": null}');
