INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1417, 8702, NULL, 2691, '好汉两个半', 'https://image.tmdb.org/t/p/original/coHpOy9OJyFiHWeH36cSHMpLUHC.jpg', NULL, 0, '{35}', 'http://www.cbs.com/shows/two_and_a_half_men/', 'en', 'Two and a Half Men', 'Charlie是一个潇洒自由的单身汉，但正面临离婚危机的兄弟Alan带着儿子Jake的突然来访完全打乱了Charlie悠然自得的生活，三个男人一台戏，这下可有得乐了，
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1418, 8703, NULL, 2691, '好汉两个半', 'https://image.tmdb.org/t/p/original/coHpOy9OJyFiHWeH36cSHMpLUHC.jpg', NULL, 0, '{35}', 'http://www.cbs.com/shows/two_and_a_half_men/', 'en', 'Two and a Half Men', '他是花花公子的典型，对女人很有手段，做广告配乐的，几乎不工作，却能赚大把的钱，穿梭不断的美女和音乐就是他生活的主题。可是alan的出现打破了他单身汉的快乐生活。Alan被老婆赶了出来，和兄弟Charlie住在一起。工作是指压按摩师。他是一个有责任心，对妻子百依百顺的好丈夫，但是唧唧歪歪的性格，粘粘糊糊的脾气，让人想到唐僧。一直试图和妻子和好，分居了还老回去干家务，她却宣布自己是女同性恋。一个儿子Jake，胖胖的很可爱，虽然年纪小小，也有点好色，无论多少东西都吃得下。大智若愚的性格，让他成为本剧的大亮点，一点不输给两个成年的男主角。和蜡笔小心有得一拼。值得一提的是 几个配角，让兄弟两个对女人产生阴影的魔鬼老妈，刻薄的前妻，拽得要死的清洁女佣，还有和Charlie共渡一夜之后就跟踪了他两三年的邻居Rose。', 'f', '1988.779', 'https://image.tmdb.org/t/p/original/l03f6HTmnc82LlDCvR2q6pfWO87.jpg', '{1957,35504,25039}', '{US}', '2004-09-19 00:00:00', 0, 30, '{en}', 'Ended', '', 'f', '7.100', 3057, 2, '{"id": 2691, "imdb_id": "tt0369179", "tvdb_id": 72227, "tvrage_id": 6454, "twitter_id": "TwoAndAHalfMen", "facebook_id": "TwoandaHalfMen", "freebase_id": "/en/two_and_a_half_men", "wikidata_id": "Q189267", "freebase_mid": "/m/01vnbh", "instagram_id": "two_and_a_half_men_official"}');
