INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1430, 68638, NULL, 63247, '西部世界', 'https://image.tmdb.org/t/p/original/yGNnjoIGOdQy3douq60tULY8teK.jpg', NULL, 0, '{10765,37}', 'http://www.hbo.com/westworld', 'en', 'Westworld', '《西部世界》的故事发生在未来，人们已经不再热衷于玩网络游戏，而是创造了高科技成人乐园，体验更加真实刺激的游戏。里面有不少机器人接待员，他们过着设定好的剧情生活。而游客呢，现实中不敢的胡作非为，在公园里都能无限制放纵，嫖妓、追凶甚至滥杀无辜。提供服务的机器人，也不是一般的机器人。他们不仅具有超高仿真外形，还有自身情感，而且能带给游客最真实的体验。比如，中弹以后会流血，受伤以后会痛苦地嗷叫。夜幕降临，所有机器人的记忆被清除，一切归零，第二天太阳升起，新一批游客入园。不过，在程序的失误以及程序员要求机器人更接近于人类思维和情感的情况下，机器人的自主意识和思维使他们开始怀疑这个世界的本质，进而觉醒并反抗人类.', 'f', '2034.755', 'https://image.tmdb.org/t/p/original/q2scu5X0jL7LdLGV1tPpeOOUwll.jpg', '{1957,2596,11461,103490}', '{US}', '2016-10-02 00:00:00', 0, 0, '{en}', 'Canceled', '', 'f', '8.400', 5273, 2, '{"id": 63247, "imdb_id": "tt0475784", "tvdb_id": 296762, "tvrage_id": 37537, "twitter_id": "WestworldHBO", "facebook_id": "WestworldHBO", "freebase_id": null, "wikidata_id": "Q17572811", "freebase_mid": "/m/011c6zcc", "instagram_id": "westworldhbo"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1431, 98895, NULL, 63247, '西部世界', 'https://image.tmdb.org/t/p/original/yGNnjoIGOdQy3douq60tULY8teK.jpg', NULL, 0, '{10765,37}', 'http://www.hbo.com/westworld', 'en', 'Westworld', '欢迎回到西部世界，在那里木偶表演已经结束，新解放的"东道主"将来到人类。在第二季，多洛雷斯（埃文·雷切尔·伍德）负责，梅夫（安迪·牛顿）正在执行任务，黑衣人（埃德·哈里斯）回来了。混沌在关于人工意识的黎明、新生命形式的诞生和辛的进化的黑暗奥德赛中控制了局面。', 'f', '2034.755', 'https://image.tmdb.org/t/p/original/5fcXEhoxgiGwsyep6zOkkte27tf.jpg', '{1957,2596,11461,103490}', '{US}', '2018-04-23 00:00:00', 0, 0, '{en}', 'Canceled', '', 'f', '7.900', 5273, 2, '{"id": 63247, "imdb_id": "tt0475784", "tvdb_id": 296762, "tvrage_id": 37537, "twitter_id": "WestworldHBO", "facebook_id": "WestworldHBO", "freebase_id": null, "wikidata_id": "Q17572811", "freebase_mid": "/m/011c6zcc", "instagram_id": "westworldhbo"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1432, 128116, NULL, 63247, '西部世界', 'https://image.tmdb.org/t/p/original/yGNnjoIGOdQy3douq60tULY8teK.jpg', NULL, 0, '{10765,37}', 'http://www.hbo.com/westworld', 'en', 'Westworld', '紧接第二季的战争起义，德洛莉丝（Dolores）与新洛杉矶的凯勒（Caleb）建立了联系，并理解了接待员如何生存在这个真正的世界。 与此同时，梅芙（Maeve）在另一个以第二次世界大战为主题的提洛斯公园（Delos park）中找回了自我意识，该公园位于法西斯意大利...', 'f', '2034.755', 'https://image.tmdb.org/t/p/original/hWhPIWuReRJykWVAp9esPMFyTFF.jpg', '{1957,2596,11461,103490}', '{US}', '2020-03-16 00:00:00', 0, 0, '{en}', 'Canceled', '', 'f', '7.500', 5273, 2, '{"id": 63247, "imdb_id": "tt0475784", "tvdb_id": 296762, "tvrage_id": 37537, "twitter_id": "WestworldHBO", "facebook_id": "WestworldHBO", "freebase_id": null, "wikidata_id": "Q17572811", "freebase_mid": "/m/011c6zcc", "instagram_id": "westworldhbo"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1433, 293172, NULL, 63247, '西部世界', 'https://image.tmdb.org/t/p/original/yGNnjoIGOdQy3douq60tULY8teK.jpg', NULL, 0, '{10765,37}', 'http://www.hbo.com/westworld', 'en', 'Westworld', '这一季讲述的是在漫长的战争结束七年后——人类终于获得了自由，至少看起来是这样。梅芙和凯莱布开始怀疑黑尔和一个接待员版的黑衣人试图重新控制人类。与此同时，伯纳德从升华之境中归来。还有一个年轻的作家，克里斯蒂娜，开始质疑她的现实的本质。', 'f', '2034.755', 'https://image.tmdb.org/t/p/original/6vpYOa9K8mqcJ7FqZvtBNk3bNoo.jpg', '{1957,2596,11461,103490}', '{US}', '2022-06-27 00:00:00', 0, 0, '{en}', 'Canceled', '', 'f', '7.200', 5273, 2, '{"id": 63247, "imdb_id": "tt0475784", "tvdb_id": 296762, "tvrage_id": 37537, "twitter_id": "WestworldHBO", "facebook_id": "WestworldHBO", "freebase_id": null, "wikidata_id": "Q17572811", "freebase_mid": "/m/011c6zcc", "instagram_id": "westworldhbo"}');
