INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1482, 3262, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', '小说家Hank Moody努力帮助抚养他13岁的女儿，同时为他的前女友Karen举着火炬。他对诚实的痴迷和他的自我毁灭行为同时破坏和丰富了他的事业。...这一切都发生在他最厌恶的城市。洛杉矶。', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/oyPRsli1eGtyZRFwfa6igms6zE2.jpg', '{57542,4343}', '{US}', '2007-08-13 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '7.800', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1483, 3263, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', '这一季，Hank和Karen终于将重新点燃他们久违的浪漫。但是，当Hank的新工作是为一位传奇音乐制作人写传记时，他们的爱情之路遇到了一个重大障碍，他陷入了他最喜欢的三种恶习--性、毒品和摇滚乐。与此同时，女儿Becca成长得太快了；最好的朋友兼经纪人Charlie和妻子Marcy正在处理上一季的婚外情的后果；Hank的新书大受欢迎--因为有人从他那里偷走了手稿，正沉浸在她新发现的、完全不需要的名声中。但是，没有什么能让老Hank长久地消沉下去--对我们最喜欢的享乐主义文学家来说，这一切只是城市中的另一天。', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/fJZhUplLENtZJZwvTrl2GHMaDqg.jpg', '{57542,4343}', '{US}', '2008-09-28 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '7.600', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1484, 3264, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', '这一季，Hank Moody的生活和经济一样，正式被颠覆了。由于缺乏写作任务，他不得不找一份大学教授的 "真正 "工作，同时试图让野孩子Becca保持正直，而Karen仍然在纽约工作。他能学会保持 "正常 "的工作时间，并激励下一代的文学家吗？首先，他必须站在学生院长、院长的妻子和对他的魅力免疫的教师助理的对立面......同时，Charlie回到了主流 -- 他放弃了色情世界，在一家合法机构工作。他唯一的问题是他的老板/机构负责人对他比她的客户更感兴趣（你好，Rick Springfield！）。如果有Marcy在他身边，这一切都可以应付，但她仍然对他的外遇耿耿于怀，甚至重新开始约会，这就更复杂了，因为两人是柏拉图式的合租--在经济衰退的情况下，谁能负担得起离婚？', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/rZE7zckzzJD04sz8aEWBt4yh4PN.jpg', '{57542,4343}', '{US}', '2009-09-27 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '7.200', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1485, 3265, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', 'Hank Moody回来了，而且他的处境非常糟糕。一夜的误解使他陷入了严重的困境，但他的麻烦还没有结束。Hank的文学性丑闻引起了轰动，甚至在他准备在法庭上为自己辩护并试图让Karen和Becca与他对话时，一部根据他被盗的书改编的电影也开始制作。', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/sr0cVYapnkL2aHyqu5L2RdCZDEi.jpg', '{57542,4343}', '{US}', '2011-01-09 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '7.200', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1486, 3268, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', 'Hank Moody已经成为嘻哈界的头号通缉犯。富有而强大的说唱大亨Samurai Apocalypse是拉皮条的名人--而且一心想让我们的坏男孩作家陷入前所未有的麻烦。Charlie追赶着奇怪的Marcy，而一个难以忍受的20岁的Hank崇拜者与他心爱的女儿Becca约会，Hank在这个他讨厌的小镇上得到了比以往更多的事情。', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/mTCNjUUJHUn6QhKJTgR2pRBi7WV.jpg', '{57542,4343}', '{US}', '2012-01-08 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '6.800', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1487, 3267, NULL, 1215, '加州靡情', 'https://image.tmdb.org/t/p/original/9o9SS26mUY4cp4iSFk7iwBeAQuP.jpg', NULL, 0, '{35,18}', 'http://www.sho.com/californication', 'en', 'Californication', '本季Hank与一位摇滚明星合作制作音乐剧，同时与他美丽的缪斯女神在一起，Charlie和Stu争夺Marcy，Marcy被一位激进的女权主义者所迷惑，Becca从大学辍学成为一名作家。', 'f', '3089.101', 'https://image.tmdb.org/t/p/original/dAL3a8hQLpKq4RjRyGWfLwMnSW3.jpg', '{57542,4343}', '{US}', '2013-01-13 00:00:00', 0, 28, '{en}', 'Ended', 'Hank Moody... 没有人比他更致力于中年危机。', 'f', '6.700', 1051, 2, '{"id": 1215, "imdb_id": "tt0904208", "tvdb_id": 80349, "tvrage_id": 15319, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q326143", "freebase_mid": "/m/02qwz3w", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1488, 823464, 'tt14539740', NULL, '哥斯拉大战金刚2：帝国崛起', 'https://image.tmdb.org/t/p/original/qrGtVFxaD8c7et0jUtaYhyTzzPg.jpg', '{"id": 1280074, "name": "金刚（系列）", "poster_path": "/lhyEUeOihbKf7ll8RCIE5CHTie3.jpg", "backdrop_path": "/qHY4ZMIDSmElhiykjhh40Q5qMJl.jpg"}', 150000000, '{878,28,12}', '', 'en', 'Godzilla x Kong: The New Empire', '继上一次的怪兽高燃对战之后，金刚和哥斯拉将再度联手对抗一个潜伏在世界中的巨大威胁，并逐步探索这些巨兽们的起源以及骷髅岛等地的奥秘。同时，上古之战的面纱也将会被揭晓，而正是那场战斗创造出了这些超凡的生物，并深刻影响了人类世界的命运。', 'f', '6633.896', 'https://image.tmdb.org/t/p/original/k26yu1YUYPNZVRFL65GLWfGwaMx.jpg', '{923,174}', '{US}', '2024-03-27 00:00:00', 558503756, 115, '{en}', 'Released', '双王合体 硬钢到底', 'f', '7.083', 1541, 1, '{"id": 823464, "imdb_id": "tt14539740", "twitter_id": "GodzillaXKong", "facebook_id": "GodzillaXKong", "wikidata_id": "Q113360912", "instagram_id": "godzillaxkong"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1489, 346698, 'tt1517268', NULL, '芭比', 'https://image.tmdb.org/t/p/original/ctMserH8g2SeOAnCw5gFjdQF8mo.jpg', NULL, 145000000, '{35,12}', '', 'en', 'Barbie', '在芭比乐园里，各种各样的芭比和肯每天都过着童话般100%完美的生活。但是某一天，芭比（玛格特·罗比 Margot Robbie 饰）发现自己的生活开始有了变化——比如她的一天不再一帆风顺，她开始思考死亡的意义，甚至她的双脚也不再是完美的高跟鞋形——她竟然脚掌落地了！接连出现的不完美打破了芭比乐园的平静，意识到存在感危机的芭比被迫前往真实世界探寻真相，肯（瑞恩·高斯林 Ryan Gosling 饰）也一路同行，一场大冒险就此开启。', 'f', '569.353', 'https://image.tmdb.org/t/p/original/7dK4kaCB0KuHWQwFrw5w5OgYOnW.jpg', '{82968,437,181486,6220,174}', '{GB,US}', '2023-07-19 00:00:00', 1445638421, 114, '{en}', 'Released', '芭比无所不能 他仅仅是肯', 'f', '7.100', 8238, 1, '{"id": 346698, "imdb_id": "tt1517268", "twitter_id": "barbiethemovie", "facebook_id": "BarbieTheMovie", "wikidata_id": "Q55436290", "instagram_id": "barbiethemovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1490, 414906, 'tt1877830', NULL, '新蝙蝠侠', 'https://image.tmdb.org/t/p/original/tRS6jvPM9qPrrnx2KRp3ew96Yot.jpg', '{"id": 948485, "name": "新蝙蝠侠（系列）", "poster_path": "/rTCJB5axQ8XOmGbpJBsiHkhKq14.jpg", "backdrop_path": "/qS2ViQwlWUECiAdkIuEaJZoq0QW.jpg"}', 185000000, '{80,9648,53}', '', 'en', 'The Batman', '布鲁斯·韦恩（罗伯特·帕丁森 饰）化身蝙蝠侠于哥谭市行侠仗义两年后，罪犯皆闻风丧胆，他也因此深入接触到哥谭市的阴暗面。他潜行于哥谭市腐败的政要名流关系网中，身边仅有的几个值得信赖的盟友——管家阿尔弗雷德·潘尼沃斯（安迪·瑟金斯 饰）与詹姆斯·戈登警长（杰弗里·怀特 饰）。这位独行的“义警侠探”在哥谭市民心中已成为“复仇”二字最当仁不让的代名词。', 'f', '648.918', 'https://image.tmdb.org/t/p/original/lwWl8CwHyHj6KkDOfhJOpp6xTn3.jpg', '{101405,119245,128064,174}', '{US}', '2022-03-01 00:00:00', 771000000, 176, '{en}', 'Released', '谜雾暗涌危机四伏 哥谭侠影重磅出击', 'f', '7.679', 9573, 1, '{"id": 414906, "imdb_id": "tt1877830", "twitter_id": "TheBatman", "facebook_id": "TheBatman", "wikidata_id": "Q61117344", "instagram_id": "thebatman"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1496, 49047, 'tt1454468', NULL, '地心引力', 'https://image.tmdb.org/t/p/original/a2n6bKD7qhCPCAEALgsAhWOAQcc.jpg', NULL, 105000000, '{878,53,18}', '', 'en', 'Gravity', '在美国太空站，一个男宇航员Matt Kowalsky和女同事Ryan Stone出舱修复望远镜时，卫星爆炸的碎片撞到了太空站，除了出舱的两人，其他人全部丧命。之后，漂浮在外、毫无凭借力的两人要想方设法地回到地球，他们遭遇了重重险情，Matt为了Ryan自我牺牲，让Ryan登上了一个废弃的俄罗斯空间站，并凭此再借力靠近中国的天宫一号，期间的各种故障让Ryan近乎绝望自杀，但凭借着濒死前看到Matt的幻象，她振作起来，找到方法登上了天宫一号，并最终返回地球。', 'f', '492.887', 'https://image.tmdb.org/t/p/original/3hc1fcozqnkFFe5wZ1bU7Lxb5fJ.jpg', '{7470,174,437}', '{GB,US}', '2013-10-03 00:00:00', 723192705, 91, '{en}', 'Released', '史上最强太空科幻电影', 'f', '7.164', 14927, 1, '{"id": 49047, "imdb_id": "tt1454468", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q2579784", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1491, 298618, 'tt0439572', NULL, '闪电侠', 'https://image.tmdb.org/t/p/original/yF1eOkaYvwiORauRCPWznV9xVvi.jpg', NULL, 220000000, '{28,12,878}', '', 'en', 'The Flash', '自从成为正义联盟中的一员，闪电侠巴里（埃兹拉·米勒 Ezra Miller 饰）便成为一个日夜忙碌的超级英雄。可是虽然他已经具备了拯救世人的非凡能力，却依旧对自己既定的命运束手无策。父亲弑妻案（朗·里维斯顿 Ron Livingston 饰）复审在即，关键证据又无法有效 佐证。由于之前对战荒原狼时曾短暂超越光速穿越时空，巴里不顾蝙蝠侠（迈克尔·基顿 Michael Keaton 饰）的劝阻，一路穿越到母亲遇害的那一天。他原本以为通过不起眼的小动作能够拯救母亲，却不曾想宇宙因为这个意外转折而发生蝴蝶效应。当巴里回到自己变成闪电侠的前夕，他发现父母健康快乐的生活，而海王、钢骨、戴安娜等超级战士似乎缺席了这个时代。更糟糕的是，追杀超人的佐德将军（迈克尔·珊农 Michael Shannon 饰）降临地球，他将在毫无阻碍的情况下毁灭世界……', 'f', '545.815', 'https://image.tmdb.org/t/p/original/b1YUXJ0Crdf0xywYFNlHHaQjixI.jpg', '{174,152809,170335,128064}', '{US}', '2023-06-13 00:00:00', 271333313, 144, '{en,es,ru}', 'Released', '一个拯救至亲的温柔决定 引爆宇宙冲撞的混沌危机', 'f', '6.740', 3879, 1, '{"id": 298618, "imdb_id": "tt0439572", "twitter_id": "theFlash", "facebook_id": "TheFlash", "wikidata_id": "Q23562553", "instagram_id": "dctheflash"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1492, 603, 'tt0133093', NULL, '黑客帝国', 'https://image.tmdb.org/t/p/original/icmmSD4vTTDKOq2vvdulafOGw93.jpg', '{"id": 2344, "name": "黑客帝国（系列）", "poster_path": "/60P9Do7gz1nuvh3s2ksp7mdZrPZ.jpg", "backdrop_path": "/bRm2DEgUiYciDw3myHuYFInD7la.jpg"}', 63000000, '{28,878}', '', 'en', 'The Matrix', '不久的将来，网络黑客尼奥对这个看似正常的现实世界产生了怀疑。他结识了黑客崔妮蒂，并见到了黑客组织的首领墨菲斯。墨菲斯告诉他，现实世界其实是由一个名叫“母体”的计算机人工智能系统控制，人们就像他们饲养的动物，没有自由和思想，而尼奥就是能够拯救人类的救世主。可是，救赎之路从来都不会一帆风顺，到底哪里才是真实的世界？如何才能打败那些超人一样的特勤？尼奥是不是人类的希望？这是黑客的帝国，程序和代码欢迎大家的到来。', 'f', '575.344', 'https://image.tmdb.org/t/p/original/iTufGwAEMMIafxJg3RT2DtOgdZb.jpg', '{79,372,1885,174}', '{US}', '1999-03-31 00:00:00', 463517383, 136, '{en}', 'Released', '欢迎来到现实世界', 'f', '8.215', 24874, 1, '{"id": 603, "imdb_id": "tt0133093", "twitter_id": null, "facebook_id": "TheMatrixMovie", "wikidata_id": "Q83495", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1493, 577922, 'tt6723592', NULL, '信条', 'https://image.tmdb.org/t/p/original/yY76zq9XSuJ4nWyPDuwkdV7Wt0c.jpg', NULL, 205000000, '{28,53,878}', '', 'en', 'Tenet', '乌克兰基辅国家歌剧院，一伙蒙面歹徒突然闯入演出大厅，挟持在场数百名音乐家和观众。未过多久，乌克兰特警部队迅速赶到，并按照既定战术突入进去。与此同时，几名神秘之人换上特警部队肩章，趁乱潜入歌剧院，救出被困的美国大使。神秘人之一的男主（约翰·大卫·华盛顿 John David Washington 饰）虽然一度顺利完成任务，却身不由己置身死地。当他再度醒来，则被告知失去原有身份，此后将加入一个名为“信条”的秘密组织，去执行一项阻止世界毁灭的重大任务。早在歌剧院时，他便见识了一次逆转子弹的奇怪现象。而如今着手的任务，似乎正与逆转的子弹乃至逆转的时间息息相关。注定发生的必然会发生，所种何因，便结何果……', 'f', '594.759', 'https://image.tmdb.org/t/p/original/tASJpacWyivVyRnUahaxT2cJg5L.jpg', '{174,9996}', '{GB,US}', '2020-08-22 00:00:00', 365304105, 150, '{en,et}', 'Released', '逆转时空', 'f', '7.183', 9385, 1, '{"id": 577922, "imdb_id": "tt6723592", "twitter_id": "TENETFilm", "facebook_id": "tenetfilm", "wikidata_id": "Q63985561", "instagram_id": "tenetfilm"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1494, 475557, 'tt7286456', NULL, '小丑', 'https://image.tmdb.org/t/p/original/n6bUvigpRFqSwmPp1m2YADdbRBc.jpg', '{"id": 987044, "name": "小丑（系列）", "poster_path": "/jmopX21dlCinxmzd8KLOBFeN2P9.jpg", "backdrop_path": "/k1YC7mFLvxX4bbD7P8lkcML0Jek.jpg"}', 55000000, '{80,53,18}', '', 'en', 'Joker', '亚瑟·弗兰克是一个依靠扮演小丑赚取营生的普通人，患有精神疾病的他和母亲一同住在哥谭市的一座公寓里，幻想成为脱口秀演员的亚瑟为了这个目标而努力的生活着，但是现实却屡次击败他的梦想，亚瑟渐渐地变得越来越癫狂，某天在地铁上，亚瑟为了自保杀害了几名嘲笑他的人，同时，一个疯狂的想法在亚瑟心灵萌发……  在看似和平的哥谭市，即将发生翻天覆地的巨变。', 'f', '575.209', 'https://image.tmdb.org/t/p/original/kjNbXFfYLDUdFpfaMkzHbJ5Zq30.jpg', '{174,83036,79,13240,128064}', '{CA,US}', '2019-10-01 00:00:00', 1078958629, 122, '{en}', 'Released', '摆出一张笑脸吧', 'f', '8.161', 24577, 1, '{"id": 475557, "imdb_id": "tt7286456", "twitter_id": "jokermovie", "facebook_id": "jokermovie", "wikidata_id": "Q42759035", "instagram_id": "jokermovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1495, 27205, 'tt1375666', NULL, '盗梦空间', 'https://image.tmdb.org/t/p/original/8ZTVqvKDQ8emSGUEMjsS4yHAwrp.jpg', NULL, 160000000, '{28,878,12}', '', 'en', 'Inception', '道姆·柯布（莱昂纳多·迪卡普里奥 Leonardo DiCaprio 饰）与同事阿瑟（约瑟夫·戈登-莱维特 Joseph Gordon-Levitt 饰）和纳什（卢卡斯·哈斯 Lukas Haas 饰）在一次针对日本能源大亨齐藤（渡边谦 饰）的盗梦行动中失败，反被齐藤利用。齐藤威逼利诱因遭通缉而流亡海外的柯布帮他拆分他竞争对手的公司，采取极端措施在其唯一继承人罗伯特·费希尔（基里安·墨菲 Cillian Murphy 饰）的深层潜意识中种下放弃家族公司、自立门户的想法。为了重返美国，柯布偷偷求助于岳父迈尔斯（迈克尔·凯恩 Michael Caine 饰），吸收了年轻的梦境设计师艾里阿德妮（艾利奥特·佩吉 Elliot Page 饰）、梦境演员艾姆斯（汤姆·哈迪 Tom Hardy 饰）和药剂师约瑟夫（迪利普·劳 Dileep Rao 饰）加入行动。在一层层递进的梦境中，柯布不仅要对付费希尔潜意识的本能反抗，还必须直面已逝妻子梅尔（玛丽昂·歌迪亚 Marion Cotillard 饰）的处处破坏，实际情况远比预想危险得多……', 'f', '469.381', 'https://image.tmdb.org/t/p/original/aBGVsKeDn5gtegkyajPGBHWev25.jpg', '{923,9996,174}', '{GB,US}', '2010-07-15 00:00:00', 825532764, 148, '{en,fr,ja,sw}', 'Released', '你的梦境就是犯罪现场', 'f', '8.368', 35717, 1, '{"id": 27205, "imdb_id": "tt1375666", "twitter_id": null, "facebook_id": "inception", "wikidata_id": "Q25188", "instagram_id": null}');
