INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1497, 16281, 'tt0083767', NULL, '鬼作秀', 'https://image.tmdb.org/t/p/original/8aqTmCHLkktH7RZNALeaOMneHSl.jpg', '{"id": 107725, "name": "鬼作秀（系列）", "poster_path": "/wvoSFYgc36Zz2j8eDvysKDW1FZ.jpg", "backdrop_path": "/5dNsa8nte62HindzotT6P8X6Wj5.jpg"}', 8000000, '{27,35}', '', 'en', 'Creepshow', '　　全片分六段描述、恐怖的事，有鬼屋、杀人断头．．．．等，集恐怖之大成、饮血吸髓、包您大呼过瘾。', 'f', '455.320', 'https://image.tmdb.org/t/p/original/4SoyTCEpsgLjX6yAyMsx3AsAyRQ.jpg', '{14179,174,2483,95947}', '{US}', '1982-11-10 00:00:00', 21028755, 120, '{en}', 'Released', '', 'f', '6.931', 962, 1, '{"id": 16281, "imdb_id": "tt0083767", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1498, 141052, 'tt0974015', NULL, '正义联盟', 'https://image.tmdb.org/t/p/original/2nyaeISu2xIxIgZYNpX4UayY8PN.jpg', NULL, 300000000, '{28,12,878}', '', 'en', 'Justice League', '受到超人无私奉献的影响，蝙蝠侠重燃了对人类的信心，接受了新盟友——神奇女侠（戴安娜·普林斯）的帮助，去对抗更加强大的敌人。蝙蝠侠和神奇女侠一同寻找并招募了一支超人类联盟来抵挡新觉醒的威胁。', 'f', '354.998', 'https://image.tmdb.org/t/p/original/kAuH4BJ2LAWR6oKDDPnCICvuqJS.jpg', '{41624,9995,507,174,128064}', '{US}', '2017-11-15 00:00:00', 661326987, 120, '{en}', 'Released', '孤胆难救世 正义不独行', 'f', '6.100', 12638, 1, '{"id": 141052, "imdb_id": "tt0974015", "twitter_id": "justiceleaguewb", "facebook_id": "JusticeLeagueOfficial", "wikidata_id": null, "instagram_id": "justiceleague"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1499, 787699, 'tt6166392', NULL, '旺卡', 'https://image.tmdb.org/t/p/original/rOF4326lv2GRZfZWVR6U9OQ2Abo.jpg', NULL, 125000000, '{35,10751,14}', '', 'en', 'Wonka', '威利·旺卡，充满创意并决心一口一口改变世界，证明了生活中最美好的事物始于梦想。如果你足够幸运地遇到威利·旺卡，一切皆有可能。', 'f', '344.646', 'https://image.tmdb.org/t/p/original/iBh9D95rKBj3cbUM2gYIL0NLW57.jpg', '{174,79,214904,437,216687}', '{GB,US}', '2023-12-06 00:00:00', 632302312, 117, '{en}', 'Released', '世上所有美好的事 都始于一个梦想', 'f', '7.200', 2969, 1, '{"id": 787699, "imdb_id": "tt6166392", "twitter_id": "WonkaMovie", "facebook_id": "WonkaMovie", "wikidata_id": "Q108456719", "instagram_id": "wonkamovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1500, 786892, 'tt12037194', NULL, '疯狂的麦克斯：狂暴女神', 'https://image.tmdb.org/t/p/original/shrwC6U8Bkst9T9J7fr1A50n6x6.jpg', '{"id": 8945, "name": "疯狂的麦克斯（系列）", "poster_path": "/9JVC4tVKjg93QAIz9cUz8nTQ3eX.jpg", "backdrop_path": "/7ECkRbU1OvDCDLxUv5YBBDxfGF3.jpg"}', 150000000, '{878,28,12}', '', 'en', 'Furiosa: A Mad Max Saga', '文明崩溃45年后，年轻的弗瑞奥萨（安雅·泰勒-乔伊 Anya Taylor-Joy 饰）被迫离开家园，她将倾尽一生，寻找归途。', 'f', '393.497', 'https://image.tmdb.org/t/p/original/pKrJBgRpvE8gMCjaMy1UFcsPpSp.jpg', '{174,79,28382}', '{AU,US}', '2024-05-22 00:00:00', 0, 148, '{en}', 'Released', '', 'f', '9.000', 3, 1, '{"id": 786892, "imdb_id": "tt12037194", "twitter_id": "MadMaxMovie", "facebook_id": "MadMaxSaga", "wikidata_id": "Q100361125", "instagram_id": "madmaxsaga"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1501, 297802, 'tt1477834', NULL, '海王', 'https://image.tmdb.org/t/p/original/9QusGjxcYvfPD1THg6oW3RLeNn7.jpg', '{"id": 573693, "name": "海王（系列）", "poster_path": "/iys0rpFiouEhQA7sYxnzY78AC3M.jpg", "backdrop_path": "/5iidzov8DrsSyZdefeo7jBLDNUW.jpg"}', 160000000, '{28,12,14}', '', 'en', 'Aquaman', '许多年前，亚特兰蒂斯女王（妮可·基德曼 Nicole Kidman 饰）和人类相知相恋，共同孕育了爱情的结晶——后来被陆地人称为海王的亚瑟·库瑞（杰森·莫玛 Jason Momoa 饰）。在成长的过程中，亚瑟接受海底导师维科（威廉·达福 Willem Dafoe 饰）的严苛训练，时刻渴望去看望母亲，然而作为混血的私生子这却是奢望。与此同时，亚瑟的同母异父兄弟奥姆（帕特里克·威尔森 Patrick Wilson 饰）成为亚特兰蒂斯的国王，他不满陆地人类对大海的荼毒与污染，遂谋划联合其他海底王国发动对陆地的全面战争。为了阻止他的野心，维科和奥姆的未婚妻湄拉（艾梅柏·希尔德 Amber Heard 饰）将亚瑟带到海底世界。宿命推动着亚瑟，去寻找失落已久的三叉戟，建立一个更加开明的海底王国……', 'f', '436.454', 'https://image.tmdb.org/t/p/original/6gAY4hx4DKzYvSFixL3thCf7hxS.jpg', '{174,11565,128064}', '{US}', '2018-12-07 00:00:00', 1152028393, 143, '{en}', 'Released', '擎天驾海 王者降临', 'f', '6.895', 13670, 1, '{"id": 297802, "imdb_id": "tt1477834", "twitter_id": "Aquamanmovie", "facebook_id": "Aquamanmovie", "wikidata_id": null, "instagram_id": "Aquamanmovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1502, 274855, 'tt1981128', NULL, '全球风暴', 'https://image.tmdb.org/t/p/original/79X8JkGxzc1tJMi0KxUSaPLooVg.jpg', NULL, 120000000, '{28,878,53}', '', 'en', 'Geostorm', '《全球风暴》的故事发生在未来，环境恶化导致自然灾害愈演愈烈，因此世界各国通力合作，创造了能控制天气的强大气象卫星网络。但是卫星网络突发故障开始攻击地球，摧毁一切的气象大灾变席卷世界。而随着事态发展，浩劫背后的阴谋人祸也开始浮出水面，令主人公的救世之旅面临更严峻考验。', 'f', '264.814', 'https://image.tmdb.org/t/p/original/hna3Dz9qnM2GFYP6ZnOmHapt6ZY.jpg', '{101832,82819,41624,3241,174,14362}', '{CA,HK,US}', '2017-10-12 00:00:00', 221600160, 109, '{en}', 'Released', '人造天劫', 'f', '6.119', 4637, 1, '{"id": 274855, "imdb_id": "tt1981128", "twitter_id": "GeostormMovie", "facebook_id": "GeostormMovie", "wikidata_id": null, "instagram_id": "geostormmovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1503, 402900, 'tt5164214', NULL, '瞒天过海：美人计', 'https://image.tmdb.org/t/p/original/w9QfTrYmtoA96zJlVNvjS8eucf8.jpg', NULL, 70000000, '{80,35,28}', 'http://www.oceans8movie.com', 'en', 'Ocean''s Eight', '桑德拉·布洛克饰演的Debbie Ocean是《十一罗汉》集团头目乔治·克鲁尼饰演的Danny Ocean的妹妹，曾因盗窃入狱服刑。而黛比刚一出狱就策划惊天大案，与凯特·布兰切特饰演的好友一起网罗顶尖高手，准备在一年一度的时尚盛会Met Gala（纽约大都会艺术博物馆慈善舞会）上盗取由安妮·海瑟薇饰演的大明星所佩戴，价值一亿五千万美金的卡地亚钻石项链。', 'f', '264.966', 'https://image.tmdb.org/t/p/original/rOEpzMO0n4ccklhMEgdqkqA1bmc.jpg', '{79,174,1163,104907}', '{US}', '2018-06-07 00:00:00', 297718711, 111, '{en,de}', 'Released', '', 'f', '6.985', 8079, 1, '{"id": 402900, "imdb_id": "tt5164214", "twitter_id": "Oceans8Movie", "facebook_id": "Oceans8Movie", "wikidata_id": "Q25627545", "instagram_id": "Oceans8Movie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1504, 38147, 'tt0081268', NULL, '上帝下凡2', 'https://image.tmdb.org/t/p/original/anqF4leHwJ9mEoPXUJTpzPjTNd3.jpg', '{"id": 221308, "name": "Oh, God Collection", "poster_path": "/sK5QT8qQp2fGVu3YMRM9SAjcOKD.jpg", "backdrop_path": null}', 0, '{14,35}', '', 'en', 'Oh, God! Book II', '', 'f', '311.048', 'https://image.tmdb.org/t/p/original/x73T2sO9vTfTI3fDoEgSmxNWIuz.jpg', '{174}', '{US}', '1980-10-03 00:00:00', 0, 94, '{en}', 'Released', '', 'f', '5.167', 39, 1, '{"id": 38147, "imdb_id": "tt0081268", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1505, 345, 'tt0120663', NULL, '大开眼戒', 'https://image.tmdb.org/t/p/original/vYA4qUPWY0EbjpcIXAL4h4pVmTC.jpg', NULL, 65000000, '{18,53,9648}', '', 'en', 'Eyes Wide Shut', '　　医生威廉姆携太太参加他的一位主顾――当地一个名流——家里举行的晚会时，巧遇了他的一位大学同学——在晚会上担任钢琴师的尼克。当晚，威廉姆因公外出。料理完公事后，他在一家酒吧再次遇到了尼克，尼克告诉了他有这样一个秘密舞会：在舞会上，所有的人都穿着晚礼服，戴着面具，到处都是裸体的美女。威廉姆禁不住好奇，再三乞求尼克，尼克告诉了他举行那个舞会的地址和入门的暗语。威廉姆匆匆准备后，展开了一次如幻如梦的冒险之旅。过程充满了诡异和神秘，背后的玄机更是令人无法参透。', 'f', '260.838', 'https://image.tmdb.org/t/p/original/bIvrpquPHdMUlX4OhwVlebWO4rB.jpg', '{174,195,194,385}', '{GB,US}', '1999-07-16 00:00:00', 162100000, 159, '{en,de}', 'Released', '超级帅哥汤姆·克鲁斯出演大尺度情欲电影', 'f', '7.500', 5910, 1, '{"id": 345, "imdb_id": "tt0120663", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q209481", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1506, 910, 'tt0038355', NULL, '夜长梦多', 'https://image.tmdb.org/t/p/original/1fMD4KvZ4cR04aQo6hH6R5NdIH8.jpg', NULL, 1600000, '{9648,80,53}', '', 'en', 'The Big Sleep', '　　Philip Marlowe（亨弗莱·鲍嘉 Humphrey Bogart 饰）是一个私家侦探，这天他接到邀请来到General Sternwood的家中，Sternwood让马洛调查关于他女儿的一笔债务，他的女儿Carmen Sternwood 欠了一个叫Geiger的人一笔赌债。在Marlowe想要离开的时候，Sternwood的大女儿Vivian（劳伦·白考尔 Lauren Bacall 饰）栏下了他，告诉他其实她父亲找他来调查的真正目的是为了寻找一个失踪的朋友，Marlow将信就疑。第二天Marlow去寻找Geiger，在Geiger家门前却听到一声枪声，等Marlow进去的时候，却只发现了Geiger的尸体还有被绑住的Carmen Sternwood（玛塔·威克斯 Martha Vickers 饰），还有一台相机。Marlow带走了相机并把Carmen送回家，等到Marlow再回到现场时，却发现Geiger的尸体已经不见了。而Sternwood家的司机也因车祸身亡。案件变得越来越扑朔迷离，这些事情间到底有什么联系？Marlowe能否发现真相？
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1507, 464052, 'tt7126948', NULL, '神奇女侠1984', 'https://image.tmdb.org/t/p/original/egg7KFi18TSQc1s24RMmR9i2zO6.jpg', '{"id": 468552, "name": "神奇女侠（系列）", "poster_path": "/lgK8zmVdkEHWD7RtkRjoWWpmw5k.jpg", "backdrop_path": "/n9KlvCOBFDmSyw3BgNrkUkxMFva.jpg"}', 200000000, '{28,12,14}', '', 'en', 'Wonder Woman 1984', '戴安娜和博物馆的同事们偶然发现一个神奇的水晶，据说水晶能够帮助他们实现一个愿望。半信半疑的戴安娜默默许愿，谁曾想因故去世的男友竟然真得回还人间。眼见如此人间奇迹，戴安娜貌不惊人的同事芭芭拉·密涅瓦也许下变美的愿望，谁知却化身力大无穷的豹女。然而，更大危机紧随私欲之后……', 'f', '279.310', 'https://image.tmdb.org/t/p/original/gntrKdmTtlkFRuqTqPMnfErzsGj.jpg', '{174,114152,128064,507}', '{US}', '2020-12-16 00:00:00', 169601036, 151, '{en}', 'Released', '超能回归 压轴燃冬', 'f', '6.445', 8167, 1, '{"id": 464052, "imdb_id": "tt7126948", "twitter_id": "WonderWomanFilm", "facebook_id": "wonderwomanfilm", "wikidata_id": "Q33408623", "instagram_id": "wonderwomanfilm"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1508, 227603, 'tt0071722', NULL, '逐个杀', 'https://image.tmdb.org/t/p/original/vm7wc1rVQ3jQUffCoRqM7tOmHUb.jpg', NULL, 0, '{27,37}', '', 'en', 'A Knife for the Ladies', '', 'f', '4.859', 'https://image.tmdb.org/t/p/original/tHmqAgOmbPp5fkxgx5Y5JotvIuP.jpg', '{81080,125252,13951}', '{US}', '1974-05-02 00:00:00', 0, 86, '{en}', 'Released', '', 'f', '4.900', 17, 1, '{"id": 227603, "imdb_id": "tt0071722", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1509, 760154, 'tt11594766', NULL, '交换生的秘密日记', 'https://image.tmdb.org/t/p/original/nw1p11yEzd1XSTK1iuUrvJ8qoB8.jpg', NULL, 0, '{35,10749}', '', 'pt', 'Diários de Intercâmbio', '　　芭芭拉和塔里亚决定在美国交换。他们不知道这些障碍和文化冲击。芭芭拉一直梦想着去纽约，她发现他们将住在纽约州伍德斯托克镇。距纽约市以北两小时。习惯了她母亲家的舒适。芭芭拉现在必须习惯于做家务，并为她的赞助商斯特恩·谢里尔做保姆。而塔里亚则是一对爱国、保守的夫妇，她是一个敢于挑战、自由的人。这两个女孩与热爱巴西的美国空姐布拉德和在滑雪站工作的巴西人卢卡斯成为朋友。离纽约伍德斯托克不远的滑雪胜地。尽管困难重重，这些朋友在度过难忘时刻的同时找到了爱和友谊。', 'f', '15.008', 'https://image.tmdb.org/t/p/original/vqVVwT8hwHUlPscS2yE8c4aEm0T.jpg', '{52258,227302,165287}', '{BR}', '2021-08-18 00:00:00', 0, 96, '{en,pt}', 'Released', '', 'f', '6.500', 144, 1, '{"id": 760154, "imdb_id": "tt11594766", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1510, 418896, 'tt5496926', NULL, '售梦人', 'https://image.tmdb.org/t/p/original/lM7whuu1XTr5rEDqEbTTtWoue9.jpg', NULL, 0, '{18}', '', 'pt', 'O Vendedor de Sonhos', '弗里奥·塞萨尔对生活失去信心，正要准备跳楼。一个神秘的、头发蓬乱的陌生人自称是“梦想贩卖家”突然出现在他身边，他的使命是说服人们热爱生活。陌生人在窗台上跟弗里奥进行了一场富有哲学的谈话，并邀请他加入“梦想家贩卖家”的行列。起初弗里奥把这次旅行看作是一个实验，但他很快就开始相信、接受了自己现在的处境并乐在其中。随着一些人陆续加入，他们会访问各种各样的网站、出入不同的地方与场合，比如养老院和葬礼，在每个地方都传授着热爱生活的经验，并鼓励每个人拥抱自己的理想。随着他的影响力越来越大，诋毁他的人也越来越多，聪明乐观的他依然对每个人都有自己的解决办法，直到一家名叫大软件的公司迫使他陷入困境。但他怀着自己的理想，保持热爱生活的态度，最终战胜了困难。', 'f', '15.951', 'https://image.tmdb.org/t/p/original/hV6l4wOhPDbEflqM1A2047D4F0E.jpg', '{81976,165287,89438,7485,11547,47546}', '{BR}', '2016-12-08 00:00:00', 0, 96, '{pt}', 'Released', '', 'f', '6.500', 112, 1, '{"id": 418896, "imdb_id": "tt5496926", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
