INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1526, 770724, 'tt13051724', NULL, '巨大', 'https://image.tmdb.org/t/p/original/i80uBfv0qagvaZttFrzAxbokuUa.jpg', NULL, 0, '{18}', '', 'it', 'L''immensità', '《巨大》讲的是一个被背叛的母亲和她迫切想要变成男孩的女儿之间的故事。该片故事背景设定在上世纪70年的罗马，意大利社会正处于转折点，影片描绘了一个家庭的生活点滴。佩内洛普饰演Clara，是一位母亲，是整个故事的核心。故事并没有过多说明为什么Adriana如此执着想变成一个男孩，只讲了她想成为男孩的迫切愿望，以及她和另一个身份差距悬殊的女孩之间懵懂的初恋。', 'f', '17.675', 'https://image.tmdb.org/t/p/original/z0EBydaGK8yaW6NZXli5HgdElOf.jpg', '{21246,20339,12923,104,11244,7981,106170,93214}', '{FR,IT}', '2022-09-15 00:00:00', 0, 97, '{it}', 'Released', '', 'f', '6.400', 184, 1, '{"id": 770724, "imdb_id": "tt13051724", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
