INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1540, 455349, 'tt6869782', NULL, '雇佣英雄', 'https://image.tmdb.org/t/p/original/l9fkD0jJAaGxbahlY1LKfoX6G83.jpg', NULL, 0, '{28,35}', '', 'it', 'I peggiori', '有没有前途，谁希望给自己的十三岁妹妹的美好未来两个身无分文的兄弟，创造了自己不同寻常的任务：用口罩和微型摄像机的武装，他们公开拆除各种身份“邻里狡猾的家伙”是谁食尸鬼感染意大利，改造自己分成两个不可能“英雄出租。”', 'f', '11.038', 'https://image.tmdb.org/t/p/original/gU8RGpXFPLUaSPZkAEqWUig7w5Z.jpg', '{12923}', '{IT}', '2017-05-18 00:00:00', 0, 95, '{it}', 'Released', '', 'f', '6.500', 98, 1, '{"id": 455349, "imdb_id": "tt6869782", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1541, 587807, 'tt1361336', NULL, '猫和老鼠', 'https://image.tmdb.org/t/p/original/9ns9463dwOeo1CK1JU2wirL5Yi1.jpg', NULL, 50000000, '{35,10751,16}', '', 'en', 'Tom & Jerry', '“超杀女”科洛·莫瑞兹饰演的少女凯拉刚刚入职豪华大酒店，就碰上了叫人头疼的难题——杰瑞竟然想在酒店里定居，令酒店最近承接的世纪婚礼岌岌可危。于是，汤姆被凯拉雇佣成为酒店员工，目的是赶走杰瑞，这对欢喜冤家就此展开了一场你追我赶的爆笑喜剧。', 'f', '113.544', 'https://image.tmdb.org/t/p/original/54ngjKpxAxht9PsbXT6DgJsYvyq.jpg', '{25120,8922,77061,174}', '{US}', '2021-02-10 00:00:00', 136536687, 101, '{en}', 'Released', '', 'f', '6.800', 2380, 1, '{"id": 587807, "imdb_id": "tt1361336", "twitter_id": "TomAndJerry", "facebook_id": "TomandJerry", "wikidata_id": "Q65921361", "instagram_id": "tomandjerry"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1542, 324849, 'tt4116284', NULL, '乐高蝙蝠侠大电影', 'https://image.tmdb.org/t/p/original/eoMushgujydxFplE9yPZ54lwOvo.jpg', NULL, 80000000, '{16,28,35,10751}', '', 'en', 'The Lego Batman Movie', '罪恶丛生的哥谭市，疯狂的小丑（扎克·加利凡纳基斯 Zach Galifianakis 配音）带领恶棍军团展开新一波的犯罪活动。对他来说，犯罪以及引来宿敌蝙蝠侠（威尔·阿奈特 Will Arnett 配音）是无比快乐的事情，可是猛男蝙蝠侠不仅轻松解决掉这群小坏蛋，还根本不将小丑放在眼里。蝙蝠侠的无情言语，深深刺痛了小丑的心。在此之后，孤独的蝙蝠侠收养了罗宾（迈克尔·塞拉 Michael Cera 配音），看上了美丽的女警长芭芭拉，只不过他始终拒绝别人走入他的内心世界。另一方面，自尊严重受挫的小丑从天空监狱找来了霸王龙、迅猛龙、索伦、伏地魔、金刚等史上著名的大坏蛋，他要狠狠地打击自高自大的蝙蝠侠。', 'f', '98.831', 'https://image.tmdb.org/t/p/original/w46nskOB96U19gk6iqcf9Y7YFRZ.jpg', '{2723,8089,9993,77973,174,4081,25120,41624}', '{AU,DK,US}', '2017-02-08 00:00:00', 311950384, 104, '{en}', 'Released', '永远做你自己。除非你能成为蝙蝠侠', 'f', '7.217', 4822, 1, '{"id": 324849, "imdb_id": "tt4116284", "twitter_id": "legobatmanmovie", "facebook_id": "LEGOBatmanMovie", "wikidata_id": "Q23013169", "instagram_id": "legobatmanmovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1543, 379686, 'tt3554046', NULL, '空中大灌篮：新传奇', 'https://image.tmdb.org/t/p/original/8s4h9friP6Ci3adRGahHARVd76E.jpg', '{"id": 722961, "name": "空中大灌篮（系列）", "poster_path": "/1eq1pEctWy8umAjfIncFk273QOa.jpg", "backdrop_path": "/dGntz0meh8NjiFJHM8OPbbvfa86.jpg"}', 150000000, '{10751,16,35,878}', '', 'en', 'Space Jam: A New Legacy', '勒布朗·詹姆斯与他的小儿子多姆·詹姆斯被人工智能困在了“华纳兄弟电影宇宙”虚拟空间，为了能安全回家，他必须率兔八哥、萝拉兔和那些不守规矩的乐一通卡通，战胜一支全明星篮球队。这场对决是勒布朗人生的最大挑战，也将重新定义他与儿子间的关系，并让勒布朗领悟到“做自己”的真谛；乐一通的小伙伴们则要打破陈规，超常发挥自己的独特技能，令勒布朗都刮目相看。然而他们面对的，是一群前所未见、所向披靡的人工智能强化型对手“末日狂徒队”，勒布朗和乐一通们需要成功击败他们。', 'f', '69.156', 'https://image.tmdb.org/t/p/original/2EqcCSLBJWIULDTltD6j8WHFBff.jpg', '{25120,81170,148495,174}', '{US}', '2021-07-08 00:00:00', 163700000, 120, '{en}', 'Released', '欢迎来到大灌篮！', 'f', '6.800', 3878, 1, '{"id": 379686, "imdb_id": "tt3554046", "twitter_id": "spacejammovie", "facebook_id": "SpaceJamMovie", "wikidata_id": null, "instagram_id": "spacejammovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1544, 539681, 'tt8912936', NULL, 'DC萌宠特遣队', 'https://image.tmdb.org/t/p/original/tecCZQA0E3qHSPOTUMj3YQniT4.jpg', NULL, 90000000, '{16,28,10751,35,878}', '', 'en', 'DC League of Super-Pets', '超狗小氪和超人是形影不离的好朋友。他们共享超能力，在大都会并肩作战打击犯罪。但是当超人和正义联盟的其他成员被绑架时，小氪必须要说服一群收容所里的小动物们，包括猎犬王牌、小胖猪PB、乌龟默顿、松鼠奇奇组成萌宠特遣队，帮助他们掌握刚获得的超能力，一起拯救超级英雄。', 'f', '59.626', 'https://image.tmdb.org/t/p/original/8rJc5vhdFdxOljPnp9iadYTX4KF.jpg', '{25120,9993,73669,174}', '{US}', '2022-07-27 00:00:00', 203000000, 105, '{en}', 'Released', '坐下，站起来，拯救世界。', 'f', '7.279', 1467, 1, '{"id": 539681, "imdb_id": "tt8912936", "twitter_id": "DCSuperPets", "facebook_id": "DCLeagueOfSuperPets", "wikidata_id": "Q106953528", "instagram_id": "dcleagueofsuperpets"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1545, 137106, 'tt1490017', NULL, '乐高大电影', 'https://image.tmdb.org/t/p/original/5N2mfRrvJUnCVpsMIebfosEyo1i.jpg', '{"id": 325470, "name": "乐高大电影（系列）", "poster_path": "/qwuwukEjuh6Zs51NnhtPVriARey.jpg", "backdrop_path": "/vAyMNou7M2SOXjPIzLhltTvAqD1.jpg"}', 60000000, '{16,10751,12,35,14}', '', 'en', 'The Lego Movie', '影片讲述了一个普通乐高小人艾米特（克里斯·帕拉特 配音）被错当成了“大师建造者”而加入进一支抵抗组织，与一位类似先知一样的人物（摩根·弗里曼 配音）一起力图阻止乐高世界邪恶暴君（威尔·法瑞尔 配音）的阴险计划。', 'f', '54.275', 'https://image.tmdb.org/t/p/original/y0xjk7MuHEbZUPD5HAgQjTmwIa1.jpg', '{79,41624,4081,2723,829,25120,8089}', '{AU,DK,US}', '2014-02-06 00:00:00', 469200000, 100, '{en}', 'Released', '', 'f', '7.420', 7572, 1, '{"id": 137106, "imdb_id": "tt1490017", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q2608065", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1546, 274862, 'tt3014284', NULL, '乐高幻影忍者大电影', 'https://image.tmdb.org/t/p/original/3DPuzZmkBD9vbMpLvQcrymYoDBk.jpg', NULL, 70000000, '{10751,16,28,12,35}', '', 'en', 'The Lego Ninjago Movie', '《乐高幻影忍者大电影》讲述了六名青少年忍者共同守护家园的故事。白天，他们是校园里不起眼的高中生，晚上变身忍者维护“忍者岛”安全。', 'f', '48.087', 'https://image.tmdb.org/t/p/original/uOUY0O9lrC0HhH0ha70E4kI8Uye.jpg', '{2723,77973,829,25120,4081,8089}', '{AU,DK,US}', '2017-09-21 00:00:00', 123081555, 101, '{en}', 'Released', '', 'f', '6.498', 994, 1, '{"id": 274862, "imdb_id": "tt3014284", "twitter_id": "NinjagoMovie", "facebook_id": "LEGONINJAGOMovie", "wikidata_id": "Q22131901", "instagram_id": "LEGONinjagoMovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1547, 385103, 'tt3152592', NULL, '史酷比狗', 'https://image.tmdb.org/t/p/original/b5Fej0UT6gPFd2GcGEWw4SAwGUM.jpg', NULL, 90000000, '{16,35,10751,9648}', '', 'en', 'Scoob!', '《史酷比狗》演绎了史酷比与其一生挚友夏奇的初次相遇，以及他们如何与少年侦探弗雷德、维尔玛和达芙妮一起组建了世界著名的神秘公司。如今，神秘公司已经解决了数百起谜案、进行了无数次冒险，但史酷比和他的同伴们发现，他们正面临有史以来最惊险、最具挑战性的神秘案件：一个将“幽灵狗”塞伯勒斯释放回世上的阴谋。当他们拼命努力想要阻止这一全球性大灾难之时，他们也发现了史酷比的秘密身世，以及他超乎想象的神秘命运。', 'f', '44.197', 'https://image.tmdb.org/t/p/original/7aJwGRTu314qPgWbB7fgzHEiKpy.jpg', '{25120,174,507,436}', '{CA,US}', '2020-07-08 00:00:00', 28600000, 93, '{en}', 'Released', '', 'f', '7.100', 1625, 1, '{"id": 385103, "imdb_id": "tt3152592", "twitter_id": "scoobmovie2020", "facebook_id": "scoob", "wikidata_id": "Q23999279", "instagram_id": "scoob"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1548, 280217, 'tt3513498', NULL, '乐高大电影2', 'https://image.tmdb.org/t/p/original/2U2h8PpsaWn90jdtyG0tu9ZxttZ.jpg', '{"id": 325470, "name": "乐高大电影（系列）", "poster_path": "/qwuwukEjuh6Zs51NnhtPVriARey.jpg", "backdrop_path": "/vAyMNou7M2SOXjPIzLhltTvAqD1.jpg"}', 99000000, '{28,12,16,35,10751}', '', 'en', 'The Lego Movie 2: The Second Part', '　　风靡全球的经典动画系列新作《乐高大电影2》爆笑来袭。乐高小人艾米特贱萌回归，抱得美人归的他和女友露西过着甜蜜的生活。但是看似平静的表面其实暗藏阴谋，神秘外星入侵者突然降临，他们的破坏速度远在乐高小人的建造速度之上，艾米特的世界再度危在旦夕。外星入侵者甚至能洞察艾米特等人的每一次行动，困难与挑战直线升级，身手敏捷的露西也难逃厄运，陷入危机。艾米特必须联合一众好友，再次拯救世界。这一次，他们将前往遥远未知的新奇世界，见识更多令人大开眼界的乐高世界，同时也将发现真正的自我。', 'f', '42.847', 'https://image.tmdb.org/t/p/original/2SwKM7Z3vcrastJo63YYJtEuKfQ.jpg', '{829,8089,25120,77973,118854,4081}', '{AU,DK,US}', '2019-02-06 00:00:00', 199600000, 106, '{en}', 'Released', '', 'f', '6.682', 2088, 1, '{"id": 280217, "imdb_id": "tt3513498", "twitter_id": "thelegomovie", "facebook_id": "TheLEGOMovie", "wikidata_id": "Q23796643", "instagram_id": "thelegomovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1561, 816904, 'tt23177868', NULL, '木乃伊', 'https://image.tmdb.org/t/p/original/xVFpOIVdVn5ZUq1QIf0UJcZWjO2.jpg', NULL, 12000000, '{16,12,14}', '', 'es', 'Momias', '影片讲述了三具木乃伊最终来到今天的伦敦，开始寻找一枚被雄心勃勃的考古学家卡纳比勋爵偷走的王室旧戒指的旅程。', 'f', '53.149', 'https://image.tmdb.org/t/p/original/yKw6A25e6sjAOgi9WHBooPfAW7O.jpg', '{11652,37209,152416,152417,58323,29566}', '{ES}', '2023-01-05 00:00:00', 53400000, 88, '{en}', 'Released', '发现一个新世界。', 'f', '7.040', 433, 1, '{"id": 816904, "imdb_id": "tt23177868", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1549, 446894, 'tt6182908', NULL, '雪怪大冒险', 'https://image.tmdb.org/t/p/original/7t88SoT3Dd8DhGnQuVoSbMNUl3W.jpg', NULL, 80000000, '{10751,16,12,14}', '', 'en', 'Smallfoot', '查宁·塔图姆、赞达亚([蜘蛛侠：英雄归来])、吉娜·罗德里格斯([深海浩劫])将献声华纳动画新片[小脚](Smallfoot，暂译)。故事讲述在大脚怪的世界中，人类才是未知可怕的生物。但其中有一只大脚怪却坚信人类是真实存在的，并寻找踪迹。目前影片已开始前期制作，并将于明年9月14日北美上映。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1550, 332210, 'tt4624424', NULL, '逗鸟外传：萌宝满天飞', 'https://image.tmdb.org/t/p/original/3dhuShnYmB0UOQrn8v8gT9DBf0T.jpg', NULL, 70000000, '{12,16,35,10751}', '', 'en', 'Storks', '鹳鸟送子，天经地义……至少以前是这样。现在，他们负责给角落商店送货。朱尼尔（安迪·萨姆伯格 Andy Samberg 配音），是公司里的最佳快递员，即将升职的他在某天值勤时，遇到了宝宝制造厂被意外启动的事件。结果， 一个人见人爱，完全未经授权的宝宝就这样出现了。为了不让老板发现这次意外事故，朱尼尔和他的朋友、鹳鸟山上唯一的人类小郁（凯蒂·克朗 Katie Crown 配音），迫不及待地想把宝宝送走，于是匆匆踏上了他们首次快递宝宝的疯狂惊险之旅。不止一个家庭因此享受到天伦之乐，更重要的是，这次任务的胜利完成将让全球的鹳鸟卷土重来，再续送子的光荣使命。', 'f', '37.771', 'https://image.tmdb.org/t/p/original/4oVLcG2wo9sXCeXoMEKMvvOVCbd.jpg', '{41624,25120,174}', '{US}', '2016-09-22 00:00:00', 182379278, 87, '{en}', 'Released', '', 'f', '6.700', 2264, 1, '{"id": 332210, "imdb_id": "tt4624424", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
