INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1562, 274109, 'tt3202202', NULL, '雪中的棕榈树', 'https://image.tmdb.org/t/p/original/s3pniDBtG52O26WySm6HY0YLVWh.jpg', NULL, 11332619, '{18,36,10749}', '', 'es', 'Palmeras en la nieve', 'Kilian是个年轻人，从来没有离开山脚下的韦斯卡。1953年他前往费尔南多浦的异国岛屿，和他的父亲和兄弟一起在一个可可种植园里工作。故事讲述了他在这座岛20多年的生活……', 'f', '30.572', 'https://image.tmdb.org/t/p/original/mqtS2WCxdMKqTgGYDfPpk3qbjvH.jpg', '{11068,29566,16742,11652,111300,67412,54647,107262}', '{FR,ES}', '2015-12-25 00:00:00', 0, 164, '{an,en,es}', 'Released', '', 'f', '7.394', 521, 1, '{"id": 274109, "imdb_id": "tt3202202", "twitter_id": "PELNpelicula", "facebook_id": "PELNpelicula", "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1563, 1008005, 'tt18072540', NULL, '圣餐娃娃的诅咒', 'https://image.tmdb.org/t/p/original/zFi8k4xbWHwjHmFoWFTK4Dy7mMC.jpg', NULL, 0, '{27}', '', 'es', 'La niña de la comunión', '这一部电影的故事背景为80年代的西班牙小镇，剧情讲述1987年5月的某个教堂，几个小女孩正在庆祝着她们的第一次圣餐，其中就包括了女主莎拉的妹妹朱迪恩。由于家境的问题，朱迪恩连购买一个娃娃来拍摄传统圣餐照片的经济都负担不起。莎拉的家庭非常卑微，家里的经济不太好，由于父亲在这个小镇找到了工作，全家才搬了过来。但是，莎拉总是觉得自己与小镇显得格格不入，直至遇到了好朋友蕾贝。  一天，莎拉与她闺蜜蕾贝一起从夜店回家。原本打算走路回家的她们，半路拦截到一辆车子。在与另外两名男子坐车的路途中，差点就撞到了一个身穿领圣餐白纱的女子。一众人下车尝试寻找白衣女孩时，却看到一个骨董娃娃躺在那里。好心的莎拉决定把娃娃带回家，暂时成为娃娃的主人。就在那时候起，莎拉就接二连三发生了许多怪事。其中就包括了身体莫名长出斑痕、出现灵异幻觉、被莫名力量扯下水，不管在哪里都遇到闹鬼事件。', 'f', '28.227', 'https://image.tmdb.org/t/p/original/amDTOAKrevSnuhmAem6L0Kx3IrM.jpg', '{2875,29566,11652,113812,67412,108143}', '{ES}', '2023-02-09 00:00:00', 0, 98, '{es}', 'Released', '', 'f', '6.114', 201, 1, '{"id": 1008005, "imdb_id": "tt18072540", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1564, 890980, 'tt13229894', NULL, '上帝的笔误', 'https://image.tmdb.org/t/p/original/c5iPQhmZaq8eC8duhPTN373duEr.jpg', NULL, 0, '{18,9648,53}', '', 'es', 'Los renglones torcidos de Dios', '爱丽丝-古尔德是一名私家侦探，她假装患有精神病，以便进入一家精神病院，为她正在处理的案件收集证据：一名病人在不明确的情况下死亡。', 'f', '21.871', 'https://image.tmdb.org/t/p/original/qL5L8ZVcXkjIvjXqmFbsBqF1ZQQ.jpg', '{11068,29566,11652,5085,4960,108143}', '{ES}', '2022-10-06 00:00:00', 0, 155, '{es}', 'Released', '', 'f', '7.357', 618, 1, '{"id": 890980, "imdb_id": "tt13229894", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q107352262", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1565, 227738, 'tt2857458', NULL, '傻瓜特工大冒险', 'https://image.tmdb.org/t/p/original/n6boHzZ54yM3LTkLEbMyGP0BQhB.jpg', '{"id": 624920, "name": "Mortadelo y Filemón - Colección", "poster_path": "/htJdLGrbZvAdxsDu0uWUu247f7I.jpg", "backdrop_path": "/d7wWj9gknvjPDtnevRRFnCWp76T.jpg"}', 10000000, '{35,16,12}', '', 'es', 'Mortadelo y Filemón contra Jimmy el Cachondo', '特工总部迪亚大厦新增添了一个神秘的保险柜，结果引来了坏小子吉米的注意。他在两名笨蛋手下的协助下，成功将保险柜盗走，还顺带把迪亚大厦弄得七扭八歪。特工局长恼羞成怒，于是命手下去找特工腓力门及其搭档莫特德罗。腓力门是一个混迹于特工界的笨蛋，他不仅令上司十分头疼，还饱受民众的苛责。在接到局长的命令后，腓力门与莫特德罗准备出征，谁知就在此时，当年被腓力门送入监狱的暴徒特龙其母拉斯出狱，他发誓要用拳头给腓力门爆菊。经过一连串的周折，腓力门总算用特工总部开发的神秘药水使这个暴徒变成了温顺的好孩子。  　　与此同时，吉米的罪恶勾当仍在继续……', 'f', '26.460', 'https://image.tmdb.org/t/p/original/z4mgpx02a8OmSx0K7E1zCyumhR7.jpg', '{16569,9335,9967,40789,5085,5653,981,11652}', '{ES}', '2014-08-30 00:00:00', 0, 91, '{es,pt}', 'Released', '', 'f', '6.619', 164, 1, '{"id": 227738, "imdb_id": "tt2857458", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1566, 639798, 'tt10952782', NULL, '马拉萨尼亚32号鬼宅', 'https://image.tmdb.org/t/p/original/gT6OgUW6fxa8S5pUOZKKIhZe1xX.jpg', NULL, 0, '{18,27}', '', 'es', 'Malasaña 32', '故事讲述70年代的马德里，马诺洛和坎德拉带着三个孩子和祖父费尔明定居在马拉萨尼亚的马德里附近。这一举动意味着他们抛弃过去以及在城镇中的生活。马德里是一个全面过渡的大城市，也是正在寻找的繁荣的好地方。但是，奥尔梅多一家人不知道的是，他们买的房子将成为他们最糟糕的噩梦。', 'f', '26.321', 'https://image.tmdb.org/t/p/original/vmp3r3e5lv2kAd15PYFSDmrF7JS.jpg', '{37209,29566,27628,126568,67412,11652}', '{ES}', '2020-01-17 00:00:00', 0, 105, '{es}', 'Released', '', 'f', '6.464', 638, 1, '{"id": 639798, "imdb_id": "tt10952782", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1567, 8088, 'tt0913425', NULL, '破碎的拥抱', 'https://image.tmdb.org/t/p/original/shrpF5ZivObmV3hnCK8sSS0DP5z.jpg', NULL, 18000000, '{18,10749,53}', '', 'es', 'Los abrazos rotos', '　　马提奥·布兰科曾是一名风光无限的电影导演，在遭遇车祸失明后，他改名哈瑞·凯恩，以编剧的身份过着平静的生活。2008年的一天，名叫雷的青年拜访哈瑞，雷对一部电影的设想再次开启哈瑞关闭已久的记忆大门。1994年，马提奥正在筹拍新片，美丽女孩莱娜在试镜中脱颖而出。莱娜是某公司老板欧内斯特·马特尔的女秘书，两人之间始终保持着若即若离的暧昧关系。为了给罹患癌症的父亲治病，莱娜委身欧内斯特，成为他的情妇。欧内斯特经不住莱娜的请求，同意投资并让她出演马提奥的新片。拍摄过程中，莱娜和马提奥擦出爱情的火花，而这一切也很快为敏感的欧内斯特所获知。爱恨情仇自此纠缠不清……', 'f', '26.792', 'https://image.tmdb.org/t/p/original/kEKcNdAZ8CdQsfnDjqbsOIFJsEM.jpg', '{49,29258,11652,199203,9335,5726,10146}', '{ES,DE}', '2009-03-18 00:00:00', 30991660, 125, '{es,en}', 'Released', '', 'f', '7.144', 626, 1, '{"id": 8088, "imdb_id": "tt0913425", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q192022", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1591, 543749, 'tt7471884', NULL, '逆时杀机', 'https://image.tmdb.org/t/p/original/c26GB3r9rJtamesS5ZJBBLxtxEz.jpg', NULL, 0, '{18,9648,53}', '', 'en', 'Silencio', '为了拯救儿子的性命，安娜踏上了前往墨西哥沉默区的旅程，只为了一块拥有强大神祕力量的石头。然而，安那并不是唯一知道石头祕密的人，其他势力将不惜为此大开杀戒……', 'f', '9.153', 'https://image.tmdb.org/t/p/original/x1hqZL8GxAByIVnnnVfxVIMTare.jpg', '{119335,100000007}', '{MX}', '2018-10-26 00:00:00', 0, 98, '{es,en}', 'Released', '', 'f', '6.300', 15, 1, '{"id": 543749, "imdb_id": "tt7471884", "twitter_id": "silenciomovie", "facebook_id": "silenciomovie", "wikidata_id": null, "instagram_id": "silenciomovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1568, 12245, 'tt0488604', NULL, '深度谜案', 'https://image.tmdb.org/t/p/original/v91aGneMO7dT45KEbutrY85JMta.jpg', NULL, 14100000, '{80,9648,53}', '', 'en', 'The Oxford Murders', '　　马丁（伊利亚•伍德 Elijah Wood 饰）为了追寻偶像逻辑数学家亚瑟（约翰•赫特 John Hurt 饰）的足迹，来到牛津大学深造。他发现，寄宿的房东伊格莱顿太太（安娜•玛西 Anna Massey 饰）仿佛跟亚瑟交往甚密，而她的养女贝丝（朱丽•考克斯 Julie Cox 饰）却总是故弄玄虚。后来，马丁结识了壁球伙伴洛娜（蕾欧诺•瓦特林 Leonor Watling 饰），两人堕入爱河……  　　亚瑟演讲时，马丁作为唯一的提问者，引起了他的注意。后来，二人在房东家不期而遇，发现伊格莱顿太太被人谋杀。现场唯一的线索是一个圆圈。二人被警方带走协助调查。此后又有一些人离奇地死去，而且他们的死因似乎还暗含着某个数学定律……', 'f', '18.771', 'https://image.tmdb.org/t/p/original/aPGyZg44eCxccfoaNNbJwTJj66J.jpg', '{1182,850,7346,7680,9335,446,174,11652,190447,104}', '{FR,ES,GB,US}', '2008-01-18 00:00:00', 0, 108, '{en}', 'Released', '', 'f', '5.954', 621, 1, '{"id": 12245, "imdb_id": "tt0488604", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1569, 755437, 'tt12443220', NULL, '爸妈二选一', 'https://image.tmdb.org/t/p/original/pHFHcQJS6uZDEzyhxUSwuDkMidN.jpg', NULL, 0, '{35,10751}', '', 'es', 'Mamá o papá', 'Flora 和 Victor 是有趣、现代、有爱心的父母。 他们现在有一个问题：监护权。', 'f', '18.148', 'https://image.tmdb.org/t/p/original/yo4aBPuyWh8uB2VHPwK1O7R6WwO.jpg', '{109818,111087,29566,11652}', '{ES}', '2021-12-17 00:00:00', 0, 103, '{es}', 'Released', '', 'f', '7.200', 186, 1, '{"id": 755437, "imdb_id": "tt12443220", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1571, 79745, 'tt1688649', NULL, '沉睡的声音', 'https://image.tmdb.org/t/p/original/3Sa0aM3gTStFkjkhNaqk2E9KLCq.jpg', NULL, 4000000, '{18,36}', '', 'es', 'La voz dormida', '这是一曲失败者的悲歌。西班牙内战(1936 1939)结束后，失败的共和国政府的维护者们理所当然地被判处监禁，连同他们的肉体一道受监禁的还有他们的声音。该片主要讲述的是军事旨领佛朗哥在对反对派进行血腥镇压和报复中入狱的一群妇女的凄惨故事。作品塑造了一系列身世小同、性格各异的女性人物形象，不仪描绘她们在狱中的苦难生活，更反映了地们誓与反动当局斗争到底的英雄气慨。然而这些在狱中饱经忧患的斗士们，有的被处以极刑，有的死于病痛，侥幸出出狱的寥寥无几。因此，她们提山了一个响亮的口号：要活下去，要讲述历史，要人声呐喊。于是，发出了“沉睡的声音”。', 'f', '15.905', 'https://image.tmdb.org/t/p/original/8lZkChW71KsJlhypnsbKwaYP05d.jpg', '{53200,36920,174,7306,11652,9335,981,29259}', '{DE,ES}', '2011-10-21 00:00:00', 0, 128, '{ca,es}', 'Released', '', 'f', '6.800', 97, 1, '{"id": 79745, "imdb_id": "tt1688649", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1572, 31822, 'tt0434304', NULL, '我的酷儿婚礼', 'https://image.tmdb.org/t/p/original/AoO3gTkBsdGMSnx8zlf4P7r5rHf.jpg', NULL, 0, '{35,10749}', '', 'es', 'Reinas', '　　故事发生在西班牙，一场隆重的同志婚礼举行在即，在这场婚礼上，三对彼此爱慕的恋人们将挣脱性别的桎梏，踏入婚姻的殿堂。在此前一周，六位新人以及他们的家人便早早的聚在了一起，风波不断。
