INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1574, 101411, 'tt1714834', NULL, '17小时', 'https://image.tmdb.org/t/p/original/ugfacDIGlcECNaw8Wz4L49bAgN8.jpg', NULL, 0, '{36,18}', '', 'es', '23-F: la película', '影片讲述了发生在1981年2月23日西班牙的一场军变未遂事件。1975年军事独裁统治随着弗朗哥的去世而终结，国王胡安·卡洛斯重新坐上了王位，但人们期望已久的新生活由并没有很快到来。1981年2月23日下午6时许，西班牙众议院正在对首相候选人进行投票表决，这时约200名荷枪实弹的民防军官兵包围了议会大厦，包括全体阁员和各党主要领导人在内的300多名众议员全部被扣为人质。', 'f', '0.810', 'https://image.tmdb.org/t/p/original/lpw6c7nRpO40NgPiNn3J9YjSn8l.jpg', '{11652,4601}', '{ES}', '2011-02-23 00:00:00', 0, 100, '{es}', 'Released', '', 'f', '5.500', 31, 1, '{"id": 101411, "imdb_id": "tt1714834", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1575, 738652, 'tt5748448', NULL, '警察局', 'https://image.tmdb.org/t/p/original/jIkH6cy0Haa1cyitn6gtKmE3lxu.jpg', NULL, 0, '{53,80,28}', '', 'en', 'Copshop', '讲述一个小镇警察局成为三个人之间不可思议的战场——职业杀手、聪明的新手女警、除了酒吧找不到其他避难所的诈骗犯。', 'f', '25.643', 'https://image.tmdb.org/t/p/original/abNZhroLmKHi51Qs01VVxHcrwcZ.jpg', '{99321,80292,103331,5357,145546,47729,191127,10427,100000007}', '{US}', '2021-09-09 00:00:00', 6807158, 107, '{en}', 'Released', '', 'f', '6.200', 701, 1, '{"id": 738652, "imdb_id": "tt5748448", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1576, 978592, 'tt8542964', NULL, '沉睡烈犬', 'https://image.tmdb.org/t/p/original/mYPsDej53aibXId6BSxb3Q5fAHg.jpg', NULL, 0, '{9648,53,80,18}', '', 'en', 'Sleeping Dogs', '罗伊·弗里曼是一名记忆破碎的前凶杀案侦探，被迫重新审视一个他不记得的案件。死牢里一名男子的生命悬而未决，弗里曼必须拼凑出十年前的谋杀案调查中的残酷证据，揭开一张由埋藏的秘密和与他的过去相关的背叛组成的险恶网络。凭借本能的信任，他面临着一个令人毛骨悚然的事实——有时，最好是让睡狗撒谎。', 'f', '89.769', 'https://image.tmdb.org/t/p/original/154YRV27zD4aHCydI7GWQNzSwdr.jpg', '{110723,88277,76991,219277,219278,202232,100000007}', '{US}', '2024-03-21 00:00:00', 0, 112, '{en}', 'Released', '', 'f', '6.528', 90, 1, '{"id": 978592, "imdb_id": "tt8542964", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q117007959", "instagram_id": "sleepingdogsmovie"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1577, 961381, 'tt19845370', NULL, '调职到乐队！', 'https://image.tmdb.org/t/p/original/mzShJdW1iKonxm6VUSr5Z0hLHEX.jpg', NULL, 0, '{28}', '', 'ja', '異動辞令は音楽隊！', '一根筋警察成濑司，因为连续发生老人被盗事件后，在没有搜查令的情况下，到处搜捕，引来上层反感。随后，他居然被调动至了警察音乐队……', 'f', '3.188', 'https://image.tmdb.org/t/p/original/dVyR6C6qYzUpZVhtlRaKHnCc9e4.jpg', '{100000007}', '{JP}', '2022-08-26 00:00:00', 0, 119, '{ja}', 'Released', '', 'f', '6.100', 9, 1, '{"id": 961381, "imdb_id": "tt19845370", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1578, 606870, 'tt9242528', NULL, '幸存者', 'https://image.tmdb.org/t/p/original/2X7BAu7x2oMB3cTMF38uJhGSqoB.jpg', NULL, 0, '{36,28,18}', '', 'en', 'The Survivor', 'Justine Juel Gillmer(《地球百子》《荒原》)编写剧本，基于哈夫特之子Alan Scott Haft写作的书籍《Harry Haft: Survivor Of Auschwitz, Challenger Of Rocky Marciano》，讲述一个男人在奥斯维辛集中营被迫与狱友进行残酷的角斗，胜利意味着能活着等待另一天的考验，而他击败的76名对手则走上了死亡之路。哈夫特承担了沉重的内疚之情，他尝试通过参加二战后备受瞩目的拳击大赛、与洛基·马西安诺等传奇人物比赛而重新找到活下去的理由，并希望能找到他在战争前爱上的那个女子，她激励了他在纳粹手中活下去的斗志。', 'f', '53.447', 'https://image.tmdb.org/t/p/original/oZWJ20tGWZ5xO9CrTCVavmDRy7J.jpg', '{13240,53152,100640,11407,184405,80563,100000007}', '{CA,US}', '2022-04-07 00:00:00', 0, 129, '{de,en}', 'Released', '', 'f', '7.027', 149, 1, '{"id": 606870, "imdb_id": "tt9242528", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q65079275", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1579, 718919, 'tt11220408', NULL, '末日协议', 'https://image.tmdb.org/t/p/original/8mkuMPDhnmRfs70LBID5XBa9xd2.jpg', NULL, 0, '{878,53}', '', 'en', 'The Deal', '一位母亲在经历了一场前所未有的全球大流行病之后，为挽救生病的女儿而奋力抗争，这场大流行给地球带来了前所未有的灾难，使得资源如此稀缺，你必须用生命的代价来支付。', 'f', '13.339', 'https://image.tmdb.org/t/p/original/yeqn2t4aadIvd4sgb73IOqqkLIL.jpg', '{3241,137474,156239,100000007}', '{US}', '2022-12-31 00:00:00', 0, 92, '{en}', 'Released', '你准备好死了吗？', 'f', '6.235', 17, 1, '{"id": 718919, "imdb_id": "tt11220408", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1580, 930432, 'tt17008472', NULL, '行骗天下JP：英雄篇', 'https://image.tmdb.org/t/p/original/vbu1Lrp4lXyvSB9oMswe8azc2QM.jpg', '{"id": 657351, "name": "行骗天下JP（系列）", "poster_path": "/o9HjegKfZaKkUJ6QOrPB9RXyPyF.jpg", "backdrop_path": "/8yeaoqgfxNSKeZLcQSOl0919H4X.jpg"}', 0, '{35}', '', 'ja', 'コンフィデンスマンJP 英雄編', '被称作「英雄」的诈欺师〈第三代槌之子〉去世。而过去曾在第三代槌之子底下接受训练的达子、小少爷、理查三人，为了继承当代第一〈槌之子〉的称号，在世界遗产都市─马尔他岛・瓦莱塔进行对决。本次的目标，是西班牙前黑道手中的梦幻秘宝─古希腊凋像〈起舞的维纳斯〉。螳螂捕蝉，黄雀在后。好不容易钓上了大鱼，却没注意到警察与国际刑警佈下天罗地网正在身后…。信用诈欺师行骗天下的最大骗局正式开始！！究竟是谁，才能获得胜利女神的眷顾！？真正的〈英雄〉、最后的〈真实〉到底是─！？', 'f', '8.845', 'https://image.tmdb.org/t/p/original/31qFSUTRy412fqvceFPHjCDJFOa.jpg', '{3341,882,100000007}', '{JP}', '2022-01-14 00:00:00', 0, 127, '{ja}', 'Released', '', 'f', '6.800', 13, 1, '{"id": 930432, "imdb_id": "tt17008472", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1581, 987507, 'tt21243618', NULL, '罪恶围城', 'https://image.tmdb.org/t/p/original/sGGNrDPV8VFJzOTZOcsFiJ45Xp3.jpg', NULL, 0, '{28,80}', '', 'ja', 'バッドシティ', '　　这是小泽监制和编剧的一部动作片，以“小泽”的名义编剧。 樱田组的首领在被称为犯罪城市的韩城市，被韩国黑手党金成义杀死。 金正恩与幕后控制韩城市的五条再白会长五条渡有秘密联系。 渴望起诉五条的检察厅总检察长平山贤治组建了一个特别调查小组，并将因事件在监狱服刑的前刑事督察虎田诚恢复了有限的时间。', 'f', '20.630', 'https://image.tmdb.org/t/p/original/3TzVyxqEuHPLrv5eK0EXpgszMzv.jpg', '{164697,202778,56274,100000007}', '{JP}', '2022-07-05 00:00:00', 0, 118, '{ja}', 'Released', '', 'f', '6.861', 83, 1, '{"id": 987507, "imdb_id": "tt21243618", "twitter_id": "BADCITYMOVIE", "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1582, 715370, 'tt13063384', NULL, '埋葬', 'https://image.tmdb.org/t/p/original/x1USUTrTuWqlSgV7268oYj7pJDB.jpg', NULL, 0, '{53}', '', 'en', 'Burial', '故事发生在第二次世界大战的最后几天，由情报官员布拉纳·瓦西里耶娃（Brana Vasilyeva）领导的一小队俄罗斯士兵，负责将希特勒的遗骸运回苏联的斯大林格勒。在途中，这支部队遭到德国“狼人”游击队的袭击，他们一个接一个地被杀掉。布拉纳带领她幸存的战友们战斗到最后一站，以确保他们的“货物”不会落入那些为了永远隐藏真相而将其掩埋的人手中。', 'f', '12.236', 'https://image.tmdb.org/t/p/original/c4D22vnat4DUm9a9TFPZ0abDEsc.jpg', '{74390,5056,12177,176228,1270,6154,100000007}', '{EE,GB}', '2022-09-02 00:00:00', 0, 95, '{en,de,ru}', 'Released', '有些秘密应该被掩埋。', 'f', '5.000', 29, 1, '{"id": 715370, "imdb_id": "tt13063384", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
