INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1583, 598212, 'tt14371244', NULL, '第一次奥斯卡', 'https://image.tmdb.org/t/p/original/uKNQCx6XuWbwee7aotNx2TaOHS3.jpg', NULL, 0, '{18,28,36}', '', 'ru', 'Первый Оскар', '这部电影讲述了两名学生摄影师的故事，随着战争逼近莫斯科，他们拒绝撤离，而是自愿成为前线摄影师，捕捉战争的恐怖和苏联士兵的英雄主义。与此同时，我们见证了另一个故事发生在美国。在已经完成的纪录片《莫斯科反击战》首映后，奥斯卡奖评选委员会的一名成员正试图说服他的同事们在即将到来的奥斯卡颁奖典礼上设立一个新的最佳纪录片类别。', 'f', '3.321', 'https://image.tmdb.org/t/p/original/jVo1JNQJAWNkDmjkcD1vLkWf9m2.jpg', '{20490,69587,76049,100000007}', '{RU}', '2022-04-21 00:00:00', 0, 100, '{ru}', 'Released', '网 ِ祉 73hx.xyz 看 ِ完 ِ整 ِ版', 'f', '7.800', 4, 1, '{"id": 598212, "imdb_id": "tt14371244", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1584, 628900, 'tt10323676', NULL, 'The Contractor', 'https://image.tmdb.org/t/p/original/figlwUsXXFehX3IebdjqNLV6vWk.jpg', NULL, 0, '{28,12,53}', '', 'en', 'The Contractor', '神秘契约背后隐藏的危机，原来是一场精心策划的致命阴谋。身处异国孤军奋战，该如何杀出重围、活着回家？  故事讲述被迫从海军陆战队退伍后，詹姆斯·里德（克里斯·派恩 饰）加入了一个准军事组织来维持生计。第一次执行任务时，里德就在东欧遭到追捕。他必须努力活到足够长的时间才能回家，并找出背叛他的人的真正动机。', 'f', '45.844', 'https://image.tmdb.org/t/p/original/2pCOmdHU3m1pkChn9V0jbSfkepq.jpg', '{3528,104363,47729,290,99272,100000007}', '{GB,US}', '2022-03-10 00:00:00', 2122288, 103, '{en}', 'Released', '承包商', 'f', '6.357', 845, 1, '{"id": 628900, "imdb_id": "tt10323676", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1585, 993621, 'tt13661368', NULL, '同床异客', 'https://image.tmdb.org/t/p/original/d0u1zrbOZJYQZzXYhrG7RhARxSI.jpg', NULL, 90, '{53,9648}', '', 'en', 'The Stranger in Our Bed', '一名已婚妇女发现她的爱人神秘失踪，一名年轻女孩被谋杀，她的生命处于严重危险之中。', 'f', '13.845', 'https://image.tmdb.org/t/p/original/9bX57QlmpI1DcWLkggGmg5guqJx.jpg', '{100000007}', '{GB}', '2022-08-26 00:00:00', 0, 90, '{en}', 'Released', '', 'f', '6.300', 49, 1, '{"id": 993621, "imdb_id": "tt13661368", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1586, 672475, 'tt11892034', NULL, '德维塔耶夫', 'https://image.tmdb.org/t/p/original/4WdrM96kPIK70ncNXFdIDDrM99e.jpg', NULL, 0, '{10752,28,18}', '', 'ru', 'Девятаев', '　　二战期间，苏联飞行员米哈伊尔·德维塔耶夫在一次任务中被德军俘虏。在战俘营他试图逃跑但没有成功，后被德军带到了乌瑟多姆岛的集中营。由于缺乏劳动力，他便被抽调参与德军V2火箭的生产工作，同时还要处理未爆弹和修建跑道。久而久之他萌生了偷取德军飞机偷渡回国的想法。为了实现这一计划他开始找机会了解德 军飞机的构造和操作方法。最终在1945年2月8日这天成功盗取一架德军轰炸机，并带上了9名战俘逃离德国，返回祖国。本片根据真实事件改编。', 'f', '12.264', 'https://image.tmdb.org/t/p/original/ixJt4Z9QUXHU1T0EJWhBx7SBf42.jpg', '{1038,130614,114349,100000007}', '{RU}', '2021-04-29 00:00:00', 0, 118, '{ru}', 'Released', '', 'f', '5.700', 16, 1, '{"id": 672475, "imdb_id": "tt11892034", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1587, 785663, 'tt12731980', NULL, '老亨利', 'https://image.tmdb.org/t/p/original/o7qbLdslYik6b8TDpepzTAo2RBx.jpg', NULL, 0, '{28,37,53,80,9648}', '', 'en', 'Old Henry', '故事发生在1906年的俄克拉荷马州，亨利（蒂姆·布雷克·尼尔森 Tim Blake Nelson 饰）带着儿子怀亚特（加文·刘易斯 Gavin Lewis 饰）来到这里定居，开始经营农场。早在十年前，亨利的妻子就去世了，这些年来，亨利一直希望自己能够教会怀亚特如何自食其力，亨利的姐夫艾尔（特雷斯·阿德金斯 Trace Adkins 饰）是这个家庭唯一的帮手。  　　一天，亨利在路边遇见了一个受伤的男人科里（斯科特·黑兹 Scott Haze 饰），和他在一起的，还有一把枪和一袋子钱。亨利将科里带回了家，藏起了武器和钱，但很快，他就知道自己惹了麻烦，因为一群自称是警察的人来到了亨利家要讲科里带走，他们正在调查一宗银行抢劫案。', 'f', '31.647', 'https://image.tmdb.org/t/p/original/3viF5FJZKawgqpMfYOGE9uGocGu.jpg', '{118155,74808,84465,23688,12852,100000007}', '{US}', '2021-10-01 00:00:00', 77463, 99, '{en,es}', 'Released', '', 'f', '7.242', 519, 1, '{"id": 785663, "imdb_id": "tt12731980", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q105102395", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1588, 576920, 'tt10525672', NULL, '银色溜冰鞋', 'https://image.tmdb.org/t/p/original/n96Mu6w9yGO3MM9yuBrYlVvc6gb.jpg', NULL, 0, '{10749,12,18,10751}', '', 'ru', 'Серебряные коньки', '　　1899年的圣诞节节期，浓郁的假日气氛笼罩着首都大城彼得堡，纷纷扬扬的大雪和结冰的河道似乎也被世纪末的狂欢点燃。命运的安排下，掌灯人之子马特维（Федор Федотов饰）和高官女儿阿丽萨（Софья Присс饰）在节日的街头相逢。马特维唯一的财富就是他的“银色溜冰鞋”，阿丽萨则梦想研习科学，摆脱父亲和未婚夫阿尔卡季（Кирилл Зайцев饰）的控制。两个世界的交错究竟会带来怎样的冰上奇缘？', 'f', '22.192', 'https://image.tmdb.org/t/p/original/gE86n03a2os0q1wp5lDHfQrVGV.jpg', '{99796,3467,21179,76049,3419,104485,69587,100000007}', '{RU}', '2020-12-10 00:00:00', 7099734, 136, '{ru}', 'Released', '', 'f', '7.633', 255, 1, '{"id": 576920, "imdb_id": "tt10525672", "twitter_id": null, "facebook_id": null, "wikidata_id": "Q64747594", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1589, 762079, 'tt12496706', NULL, '降灵日历', 'https://image.tmdb.org/t/p/original/sxmazOtNWi6IiZ1QqG0wkliHzgA.jpg', NULL, 0, '{27,53,18}', '', 'fr', 'Le Calendrier', '本片故事描述一位因為意外而下半身癱瘓的前舞者，在生日那天從朋友那裡收到一個「降臨節日曆」，她發現只要每天午夜吃掉裡面的一顆糖果，就能實現一個願望，正在為此感到高興的她，渾然不知即將有駭人的災難降臨在她身上……', 'f', '29.647', 'https://image.tmdb.org/t/p/original/qMzPbgGZLFUF2Izz4vVy7xAqPaw.jpg', '{3416,184153,49473,16888,792,11797,24430,100000007}', '{BE,FR}', '2021-12-01 00:00:00', 456555, 104, '{fr}', 'Released', '', 'f', '6.700', 307, 1, '{"id": 762079, "imdb_id": "tt12496706", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
