INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1593, 457955, 'tt4266076', NULL, '黑夜吞噬世界', 'https://image.tmdb.org/t/p/original/nVkI4hCEtaqPZiEc01fQNGipxC8.jpg', NULL, 0, '{18,27,53}', '', 'fr', 'La nuit a dévoré le monde', '法国末世丧尸题材惊悚恐怖片。改编自法国作家PitAgarmen的小说。巴黎也面临活尸危机！住在巴黎的山姆在一场疯狂派对彻夜狂欢，隔天早上醒来后却发现公寓裡只剩下自己，而屋外的街道早已被成群活尸攻占。惶恐失措的山姆必须绞尽脑汁武装自己藏身的大楼，并好好规划自己的求生大计。然而山姆真的是这场浩劫中唯一的倖存者吗？人类和僵尸究竟哪一种比较可怕？', 'f', '21.639', 'https://image.tmdb.org/t/p/original/hqqgDIlcETm5WB4LtJKXSOBabwa.jpg', '{726,104,10611,22784,100000007}', '{FR}', '2018-03-07 00:00:00', 95208, 94, '{en,fr,no}', 'Released', '', 'f', '6.048', 660, 1, '{"id": 457955, "imdb_id": "tt4266076", "twitter_id": null, "facebook_id": "lanuitadevorelemonde", "wikidata_id": null, "instagram_id": null}');
