INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1596, 403509, 'tt4621630', NULL, '绑架', 'https://image.tmdb.org/t/p/original/A5VmSqfPqQa60gL1uiwP0PSG1E3.jpg', NULL, 0, '{9648,53}', '', 'es', 'Secuestro', '一个天生耳聋的男孩在学校离奇失踪，而后他在警局指认了绑架犯的照片。但警察没有找到决定性证据，并未逮捕嫌疑人。男孩的妈妈是业界知名律师，在目睹警察办事不力之后，无法容忍儿子的安全时时受到威胁，于是她决定用自己的方式惩罚罪犯，但事态的发展却令她始料未及……一个有能力有手段又深爱孩子的母亲，是否能成为男孩的救世主呢？', 'f', '17.634', 'https://image.tmdb.org/t/p/original/iT4UuE0iJDjkOBVcKftEv7VXblh.jpg', '{11651,100000007}', '{ES}', '2016-08-19 00:00:00', 0, 105, '{es}', 'Released', '', 'f', '6.500', 254, 1, '{"id": 403509, "imdb_id": "tt4621630", "twitter_id": null, "facebook_id": null, "wikidata_id": null, "instagram_id": null}');
