INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1668, 72027, NULL, 64432, '魔法师', 'https://image.tmdb.org/t/p/original/qb9vehNFxTpPrazhD7JJ6QtEtCv.jpg', NULL, 0, '{18,10765}', 'http://www.syfy.com/themagicians', 'en', 'The Magicians', '昆汀·科尔德沃特（Quentin Coldwater）到达布雷克比尔大学（Brakebills University），这是一所专门培训魔术师的学校。 在那儿，他和同学爱丽丝（Alice），潘妮（Penny），玛歌（Margo）和艾略特（Eliot）磨练了自己的技能，测试了自己的才能，并建立了新的（常常是有问题的）人际关系，而同时面对着来自魔法世界的危险和致命威胁。 与此同时，昆汀的朋友朱莉娅（Julia）被布雷克比尔大学（Brakebills University）拒绝了，她独自沿着一条黑暗的，通常是危险的道路追寻魔法。', 'f', '1610.835', 'https://image.tmdb.org/t/p/original/k4sfQrvA6qQfv4h8KoMfjrsYGL4.jpg', '{7938,4205,26727,207345}', '{US,CA,GB}', '2015-12-16 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.600', 1554, 2, '{"id": 64432, "imdb_id": "tt4254242", "tvdb_id": 299139, "tvrage_id": 43586, "twitter_id": null, "facebook_id": "MagiciansSYFY", "freebase_id": null, "wikidata_id": "Q20642677", "freebase_mid": null, "instagram_id": null}');
