INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1235, 375682, NULL, 2224, '每日秀', 'https://image.tmdb.org/t/p/original/mDK2cWErxVyHwnSOCCiXBcIjS3K.jpg', NULL, 0, '{10763,35}', 'https://www.cc.com/shows/the-daily-show', 'en', 'The Daily Show', '在主持人特雷弗·诺亚于2022年底离职后，2023年间，《每日秀》节目从其内部及外部通讯员阵容中挑选了一系列嘉宾主持人轮流坐镇主播席位，每位主持人的任期为一周。直至2024年1月24日，宣布乔恩·斯图尔特将回归他曾于1999年至2015年主持的该节目。此次回归，斯图尔特不仅将担任执行制片人，还将至少到2024年美国选举周期结束时，主持每周一的节目内容。
