INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1822, 140930, NULL, 95057, '超人和露易丝', 'https://image.tmdb.org/t/p/original/qO8uNvhYrBRKKWZLUdHrvwuuQpG.jpg', NULL, 0, '{10765,18,10751}', 'https://www.cwtv.com/shows/superman-and-lois', 'en', 'Superman & Lois', '“超人”克拉克·肯特和妻子露易丝·莲恩带着两个儿子乔纳森和乔丹回到泽莫维尔小镇，他们与拉娜·朗重聚，结识她的丈夫凯尔·库欣以及他们的女儿莎拉。神秘访客的到来打破了小镇内宁静的田园生活。', 'f', '2214.865', 'https://image.tmdb.org/t/p/original/vlv1gn98GqMnKHLSh0dNciqGfBl.jpg', '{27711,1957,9993}', '{US}', '2021-02-23 00:00:00', 0, 44, '{en}', 'Returning Series', '拯救世界从照顾家庭开始', 'f', '7.900', 2278, 2, '{"id": 95057, "imdb_id": "tt11192306", "tvdb_id": 375655, "tvrage_id": null, "twitter_id": "cwsupermanlois", "facebook_id": "CWSupermanAndLois", "freebase_id": null, "wikidata_id": "Q93281114", "freebase_mid": null, "instagram_id": "cwsupermanandlois"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1823, 213204, NULL, 95057, '超人和露易丝', 'https://image.tmdb.org/t/p/original/qO8uNvhYrBRKKWZLUdHrvwuuQpG.jpg', NULL, 0, '{10765,18,10751}', 'https://www.cwtv.com/shows/superman-and-lois', 'en', 'Superman & Lois', '当第二季回归时,Tal-Rho与超人的战争仍是主轴故事缐,Lois和Clark努力奋战;Chrissy则与Lois调整报社经营方向;Jonathan在球场上面临新挑战;”祕密”将影响Jordan和Sarah日益增长的关系。 同时,Kyle越来越担心Lana与新市长的关系;John Henry Irons与他的女儿Natalie,尝试将这个新地球当成自己的第二家园。', 'f', '2214.865', 'https://image.tmdb.org/t/p/original/utpXq61UIlfNUuviz2hRmCEYdYr.jpg', '{27711,1957,9993}', '{US}', '2022-01-11 00:00:00', 0, 44, '{en}', 'Returning Series', '拯救世界从照顾家庭开始', 'f', '7.000', 2278, 2, '{"id": 95057, "imdb_id": "tt11192306", "tvdb_id": 375655, "tvrage_id": null, "twitter_id": "cwsupermanlois", "facebook_id": "CWSupermanAndLois", "freebase_id": null, "wikidata_id": "Q93281114", "freebase_mid": null, "instagram_id": "cwsupermanandlois"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1824, 318516, NULL, 95057, '超人和露易丝', 'https://image.tmdb.org/t/p/original/qO8uNvhYrBRKKWZLUdHrvwuuQpG.jpg', NULL, 0, '{10765,18,10751}', 'https://www.cwtv.com/shows/superman-and-lois', 'en', 'Superman & Lois', '第3季开始超人大败艾莉·奥尔斯顿已经过去了 27 天。Clark 和Lois现在一起在Smallville Gazette工作，享受小镇生活。然而，当一项卧底任务揭露了一个有望永远改变肯特家族的致命敌人时，露易丝自己的工作与生活平衡受到了考验。与此同时，肯特男孩发现自己被拉向相反的方向。在所有这些剧变中，约翰·亨利被他分身的过去所困扰，导致他和娜塔莉面临危险的后果。拉娜朗和凯尔在分居后重新定义了他们的家庭，而莎拉在了解乔丹超能力的真相后，探索她和乔丹的未来。塞缪尔·莱恩将军通过艰难的方式了解到没有人可以信任与超人一起工作后，重新获得了他在国防部的职位，但在与他的外孙乔丹一起工作时却面临着自己的冲突。', 'f', '2214.865', 'https://image.tmdb.org/t/p/original/ubSzv6eUqFke4rPyJU8r2MeN53i.jpg', '{27711,1957,9993}', '{US}', '2023-03-14 00:00:00', 0, 44, '{en}', 'Returning Series', '拯救世界从照顾家庭开始', 'f', '7.000', 2278, 2, '{"id": 95057, "imdb_id": "tt11192306", "tvdb_id": 375655, "tvrage_id": null, "twitter_id": "cwsupermanlois", "facebook_id": "CWSupermanAndLois", "freebase_id": null, "wikidata_id": "Q93281114", "freebase_mid": null, "instagram_id": "cwsupermanandlois"}');
