INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1844, 59512, NULL, 1405, '嗜血法医', 'https://image.tmdb.org/t/p/original/aSGSxGMTP893DPMCvMl9AdnEICE.jpg', NULL, 0, '{80,18,9648}', 'http://www.sho.com/dexter', 'en', 'Dexter', 'LaGuerta的谋杀案已经过去六个月，Dexter仍然忙于在父亲、哥哥和连环杀手三重角色中寻找平衡点。Debra已经离开迈阿密大都会警察局，在一家私人侦探社当起了私人侦探，同时也深陷Dexter的杀戳行为而带来的精神混乱中。Batista取代Debra成为中尉警官。与此同时，迈阿密大都会警察局开始调查一起奇怪的谋杀案，受害人大脑的某些部分被凶手摘走了…', 'f', '1806.095', 'https://image.tmdb.org/t/p/original/q8dWfc4JwQuv3HayIZeO84jAXED.jpg', '{4343,17594,12261,17595,17596}', '{US}', '2013-06-30 00:00:00', 0, 55, '{en}', 'Ended', '', 'f', '6.900', 4010, 2, '{"id": 1405, "imdb_id": "tt0773262", "tvdb_id": 79349, "tvrage_id": null, "twitter_id": "SHO_Dexter", "facebook_id": "DexterOnShowtime", "freebase_id": "/en/dexter", "wikidata_id": "Q23577", "freebase_mid": "/m/0fhzwl", "instagram_id": null}');
