INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1851, 6904, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '迪恩和萨姆是两兄弟，生在温切斯特家族的他们，血统里便带着与生俱来的责任——成为“猎人”，专门对付危害人类的恶魔与超自然力量。22年前，他们的母亲遭遇恶魔毒手，因此父亲约翰多年来一面试图追杀恶魔，一面训导两兄弟成为优秀猎人。不过，相比哥哥迪恩对“捕猎”的热衷，弟弟萨姆显然更爱普通生活，他进了斯坦福大学，有了美丽女友，一心要与古怪家庭脱离关系。怎料一次捕猎活动中父亲失踪，迪恩只能召来弟弟协助，萨姆先是勉为其难，但随着调查深入，他发现命中注定的事根本无法凭他个人力量改变。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/f4NzMUpOqwzut7jML4IUZcHqkLt.jpg', '{38398,38399,4022,1957}', '{US}', '2005-09-13 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1852, 6905, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '他们回来了，那些食尸鬼和吸血鬼，幽灵和鬼魂，甚至还有更为恐怖的存在。无论这些邪恶的生物在哪里，你都会发现山姆·温彻斯特和迪恩·温彻斯特两兄弟的身影，他们是猎人，追踪着杀害他们母亲的恶魔，以及任何其他超自然的不神圣力量。加入这两兄弟，在他们令人费解、毛骨悚然的第二季美国公路之旅中，这是一段深入探索他们自身命运之谜的旅程。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/O1xXxsAWiCWrw5eMmGCs1JpFNY.jpg', '{38398,38399,4022,1957}', '{US}', '2006-09-28 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.900', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1853, 6906, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '黄眼恶魔已被击败，但代价惨重。这场战斗虽然令他垮台，却也让数百个来自地狱的恶魔被释放到了一个毫无防备的世界中。同时，这也让山姆付出了生命的代价。然而，悲痛欲绝的迪恩与交叉路口恶魔做了一个交易：用自己的灵魂换取山姆的复活。现在，迪恩只剩下一年的生命。这一年，他要对抗邪恶、扭曲和骇人的存在。这一年，他要向山姆告别。而对山姆来说，这一年则是他拼命寻找拯救哥哥的方法的一年。在温彻斯特兄弟继续他们惊人的超自然奥德赛，以及个人宿命之旅的过程中，一场震撼心灵的冒险正等待着他们。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/owiz98MIJInep0eOd4io97p69UO.jpg', '{38398,38399,4022,1957}', '{US}', '2007-10-03 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.800', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1854, 6907, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '复活。在经历了无法言说的折磨之后，迪恩从地狱逃脱，被他从未见过的一种全能生物所救——那是一位天使，上帝的战士，他招募了山姆和迪恩加入天堂对抗地狱的战争。传闻中，某个堕落天使即将从他在地狱深处的牢狱中被释放出来：那就是路西法。如果山姆和迪恩不能阻止这一幕发生，一旦路西法重获自由，他将会带来末日审判。与此同时，温彻斯特兄弟重聚并再次踏上旅途，在他们走过的每一个地方与超自然力量作战。他们遭遇了恶魔、幽灵、甚至吸血鬼德古拉本人，甚至还遇到了一只醉醺醺的、全副武装的七英尺高泰迪熊。在这期间，最终的战争逐渐将他们卷入恐怖的漩涡。夹在天堂与地狱之间，处在上帝与魔鬼的较量之中，温彻斯特兄弟必须为了人类的未来而战。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/2FGxAP0zwgTZjK6Ev22sox1yIKH.jpg', '{38398,38399,4022,1957}', '{US}', '2008-09-18 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.900', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1855, 6908, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '两位兄弟与一名堕落天使——共同对抗撒旦及其军队的全部力量！随着末日审判临近，地球即将变成一片被人类鲜血浸染的战场，山姆、迪恩和卡斯迪尔面临着艰难险阻。新的敌人出现，其中包括四位末日骑士。旧友离去，被地狱的可怕愤怒吞噬。在此过程中，温彻斯特兄弟受到恶魔和天使的双重针对，他们警告说，在即将到来的大灾难中，每位兄弟都将扮演一个特殊且可怕的角⾊。第五季中，山姆和迪恩踏上了迄今为止最为恐怖的旅程，这条道路可能会引领他们找到唯一强大到足以击败魔鬼的盟友：上帝。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/g0pAERtcvBwqDvFxfDbBPzfHoyQ.jpg', '{38398,38399,4022,1957}', '{US}', '2009-09-10 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.900', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1856, 6909, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '目标：终结末日审判。代价：山姆的生命。第五季令人毛骨悚然的结局中，山姆坠入地狱，只留下迪恩孤独一人。如今，迪恩发誓不再狩猎，并决定投身于与丽萨和她的儿子本组建家庭的生活。然而，山姆神秘地重现人间，将迪恩重新拉回了过去的生活轨道。但此时的山姆也已不再是原来的他——他归来时没有携带灵魂。温彻斯特兄弟如何面对这一对他们坚固纽带的最大挑战，成为了第六季深刻而惊心动魄的22集故事的核心——也是他们心灵深处的困扰。在兄弟俩努力重聚的同时，他们还不得不与各种致命的超自然力量斗争。恶魔、天使、吸血鬼、变形怪，以及一个名为“万物之母”的恐怖新敌人。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/4jEVEZiuJa023ZzcI0mutle6eND.jpg', '{38398,38399,4022,1957}', '{US}', '2010-09-24 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.600', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1857, 6910, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '在第七季中，山姆和迪恩对抗恶魔。有真实的恶魔，如路西法，他通过向山姆展示地狱景象来折磨他；也有内心的恶魔，兄弟俩痛失挚友，鲍比因异族力量而惨遭杀害。随着山姆和迪恩在美国的偏远道路上旅行，追踪那些给无辜者带来浩劫的怪物，一个新的、更可怕的敌人也在追捕他们：利维坦，它们从炼狱中解脱出来，对兄弟俩的武器库及智谋具有免疫力。随着鲍比的离去，山姆和迪恩只能依靠彼此。但仅凭此是否足够呢？', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/hkgRHa2fjySdj6gA8VLHQrxUfiP.jpg', '{38398,38399,4022,1957}', '{US}', '2011-09-22 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1867, 123367, NULL, 85077, '拣选', 'https://image.tmdb.org/t/p/original/qvbFdPvXMliwwrWlfUStcHc96JQ.jpg', NULL, 0, '{18,10751}', 'https://www.angel.com/watch/the-chosen', 'en', 'The Chosen', '', 'f', '1028.038', 'https://image.tmdb.org/t/p/original/wNyVhOgNDk4ssSGuKFjYFh1gbCw.jpg', '{212920,211135,226339}', '{US}', '2017-09-20 00:00:00', 0, 43, '{en,es}', 'Returning Series', '', 'f', '0.000', 294, 2, '{"id": 85077, "imdb_id": "tt9471404", "tvdb_id": 356992, "tvrage_id": null, "twitter_id": "thechosentv", "facebook_id": "InsideTheChosen", "freebase_id": null, "wikidata_id": "Q60787503", "freebase_mid": null, "instagram_id": "thechosentvseries"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1858, 6911, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '在第八季首播集中，山姆和迪恩在分别一年后重聚。迪恩在一位名叫本尼的吸血鬼的帮助下从炼狱逃脱后，径直去找山姆，但他们的重逢并不完全像他想象的那样。尽管山姆放下一切去加入他的兄弟，但他发现离开已经习惯了并乐在其中的生活远比预想中困难得多。与此同时，本尼的帮助似乎超过了迪恩原本的预料。随着兄弟俩在意外的重逢中挣扎，他们发现了一个令人震惊的秘密，这个秘密可能会引导他们走上一段解决旧怨的深度个人使命。只要他们能达成一致——这究竟是不是“家族事业”呢？', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/16gx7PmtzXHadQfW9Y9GGQZS3T9.jpg', '{38398,38399,4022,1957}', '{US}', '2012-10-02 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.400', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1859, 6903, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '在上一季中击败了利维坦后，山姆和迪恩踏上了一段史诗般的征程，旨在封印地狱之门。经历了一系列试炼后，温彻斯特兄弟发现自己陷入了地狱之王与众多战士天使之间的古老权力斗争中心。然而随着天使们被逐出天堂并在人间游荡，局势变得愈发难以预料。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/5f2mRNqKFgtV5AWnC0OSIkYbzw0.jpg', '{38398,38399,4022,1957}', '{US}', '2013-10-07 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.200', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1860, 62088, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '第十季开篇以山姆疯狂寻找消失得无影无踪的哥哥迪恩为开端。寻回误入歧途的迪恩让山姆步入了黑暗的道路，随之产生的后果将使兄弟二人深感震撼。与此同时，卡斯蒂尔不得不收拾梅塔特隆行动后的残局。随着他的神力逐渐衰弱，仍有叛逃天使逍遥法外，卡斯蒂尔将面临自己有限寿命的倒计时，在全新威胁再度涌现之际，所有英雄都将面临极限挑战。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/ugupPUhnzbrFCvteRJ9au7BJglM.jpg', '{38398,38399,4022,1957}', '{US}', '2014-10-06 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.100', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1861, 70169, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '在黑暗势力被释放后，本季的故事跟随温彻斯特家族（包括山姆和迪恩）及其盟友，因为他们发现自己正在对抗迄今为止遇到的最强大的超自然实体。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/2RlcVP4LsRzr1g8oIU3hNq0BEwm.jpg', '{38398,38399,4022,1957}', '{US}', '2015-10-06 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.400', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
