INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1863, 92695, NULL, 1622, '邪恶力量', 'https://image.tmdb.org/t/p/original/nVRyd8hlg0ZLxBn9RaI7mUMQLnz.jpg', NULL, 0, '{18,9648,10765}', '', 'en', 'Supernatural', '第十三季紧接上一季结尾，山姆和迪恩在失去母亲、克劳利死亡以及卡斯蒂尔令人心碎的离世后，不得不收拾残局。杰克的诞生使得温彻斯特兄弟对于如何应对一个尼腓利姆产生了不同的看法。在被拽入裂隙之后，玛丽必须学会在路西法和末日般的世界中求生。', 'f', '1225.923', 'https://image.tmdb.org/t/p/original/xBJ7Ts2nDUbUWu4Ef9v086dbBrQ.jpg', '{38398,38399,4022,1957}', '{US}', '2017-10-12 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 7284, 2, '{"id": 1622, "imdb_id": "tt0460681", "tvdb_id": 78901, "tvrage_id": 5410, "twitter_id": "cw_spn", "facebook_id": "Supernatural", "freebase_id": "Q130585", "wikidata_id": "Q130585", "freebase_mid": "/m/06s3sm", "instagram_id": "cw_supernatural"}');
