INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1872, 392666, NULL, 95842, '庆余年', 'https://image.tmdb.org/t/p/original/u1CqlLecfpcuOaugKi3ol9gDQHJ.jpg', NULL, 0, '{18}', 'https://v.qq.com/x/cover/rjae621myqca41h/i0032qxbi2v.html', 'zh', '庆余年', '身世神秘的少年范闲，自小跟随奶奶生活在海边小城澹州，随着一位老师的突然造访，他看似平静的生活开始直面重重的危机与考验。在神秘老师和一位蒙眼守护者的指点下，范闲熟识药性药理，修炼霸道真气并精进武艺，而后接连化解了诸多危局。因对身世之谜的好奇，范闲离开澹州，前赴京都。 在京都，范闲饱尝人间冷暖并坚守对正义、良善的坚持，历经家族、江湖、庙堂的种种考验与锤炼，书写了光彩的人生传奇。', 'f', '1705.925', 'https://image.tmdb.org/t/p/original/nqxGabIW9Ja2ac9XlssBWLZ7tZc.jpg', '{}', '{CN}', '2024-05-07 00:00:00', 0, 45, '{zh}', 'Returning Series', '', 'f', '0.000', 61, 2, '{"id": 95842, "imdb_id": "tt11273352", "tvdb_id": 372881, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1873, 136531, NULL, 95842, '庆余年', 'https://image.tmdb.org/t/p/original/u1CqlLecfpcuOaugKi3ol9gDQHJ.jpg', NULL, 0, '{18}', 'https://v.qq.com/x/cover/rjae621myqca41h/i0032qxbi2v.html', 'zh', '庆余年', '某大学文学史专业的学生张庆熟读古典名著，但他用现代观念剖析古代文学史的论文命题不被叶教授所认可。为了让叶教授成为自己的研究生导师，张庆决定通过写小说的方式，进一步阐述自己想要表达的观点。 在他的小说中，身世神秘的少年——范闲，自小跟随奶奶生活在海边小城澹州，随着一位老师的突然造访，他看似平静的生活开始直面重重的危机与考验。在神秘老师和一位蒙眼守护者的指点下，范闲熟识药性药理，修炼霸道真气并精进武艺，而后接连化解了诸多危局。因对身世之谜的好奇，范闲离开澹州，前赴京都。 在京都，范闲饱尝人间冷暖并坚守对正义、良善的坚持，历经家族、江湖、庙堂的种种考验与锤炼，书写了光彩的人生传奇。', 'f', '1705.925', 'https://image.tmdb.org/t/p/original/ob8Kz0FSZFCCkAhKHJKU4kJ9UFo.jpg', '{}', '{CN}', '2019-11-26 00:00:00', 0, 45, '{zh}', 'Returning Series', '', 'f', '8.000', 61, 2, '{"id": 95842, "imdb_id": "tt11273352", "tvdb_id": 372881, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1874, 348288, NULL, 95842, '庆余年', 'https://image.tmdb.org/t/p/original/u1CqlLecfpcuOaugKi3ol9gDQHJ.jpg', NULL, 0, '{18}', 'https://v.qq.com/x/cover/rjae621myqca41h/i0032qxbi2v.html', 'zh', '庆余年', '《庆余年2》承接上季故事，范闲将会面临史无前例的压力、更为复杂的局面以及更加棘手的难题，他将如何对抗二皇子以及长公主等人的威逼与生死考验，并实践母亲叶轻眉的理想？而等著嗑「饭碗CP」的观众也将如愿迎来范闲和林婉儿的大婚，但两人的甜蜜爱情却在成婚后迎来前所未有的考验。', 'f', '1705.925', 'https://image.tmdb.org/t/p/original/zp6xQY6erziGoqqQ4L7sfDMjzCY.jpg', '{}', '{CN}', '2024-05-16 00:00:00', 0, 45, '{zh}', 'Returning Series', '', 'f', '9.800', 61, 2, '{"id": 95842, "imdb_id": "tt11273352", "tvdb_id": 372881, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": null, "instagram_id": null}');
