INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1876, 44728, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', '第一季的故事从 1912 到 1914 年第一次世界大战爆发。Grantham 的伯爵头衔及产业只能由男性继承人同时继承。现任伯爵 Robert 通过迎娶了极富有的 Cora 才让产业得救，同时她的巨额财产按照契约永久的成为伯爵资产
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1877, 44729, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', '第二季的故事从 1916 年到 1918 年康边停战协定。正值战争时期，壮年男性都去了前线参加战争，而 Grantham 伯爵 Robert 因为年龄而无法服役而留下。而唐顿庄园却因此遭到了男性劳动力的短缺。Grantham 家三个女儿的命运也发生了改变。Mary 为了掩盖年少时的丑闻不得已与一暴发户订婚，当回到唐顿发现 Matthew 已经订婚时，强忍悲伤。Edith 一改往日张扬跋扈留在家中照顾前来疗养的士兵。Sybil 不但投身于为女权运动还不顾反对与家中的司机结合。同样，在本季中，Bates 和 Anna 的感情戏也加重了戏码。在这个战火缭绕的年代，这个家庭又会发生了怎么样的变化呢？', 'f', '2103.348', 'https://image.tmdb.org/t/p/original/ilCoT7k9I5YjQntUqDHQqowNg30.jpg', '{24546,6196,10197}', '{GB}', '2011-09-18 00:00:00', 0, 66, '{en}', 'Ended', '', 'f', '7.300', 953, 2, '{"id": 33907, "imdb_id": "tt1606375", "tvdb_id": 193131, "tvrage_id": 26615, "twitter_id": null, "facebook_id": "downtonabbey", "freebase_id": null, "wikidata_id": "Q83071", "freebase_mid": "/m/0ddd0gc", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1878, 44730, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', '时代在向前行进，唐顿庄园则依然维持它表面的平静和不变。大表哥 Matthew 继圣诞夜求婚成功后，开始和 Mary 筹划着婚礼。Edith 依然在为自己的幸福拼搏着。Sybil 怀着身孕和小司机 Branson 回到唐顿准备参加 Mary 的婚礼。看似顺利的唐顿庄园，也潜伏着令人不安的因素。老爷被告知投资失败，唐顿庄园可能将没有资金维持。另一方面，Matthew 成了前未婚妻 Lavinia 父亲的遗产继承候选人，顺位在他前面的二人因为各种原因都丧失了继承的条件，Matthew 意外获得了一笔巨额财富，但他出于良心上的不安，不准备接受。而 Bates 依然深陷狱中，等待出头之日。围绕着“变革”二字，唐顿庄园的转型不可避免。', 'f', '2103.348', 'https://image.tmdb.org/t/p/original/A7LrBAYrq0Fa9O2tSFdrsFv8WaZ.jpg', '{24546,6196,10197}', '{GB}', '2012-09-16 00:00:00', 0, 66, '{en}', 'Ended', '', 'f', '7.400', 953, 2, '{"id": 33907, "imdb_id": "tt1606375", "tvdb_id": 193131, "tvrage_id": 26615, "twitter_id": null, "facebook_id": "downtonabbey", "freebase_id": null, "wikidata_id": "Q83071", "freebase_mid": "/m/0ddd0gc", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1879, 44731, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', 'Matthew 死后，Mary 陷入了很长时间的一段消沉期，她每天无所事事，似乎心灵也已经随 Matthew 死去。然而时光的脚步不会因为谁的悲伤而停下，唐顿依然是那个楼上楼下忙忙碌碌的唐顿。一家之长 Robert 还是要操心唐顿的营收问题，而老夫人 Violet 也要关心她的孙女们，二小姐 Edith 还在寻找她的幸福，Tom 则逐渐融入这个大家族，Matthew 的母亲也必须走出丧子之痛。Thomas 依旧在仆人的世界里兴风作浪，似乎没有接受之前的教训。几个女仆和男仆的感情也陷入了纠葛，甚至 Anna 和 Bates 的感情也并非一帆风顺。随着时代的进步，唐顿落后的庄园管理方法亟待改变，而 Mary 是否能继承 Matthew 的遗愿，继续他未完的事业呢？而面对他人的追求，Mary 又该作何选择？', 'f', '2103.348', 'https://image.tmdb.org/t/p/original/pPf1nuM2kezWy0EmOipMTGcfOmz.jpg', '{24546,6196,10197}', '{GB}', '2013-09-15 00:00:00', 0, 66, '{en}', 'Ended', '', 'f', '7.600', 953, 2, '{"id": 33907, "imdb_id": "tt1606375", "tvdb_id": 193131, "tvrage_id": 26615, "twitter_id": null, "facebook_id": "downtonabbey", "freebase_id": null, "wikidata_id": "Q83071", "freebase_mid": "/m/0ddd0gc", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1880, 62638, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', '《唐顿庄园》第五季已获英国 ITV 电视网续订，有望于 2014 年秋天正式回归。据悉，此次续订的消息是在第四季大结局播出后英国 ITV 电视网即刻宣布的。第五季将依然延续前四季的配置，共拍摄8集，并制作每年传统圣诞特别集。第五季的剧本仍将由金牌编剧朱利安·菲罗斯撰写，加雷斯·尼姆担任制作人。尼姆承诺，全新的第五季将会像前几季一样“起伏跌宕的、浪漫的、戏剧性的和充满喜剧色彩”。', 'f', '2103.348', 'https://image.tmdb.org/t/p/original/6xYX5FKssozhhQHEYofnI20mY4d.jpg', '{24546,6196,10197}', '{GB}', '2014-09-21 00:00:00', 0, 66, '{en}', 'Ended', '', 'f', '6.800', 953, 2, '{"id": 33907, "imdb_id": "tt1606375", "tvdb_id": 193131, "tvrage_id": 26615, "twitter_id": null, "facebook_id": "downtonabbey", "freebase_id": null, "wikidata_id": "Q83071", "freebase_mid": "/m/0ddd0gc", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1890, 217, NULL, 79, '爱探险的朵拉', 'https://image.tmdb.org/t/p/original/uEPbIAmsZENHL5B50WNYSyItFjf.jpg', NULL, 0, '{10759,16,10751,10762}', 'http://www.nickjr.com/dora-the-explorer', 'en', 'Dora the Explorer', '讲述的是一个爱探险的7岁小女孩的故事。她精通双语，常常在探险路上积极地恳请学龄前儿童给予她帮助。在每一集里，朵拉和她最好的朋友小猴布茨会向观众小朋友求助，解决他们在路上碰到各种困扰和难题，每一次在小朋友的帮助下，朵拉都能闯关成功，到达目的地！', 'f', '1421.016', 'https://image.tmdb.org/t/p/original/yrQkvvyveHaJroxXIH0WBt5oJ68.jpg', '{4859,5371,139142}', '{US}', '2000-08-14 00:00:00', 0, 30, '{en,es}', 'Ended', '', 'f', '10.000', 289, 2, '{"id": 79, "imdb_id": "tt0235917", "tvdb_id": 74697, "tvrage_id": 3348, "twitter_id": "doratheexplorer", "facebook_id": "DoraTheExplorer", "freebase_id": "/en/dora_the_explorer", "wikidata_id": null, "freebase_mid": "/m/01z_mj", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (1881, 69183, NULL, 33907, '唐顿庄园', 'https://image.tmdb.org/t/p/original/vXbSoGHWtzViIgHxcD3tqLTr0lc.jpg', NULL, 0, '{18}', 'http://www.itv.com/downtonabbey', 'en', 'Downton Abbey', '《唐顿庄园》第六季将是它的最后一季。此前，剧集的联合制作人盖瑞斯·尼姆在接受采访时就表示，该剧会在第六季后“随时剧终”，如今这一言论最终成为现实。 《唐顿庄园》从 2010 年开播至今，一直是英国观众非常喜爱的作品，但随着剧情拉长，收视率已经大不如前，这也是该剧选择剧终的其中一个原因，不过对于普遍偏短的英剧来说，《唐顿庄园》坚持到六季已经是个不小的规模了。 据报道，《唐顿庄园》的不少演员合约都只签到了第六季，并且有很多主创都已经开始准备投入新作品的创作中去了。尤其是编剧兼制作人朱利安·费罗斯，早在几年前就已经开始准备自己的 NBC 新剧《流金岁月》，但一直碍于《唐顿庄园》的续订而没能抽出身来，现在也能够全身心的投入到新剧的制作。', 'f', '2103.348', 'https://image.tmdb.org/t/p/original/cOsuGCYkbAMtDRvYZ0sxYSPZYnm.jpg', '{24546,6196,10197}', '{GB}', '2015-09-20 00:00:00', 0, 66, '{en}', 'Ended', '', 'f', '7.600', 953, 2, '{"id": 33907, "imdb_id": "tt1606375", "tvdb_id": 193131, "tvrage_id": 26615, "twitter_id": null, "facebook_id": "downtonabbey", "freebase_id": null, "wikidata_id": "Q83071", "freebase_mid": "/m/0ddd0gc", "instagram_id": null}');
