INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2182, 297014, NULL, 2370, '地狱厨房', 'https://image.tmdb.org/t/p/original/kitfuCa2TqX6oY5HvdFRjMMaLwc.jpg', NULL, 0, '{10764}', 'https://www.fox.com/hells-kitchen/', 'en', 'Hell''s Kitchen', '重返洛杉磯，一群青年廚師和中年廚師將爭奪成為戈登拉姆齊地獄廚房餐廳亞特蘭大店的主廚職位以及25萬獎金。', 'f', '1485.554', 'https://image.tmdb.org/t/p/original/lSWhh4dnk4xjPAxX0kslOIIYxRB.jpg', '{37066,10957,167492,21040}', '{US}', '2022-09-29 00:00:00', 0, 44, '{en}', 'Returning Series', '', 'f', '7.200', 257, 2, '{"id": 2370, "imdb_id": "tt0437005", "tvdb_id": 74897, "tvrage_id": 3828, "twitter_id": "HellsKitchenFOX", "facebook_id": "HellsKitchen", "freebase_id": null, "wikidata_id": "Q1012139", "freebase_mid": "/m/06b1qr", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2183, 352001, NULL, 2370, '地狱厨房', 'https://image.tmdb.org/t/p/original/kitfuCa2TqX6oY5HvdFRjMMaLwc.jpg', NULL, 0, '{10764}', 'https://www.fox.com/hells-kitchen/', 'en', 'Hell''s Kitchen', '《地獄廚房》是一檔備受歡迎的美食真人秀節目，由米歇爾·馬爾科姆和戈登·拉姆齊主持。第二十季的主題是「年輕槍手」（Young Guns），共有16名年齡在23歲以下的廚師選手參加比賽。他們將在艱苦的競爭中展現自己的才華，爭奪10萬美元的獎金和一份在拉姆齊旗下餐廳工作的機會。本季節目的比賽將充滿挑戰和壓力，參賽者需要在有限的時間內完成各種複雜的烹飪任務。他們將面臨嚴格的評判和挑剔的顧客，必須在短時間內為客人提供高品質的美食。在這個過程中，選手們將展示他們的烹飪技巧和個性，並與其他選手競爭。 《地獄廚房》第二十季共16集，每集長度約42分鐘。觀眾將看到選手在艱苦的環境中競爭，為了贏得勝利而不斷努力和進步。同時，觀眾也可以欣賞到精美的菜餚和獨特的烹飪風格。該節目在全球廣受歡迎，是美食愛好者不容錯過的精彩節目。讓我們一起探索這部影視作品的精彩之處吧！這部作品名為地獄廚房(美版) 第二十二季，它是2023年的一部綜藝作品，由內詳執導，戈登·拉姆齊,Johnathan,Benvenuti,Mattias,Butts,Raneisha,Conerly ,Sandra,Day,Brad,Delgado,Claudia,Diawara,Jason,Hedin,Carmen,Ibarra,Melissa,Irons,Atoye,Johnson,Dahmere,Merriweather,Ryan,O''Sullivan,Leigh,Orleans,Devon,Rosenblatt,Jason,O''Sullivan,Leigh,Orleans,Devon,Rosenblatt,JasonJason ,Santos,Sammi,Tar等實力派演員傾情演繹。這部作品以為語言，其劇情引人入勝，讓觀眾沉浸其中，久久不能自拔。故事發生在內部研究這樣一個令人著迷的背景下，每個細節都被精心呈現，讓觀眾彷彿置身其中。這個故事不僅僅是一部普通的綜藝作品，它融合了浪漫、懸疑、動作等元素，為觀眾呈現了一場精彩的視覺饗宴。在地獄廚房(美版) 第二十二季中，您將跟隨主角的腳步，經歷一系列令人驚嘆的冒險和挑戰。劇情緊湊，扣人心弦，每個轉折都將引發您的好奇心。導演透過精湛的鏡頭語言和緊張刺激的劇情，將觀眾帶入一個意想不到的世界，讓人難以預料的情節將會讓您欲罷不能。', 'f', '1485.554', 'https://image.tmdb.org/t/p/original/2XQhUtp7eNVp2OBv2kveNUCmh1w.jpg', '{37066,10957,167492,21040}', '{US}', '2023-09-28 00:00:00', 0, 44, '{en}', 'Returning Series', '', 'f', '7.100', 257, 2, '{"id": 2370, "imdb_id": "tt0437005", "tvdb_id": 74897, "tvrage_id": 3828, "twitter_id": "HellsKitchenFOX", "facebook_id": "HellsKitchen", "freebase_id": null, "wikidata_id": "Q1012139", "freebase_mid": "/m/06b1qr", "instagram_id": null}');
