INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2333, 12087, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '五年的追逐化为泡影，随着X档案的关闭，福克斯·穆德和丹娜·斯科莉被迫调任处理一些平常的案件。某天，美国得州达拉斯市发生一起爆炸案。虽然穆德和斯科莉极力疏散写字楼内的人群，但爆炸还是夺取了4名无辜者的性命，他们也因此受到上级的指摘。然而事后不久，穆德便得知4名牺牲者早在爆炸之前便已死亡，所谓爆炸案不过是某个神秘部门为了掩盖证据而实施的骗局。该部门据说多年来一直从事外星人的研究，并且他们的研究足以导致人类的毁灭。两名搭档决定彻查此事，但是神秘且难以抗拒的力量无时无刻不在阻挠他们追寻真相的脚步……', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/2Snk0D67ZsSoPdG88KSP1Uuedsi.jpg', '{545,1556}', '{US}', '1998-02-01 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '0.000', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2334, 12078, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '联邦调查局特别探员史考莉被调入和另一特别探员穆德一同办理X档案。穆德因其妹萨蔓莎幼年失踪，怀疑是被外星人绑架而对研究外星人产生兴趣，政府高层害怕真相的揭露而又不敢动作过大，于是希望借史考莉的科学观点把穆德拉回主流。结果是，史考莉也陷入其中而不能自拔。本季内容除了外星人，还有不可解释的自然现象、基因突变的怪兽、古老的咒语与传说。本季结束于X档案的调查被终结。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/my640T80OJ6dekVLkBXubtIM71x.jpg', '{545,1556}', '{US}', '1993-09-10 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2335, 12079, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', 'X档案被封存，穆德与史考莉分别被派给不同的任务，但穆德仍时时注意任何有关X档案的案件，并常找史考莉帮忙。由于演员吉莲·安德森怀孕，制作人将剧情发展成斯卡琳被外星人绑架，消失了一集。当然，那时候吉莲·安德森去医院生产了。最终史考莉被秘密组织送回到一家医院，自此以后，X档案进入一新阶段。这季主要仍围着不可解释的超自然现象及外星人打转，结束于穆德因过分接近真相而遭迫害，千里迢迢到新墨西哥寻找证据，却被特种部队袭击生死不明。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/8xZ1Zf82CclxaltP6grBRtR7Nwg.jpg', '{545,1556}', '{US}', '1994-09-16 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.600', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2336, 12080, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '沿续上一季的剧情，穆德被印第安人朋友Albert Hosteen救了性命。X档案的编剧似乎有用不完的点子。这季内容包括了湖中水怪、能控制人意识的精神病患、唐人街上的纷争、二次大战时日本的人体实验等等。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/5skcM3tQ3ThyPn1v1oLfaLkWno2.jpg', '{545,1556}', '{US}', '1995-09-22 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.600', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2337, 12081, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '到这季开始时，X档案已是家喻户晓的科幻影集了。虽然仍被某些人认为太过偏激，但在金球奖艾美奖纷纷获得肯定。第四季仍是过去一贯的风格，但加入了许多穆德、史考莉的个人生活。在该季中，“黑油”“天花蜂”的出现使有关“真相”的调查变得更加坎坷而且扑朔迷离。另外一重大发展则是史考莉发现自己患有癌症，住院治疗，病情虽稳定住，但仍有危险。本季也介绍了癌人的年轻时代，向观众交待他的历史。本季也包括了一集喜剧，相信看过的朋友都知道。本季结束于穆德在从阿拉斯加调查回来后对生命绝望，因而举枪自杀。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/cDvtQAXrcMXQJhUm5CT0r8miEsN.jpg', '{545,1556}', '{US}', '1996-10-04 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2352, 302127, NULL, 206679, 'Na lovu', 'https://image.tmdb.org/t/p/original/yWVqYVOUcS6vu22v4BPXKJW10m5.jpg', NULL, 0, '{10764,10751}', 'https://voyo.nova.cz/titul/4765-na-lovu', 'cs', 'Na lovu', '', 'f', '1861.325', 'https://image.tmdb.org/t/p/original/udJ1wVuOwFg1q6UBcQGwcpcdIYF.jpg', '{31292}', '{CZ}', '2021-08-16 00:00:00', 0, 40, '{cs}', 'Returning Series', '', 'f', '0.000', 2, 2, '{"id": 206679, "imdb_id": "tt21340756", "tvdb_id": 431701, "tvrage_id": null, "twitter_id": null, "facebook_id": "nalovucesko", "freebase_id": null, "wikidata_id": "Q107920585", "freebase_mid": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2338, 12082, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '继续延续上一季的剧情，原来穆德受了骗，及时发觉错误后和史考莉串通好来骗政府高层，以潜入一个“作为一个普通FBI特别探员不该进入的地方”搜集需要的资料。本季发展越来越精彩，一些没有被完全改造的混血外星人联合起来抵抗殖民阴谋。史考莉被绑架时子宫被移除，但这一季却出现了她的孩子——艾蜜莉。这一季的制作小组甚至找了两位知名科幻小说家操笔，客串写出两集剧本。整出X档案为了配合电影的上映，加入了一些角色及内容，“辛迪加”组织的阴谋越来越明显，穆德再一次接近事实的真相。穆德前女友的出现也对穆德与史考莉间的关系做出重大考验。该季结束于吸烟人烧毁了所有X档案卷宗。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/vsmzzFgNPXlzOywz295XbLzx2Vf.jpg', '{545,1556}', '{US}', '1997-11-02 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.500', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2339, 12083, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '电影后的X档案怎么演，是所有影迷及电视评论家关注的焦点。这季的风评呈两极反应，有人喜欢，有人不喜欢。这一季多些喜剧，应该是说有非常多喜剧，让人捧腹大笑。但欢笑之余还是不能忘了X档案有重责在身，本季中间有两集是全剧六年来的大剖析。另外，大卫·杜楚尼自编自导了一集X档案。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/66VDHI9TwMgLleR9RD3mjMWDCC3.jpg', '{545,1556}', '{US}', '1998-11-08 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.600', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2340, 12084, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '穆德远途调查出了意外，在精神病院醒来有了预见的能力，还能读取他人的心理活动。史考莉在非洲海岸发现那里发现了刻有人类基因图的远古遗物及关于第六次物种大灭绝的记载。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2341, 12085, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '穆德失踪后，史考莉请约翰·道格特探员帮忙，连同斯金纳、孤枪手等一同寻找穆德。鉴于无法找到穆德，FBI决定让道格特探员正式接手X档案，而此时的史考莉在与穆德共事多年后也早已相信X档案中一系列“灵异事件”的真实性，于是她开始了与一个新的“怀疑论”者——约翰·道格特的合作之旅。本季超级战士(一种新混血外星人)作为新殖民武器开始出现。穆德最终回来了，还找到了杀死超级战士的方法，但由于他知道的太多而不得不逃亡。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/jOzHVvM8PKtyEToE7L3H46jJicQ.jpg', '{545,1556}', '{US}', '2000-11-05 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '7.000', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2342, 12086, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '外星人与政府的阴谋随着逼近大结局而越来越明显。大结局《真相》(The Truth)里，穆德得到线报又回来寻找真相了，但是他却因同超级战士的搏斗而被关进了监狱，控以谋杀，接受审判。但是穆德否认指控，因为简单手法根本杀不死超级战士。道格特、史考莉、斯金纳、雷耶斯、斯班德、加布森等人用尽办法证明穆德的清白，但审判是不公正的，穆德将被执行死刑。道格特和斯金纳等人来到了监狱营救穆德，与此同时超级战士也来了，但是穆德他们早一步逃出了监狱。接着穆德和史考莉两人一起开车去找寻真相，证明外星人的阴谋。他们找到了给穆德提供线报的人，穆德告诉史考莉原来由于势力衰微无法组织有效进攻而企图暗中控制政府以逐步殖民的外星人由于计划屡屡受搓，将于2012年12月22日利用混入政府的超级战士进行孤注一掷的殖民入侵。', 'f', '1317.208', 'https://image.tmdb.org/t/p/original/d3GXgDS7oyUjwDUKoECDRF0OOZR.jpg', '{545,1556}', '{US}', '2001-11-11 00:00:00', 0, 45, '{en}', 'Ended', '', 'f', '6.600', 2962, 2, '{"id": 4087, "imdb_id": "tt0106179", "tvdb_id": 77398, "tvrage_id": 6312, "twitter_id": "thexfiles", "facebook_id": "thexfilesonfox", "freebase_id": "/en/the_x-files", "wikidata_id": "Q2744", "freebase_mid": "/m/07g9f", "instagram_id": "thexfilesfox"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2353, 302129, NULL, 206679, 'Na lovu', 'https://image.tmdb.org/t/p/original/yWVqYVOUcS6vu22v4BPXKJW10m5.jpg', NULL, 0, '{10764,10751}', 'https://voyo.nova.cz/titul/4765-na-lovu', 'cs', 'Na lovu', '', 'f', '1861.325', 'https://image.tmdb.org/t/p/original/udJ1wVuOwFg1q6UBcQGwcpcdIYF.jpg', '{31292}', '{CZ}', '2022-01-10 00:00:00', 0, 40, '{cs}', 'Returning Series', '', 'f', '0.000', 2, 2, '{"id": 206679, "imdb_id": "tt21340756", "tvdb_id": 431701, "tvrage_id": null, "twitter_id": null, "facebook_id": "nalovucesko", "freebase_id": null, "wikidata_id": "Q107920585", "freebase_mid": null, "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2343, 68296, NULL, 4087, 'X档案', 'https://image.tmdb.org/t/p/original/ucyQMoSTH5FkCcQl4G4rLMtRSsJ.jpg', NULL, 0, '{80,18,9648,10765}', 'http://www.fox.com/the-x-files', 'en', 'The X-Files', '谁也不曾想过，七十年前那期神秘的罗斯威尔事件，时至今日仍对全体人类产生着如此巨大的影响。并且鲜少有人窥见真相的全貌，即使它就在那里。某天，过着颓废生活的前联邦探员福克斯·穆德（大卫·杜楚尼 David Duchovny 饰）以及他最为信赖的搭档——正在某某教会医院担任医师的丹娜·斯科莉（吉莲·安德森 Gillian Anderson 饰）重新聚在一起。原来一档旨在揭露政治黑幕节目的主持人找到他们，希望二人披露政客利用外星人来控制人类的真相。以此为契机，关闭已久的X档案重新开启。一度对各种离奇事件失去信心的穆德，在斯科莉的陪伴下重新踏上征程。
