INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2485, 54605, NULL, 46296, '斯巴达克斯', 'https://image.tmdb.org/t/p/original/xyHrlFr8W9bGysDsYQRRfD3cdoR.jpg', NULL, 0, '{18}', 'http://www.starz.com/originals/spartacus', 'en', 'Spartacus', '《斯巴达克斯：竞技场之神》是《斯巴达克斯：血与沙》的前传。于2011年1月21日开播。《神之竞技场》为6集的迷你剧，作为《血与沙》的前传，剧集以两大奴隶主Tullius和Batiatus的竞争为主线，讲述角斗训练学校中的故事。该剧延续《血与沙》的风格，油画般的画质，血腥性感，逐渐深入的人物刻画和富有内涵的剧情主线，剧集的口碑也随着收视率一路上扬。', 'f', '909.246', 'https://image.tmdb.org/t/p/original/laMXboE84oaVybT3CAJ3psoyLOj.jpg', '{7228,2659}', '{US}', '2011-01-21 00:00:00', 0, 53, '{en}', 'Ended', '', 'f', '0.000', 2388, 2, '{"id": 46296, "imdb_id": "tt1442449", "tvdb_id": 129261, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q1249642", "freebase_mid": "/m/0j3cwn1", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2486, 54602, NULL, 46296, '斯巴达克斯', 'https://image.tmdb.org/t/p/original/xyHrlFr8W9bGysDsYQRRfD3cdoR.jpg', NULL, 0, '{18}', 'http://www.starz.com/originals/spartacus', 'en', 'Spartacus', '在人命如草芥的古罗马奴隶制时代，出身色雷斯的斯巴达克斯（安迪·怀特菲尔德 Andy Whitfield 饰）曾是罗马辅备军中一名孔武有力、骁勇善战的勇士，可却因为反抗了罗马军官而沦为奴隶。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2487, 54603, NULL, 46296, '斯巴达克斯', 'https://image.tmdb.org/t/p/original/xyHrlFr8W9bGysDsYQRRfD3cdoR.jpg', NULL, 0, '{18}', 'http://www.starz.com/originals/spartacus', 'en', 'Spartacus', '《斯巴达克斯：复仇》是美剧《斯巴达克斯》第二季。在《复仇》中，澳洲演员连姆·麦肯泰尔取代了因癌症去世的原男主安迪·怀特菲尔德。一场发生在巴蒂塔斯家的血腥屠杀结束了《斯巴达克斯： 血与沙》的故事，《斯巴达克斯：复仇》继续讲述角斗士的大暴动，罗马共和国为此深感惊恐。盖乌斯·克罗迪斯·葛雷博率领罗马军队前往卡普亚，企图消灭日渐壮大的、以斯巴达克斯为首的自由奴隶军，永绝后患。斯巴达克斯面临两个选择，要么向奴役且杀害他妻子的人复仇，了结私人恩怨，要么忍辱负重，保存处于萌芽状态的奴隶军。', 'f', '909.246', 'https://image.tmdb.org/t/p/original/iHjUhNXGnD3aKiq0GA3BgEfwCmw.jpg', '{7228,2659}', '{US}', '2012-01-27 00:00:00', 0, 53, '{en}', 'Ended', '', 'f', '7.500', 2388, 2, '{"id": 46296, "imdb_id": "tt1442449", "tvdb_id": 129261, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q1249642", "freebase_mid": "/m/0j3cwn1", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2488, 54604, NULL, 46296, '斯巴达克斯', 'https://image.tmdb.org/t/p/original/xyHrlFr8W9bGysDsYQRRfD3cdoR.jpg', NULL, 0, '{18}', 'http://www.starz.com/originals/spartacus', 'en', 'Spartacus', '《斯巴达克斯：诅咒者之战》是Steven S. DeKnight执导的剧集。在第3季中，澳洲男星托德 拉桑斯和西蒙 米瑞尔斯扮演的恺撒和克拉苏将相继登场。随着他们的登场，斯巴达克斯和他的伙伴也逐渐成长起来。而围绕着斯巴达克斯的角斗士队伍和一心想剿灭他们的罗马人，将上演更多的阴谋、引诱、杀戮、忠诚和背叛。', 'f', '909.246', 'https://image.tmdb.org/t/p/original/zMkDaYWYGB5KAvgipshQMtxy7vF.jpg', '{7228,2659}', '{US}', '2013-01-25 00:00:00', 0, 53, '{en}', 'Ended', '', 'f', '7.600', 2388, 2, '{"id": 46296, "imdb_id": "tt1442449", "tvdb_id": 129261, "tvrage_id": null, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": "Q1249642", "freebase_mid": "/m/0j3cwn1", "instagram_id": null}');
