INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2518, 7240, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '这一季介绍了主要人物，并确定了故事总基调。是以围绕着斯克兰顿分公司的区域经理迈克尔·斯科特，他试图说服纪录片的制片人，他管理着一个快乐、运转良好的办公室。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2519, 7241, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '从“盾叠奖”开始，第二季进一步发展为担心公司裁员的情节，伴随着新角色的引入和一些配角的人物发展——尤其是德怀特·舒鲁特。迈克尔·斯科特很快和他的老板简·利文森开始了一段恋情，潘姆·比斯利和吉姆·哈尔珀特之间的关系成为了本季的焦点之一。他们的暧昧变得更加明显，因为吉姆对潘姆的感情持续增长，而她在与仓库工人罗伊·安德森的关系仍在挣扎中。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/9CQjqZ6ZRS9PEsqkOXlRBC9wfdv.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2005-09-20 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '8.200', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2542, 42494, NULL, 30957, '极速前进', 'https://image.tmdb.org/t/p/original/pPUtOmorFMI2q5OF77r9GDcZTkX.jpg', NULL, 0, '{10764}', 'http://www.cbs.com/shows/amazing_race', 'en', 'The Amazing Race', '', 'f', '1221.148', 'https://image.tmdb.org/t/p/original/2GRhG8LSASzV9F1KpXyjsucaCPm.jpg', '{88986,77197,19366,40041}', '{US,GB}', '2001-09-05 00:00:00', 0, 42, '{en}', 'Returning Series', '', 'f', '0.000', 132, 2, '{"id": 30957, "imdb_id": "tt0285335", "tvdb_id": 77666, "tvrage_id": 5566, "twitter_id": "amazingracecbs", "facebook_id": "amazingrace", "freebase_id": null, "wikidata_id": "Q60096", "freebase_mid": "/m/07s8z_l", "instagram_id": "theamazingrace_cbs"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2520, 7242, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '这一季标志着主角吉姆·哈尔珀特从斯克兰顿搬到了斯坦福德，同时引入了Rashida Jones饰演的凯伦·菲利佩里和Ed Helms饰演的安迪·伯纳德——他们都是敦德米福林-斯坦福德分部的成员——作为常驻角色。Helms后来被提升为该剧的常驻演员。这一季前几集的主要情节是关于一个在第一季和第二季中反复出现的问题——公司裁员——而在第二季的后半段，办公室间的人际关系也成为了一个主要情节。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/zGxblXDKUeo81yi0KNVVs4AvjxE.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2006-09-21 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '8.300', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2521, 7245, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '到了第四季，办公室里发生了很多变化。前临时职员莱恩现在是所有人的上司，并且驱策大家启动新网站，威胁到斯克兰顿分行的舒适世界。前任上司珍与迈克尔住在他的公寓，尝试过家庭生活。吉姆和帕姆的关系更进一步，但德怀特和安吉拉却遇上重大问题。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/e2QXQY8al5nY2niTiaFiBJ3hk5a.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2007-09-27 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '8.100', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2522, 7244, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '上一季《办公室》让剧迷喘不过气来，急着追看下去－由金球奖得主史蒂夫卡瑞尔主演的艾美奖得奖喜剧最受瞩目的一季终于上演了。全新的各种蠢事为丹德米福林公司带来灾难，一众职员继续发放笑料。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/c9CBqohqBfsEkXY72VCX635GCRc.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2008-09-24 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '8.200', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2523, 7243, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '那些是结婚的钟声吗？那是小脚丫走在办公室地板上的声音吗？迈克尔变成黑社会老大了吗？丹德米福林公司频临破产，他可能必须取代丹德米福林公司 的领导层，也许时间到了。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/fUFhM2FGoeRefSZQUV5nbygtvCi.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2009-09-16 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '7.800', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2524, 7247, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '人谁无过？迈克尔斯考特则是凡事烦人、凡事不理智、凡事抑制不住。这些正是使他令人难以抗拒的特质。没错，金球奖得主史蒂夫卡瑞尔回来了，再次饰演让你又爱又恨的上司。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/jzs5ZfkP0ns1mw43TsNgMd6zPJ2.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2010-09-22 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '7.900', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2525, 7248, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '不恰当言论、小气行为、零生产力－你可以换掉上司，却改变不了办公室。在大受欢迎的喜剧来到第八季，可能是到目前为止最有趣的一季。大家深爱的演员带领丹德米福林公司在没有迈克尔斯考特的世界（和办公室大楼）继续前进。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/frZs3UKrzPiRyjHyLgcDrTpbv8U.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2011-09-22 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '7.500', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2526, 7249, NULL, 2316, '办公室', 'https://image.tmdb.org/t/p/original/mLyW3UTgi2lsMdtueYODcfAB9Ku.jpg', NULL, 0, '{35}', 'http://www.nbc.com/The_Office/', 'en', 'The Office', '在第九季中，安迪伯纳德是衣着笔挺的推销员，也是忠实的康奈尔大学校友。他独特音乐才华无边无际，娱乐办公室众人。他就是新任丹德米福林公司斯克兰顿分行经理。', 'f', '840.276', 'https://image.tmdb.org/t/p/original/wdjefTcCnRWSEDV9tZ9xSzGIbxu.jpg', '{26727,59845,6383,215547,8301}', '{US}', '2012-09-19 00:00:00', 0, 24, '{en}', 'Ended', '', 'f', '7.700', 3912, 2, '{"id": 2316, "imdb_id": "tt0386676", "tvdb_id": 73244, "tvrage_id": 6061, "twitter_id": "theofficetv", "facebook_id": "TheOfficeTV", "freebase_id": "/en/the_office", "wikidata_id": "Q23831", "freebase_mid": "/m/08jgk1", "instagram_id": "theoffice"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2527, 3646, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/mjUvUEzOwnMz6fx75RHGOqwmPnM.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2010-10-11 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '0.000', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2528, 3643, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '镇治安官瑞克·格里姆斯在一次行动中遭受枪击，当他从昏迷中醒来时，发现小镇上阴气沉沉，死尸遍地。更为恐怖的是，有的死尸游走于街头巷尾，嗜血如命，早已化作恐怖的丧尸。从一对幸存的父子口中得知，大批的幸存者早已疏散到亚特兰大市的避难所。为了 找到失踪的妻儿，瑞克只身上路。然而亚特兰大早已沦陷成为死城，丧尸在此占有绝对的统治地位。被丧尸围攻的瑞克得到数名幸存者的救助，经过一番奋力厮杀，他们最终返回到野外的营地。在接下来的日子里，他们不仅要面临丧尸的威胁，更要承受来自灵魂深处的巨大考验……', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/kKN1Klhdxhbiwe8TBXIs6NYPr4C.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2010-10-31 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.300', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2529, 3644, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '当疾控中心被夷为平地之后，瑞克等幸存者继续踏上前往亚特兰大的凶险之旅。身心倍感疲惫的一群人越来越难以应付仿佛永远没有穷尽的丧尸，而他们之间的关系也变得愈加微妙和不稳定。申恩与好友瑞克和瑞克之妻洛瑞关系愈加扑朔迷离，变得暴躁残忍的申恩萌生脱队行动的念头，他种种乖张举措为自己和伙伴们埋下了悲剧的种子。与此同时，死亡以一步步向幸存者们迫近，有的人遇害、受伤、失踪，可即便命运如此残酷，即将到来新的生命仍昭示着未来的希望……', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/77sdrexHQx3uQRM68Ffdanw8QaV.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2011-10-16 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.500', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2530, 3645, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '时间流逝着，逃亡与抗争的旅程依旧漫漫看不到尽头，好在瑞克一行人的运气还不算太坏，偶然中，他们找到了最理想的庇护所——一座废弃已久的监狱，在这里，新的生活即将展开。另一边，出走的安德里亚与米琼恩亦找到了一处由“总督”所统治的“世外桃源”，安德里亚十分喜欢这里貌似平静快乐的生活，但显然米琼恩并不这么觉得，随着时间的推移，一个惊人而恐怖的秘密渐渐浮出了水面。瑞克和“总督”，当这两个原则和理念完全相悖的“领导”相遇之时，战争爆发了。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/8Vy2SK2aMIDW3c6NeslQk7nc6on.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2012-10-14 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.600', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2531, 3647, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '监狱避难营中的人数不断地增长着，生活也渐渐步入了正轨，正当大家以为平静的日子终于来临之时，总督的逆袭让瑞克一行人再度陷入到了水深火热之中。总督不仅绑架并杀害了德高望重的郝塞尔，还放火将大家赖以生存的避难营付之一炬。一边是来势汹汹的总督，一边是不断逼近的行尸，一直以来同心协力的瑞克一行人被迫踏上了不同的逃亡之路。瑞克带着儿子卡尔向城镇中心出发，达里尔保护着贝丝在森林深处徘徊，玛姬与格伦尽管失散，但都心怀着找到彼此的坚定信念。在乱世之中，曾经并肩作战的伙伴们能否再度重逢？', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/1bFtBZg4ehney9ogQncllQAeX8o.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2013-10-13 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.500', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2532, 60391, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '瑞克团队将会去新的地方。而卡萝尔、泰尔西和贝丝还会呆在野外，他们没有和其他人被困在一起。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/cimCEzhKLayG91lrAkn8E5ZQc7x.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2014-10-12 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.500', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2533, 68814, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '瑞克接受了自己的"领袖"地位，现在他自己和其他人也都这么看待他。他并不想要这种地位，但是他也不会拒绝。他已经完全认可了现实的残酷，他必须以残酷来对待残酷，即便犯下罪恶。只有这样，他才能当一个父亲、一个朋友，才能带领大家一直抗争下去。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/xXTDbcXFOm7vCxQHl4D7lblb88U.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2015-10-11 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.400', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2534, 76834, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '随着尼根掌握主权，瑞克团队的成员们处在他们此前从没经历过的处境中。尼根的残酷统治极度威胁到瑞克他们的生存，大战不可避免 。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/bz6IMoRiw6eV2pawWGeOlLGKilZ.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2016-10-23 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '7.800', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2535, 91735, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '瑞克和他团队的幸存者们向尼根及其部队发起了全面的战争。救世军虽然人数众多、装备精良、残酷无情，但瑞克和联合的社群为了未来更加美好的希望而斗争。随着战线的确立，他们展开了一场紧张激烈、充满活力的攻击行动。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/jP6XyARVDEMKAncIbUql3krIOyd.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2017-10-22 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '7.900', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2536, 109531, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '随着尼根和救世军的败北，幸存者们现在在瑞克的领导下重建文明。然而，当他们周围的行尸开始低语时，这个团队被迫面对迄今为止最大的威胁。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/gLraG3uYQFjnSBktU8DM4ylh6By.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2018-10-07 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.400', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2537, 123967, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '幸存者小队在严峻的冬季中勇敢地踏入了低语者的领域。这些联合的社区依旧在处理阿尔法所展现出的恐怖力量的余波，虽然不情愿，但他们仍在尊重被强加给他们的新界线，同时，他们也在组织自己成为一支具有民兵风格的战斗队伍，为一场看似不可避免的战斗做准备。然而，低语者代表了一种他们以往未曾面临过的威胁。在一大群行尸的支持下，他们面临的似乎是一场难以取胜的战斗。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/rqeYMLryjcawh2JeRpCVUDXYM5b.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2019-10-06 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.400', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2538, 189337, NULL, 1402, '行尸走肉', 'https://image.tmdb.org/t/p/original/x4salpjB11umlUOltfNvSSrjSXm.jpg', NULL, 0, '{10759,18,10765}', 'http://www.amc.com/shows/the-walking-dead--1002293', 'en', 'The Walking Dead', '亚历山大的居民们正竭尽全力加强防御并满足越来越多居民的食物需求，其中包括那些从神之国和山顶寨的火灾中幸存下来的人们，以及玛吉和她带领的新小组——守卫者。亚历山大面临的人口超出了它的供养和保护能力。随着对过去事件的紧张感上升和自保意识在这座遭受重创的城墙内部升温，他们的局势变得尤为严峻。他们必须在努力恢复亚历山大的同时，确保食物的供应，防止它像他们这些年来见证过的无数其他社区一样坍塌。但问题在于如何以及从哪里着手。现在他们比以往任何时候都更加疲惫和饥饿，必须挖掘更深的努力和力量，即使这意味着牺牲自己，也要保障他们孩子的生命安全。同时，亚历山大的居民们还不知道的是，尤金、以西结、由美子和公主仍然被一些神秘士兵所扣留，这些士兵属于一个规模更大、尚未透露身份的组织。', 'f', '1220.911', 'https://image.tmdb.org/t/p/original/kwmHfcb7h8wMndRcAQixvvGSVth.jpg', '{23242,23921,11533,3982,50032,170794}', '{US}', '2021-08-22 00:00:00', 0, 42, '{en}', 'Ended', '死尸无惧 活人可怖', 'f', '8.500', 16083, 2, '{"id": 1402, "imdb_id": "tt1520211", "tvdb_id": 153021, "tvrage_id": 25056, "twitter_id": "WalkingDead_AMC", "facebook_id": "TheWalkingDeadAMC", "freebase_id": "", "wikidata_id": "Q232737", "freebase_mid": "/m/0c3xpwy", "instagram_id": "amcthewalkingdead"}');
