INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2590, 3848, NULL, 1438, '火线', 'https://image.tmdb.org/t/p/original/layPSOJGckJv3PXZDIVluMq69mn.jpg', NULL, 0, '{80,18}', 'http://www.hbo.com/the-wire', 'en', 'The Wire', '巴尔的摩的毒品集中地，巴克斯戴尔贩毒集团被卷入一宗谋杀案中，吉米·麦克纳提受命组织一个由杀人犯和贩毒者组成的团队，来对付毒品头子阿文。阿文有一群忠心耿耿的拥护者，而且眼线众多。得到密报后，他们一方面装作与政府合作，另一方面暗中与对手奥尔玛较劲，奥尔玛曾经抢夺过阿文的毒品，并转手倒卖。调查监督员德里克·丹尼尔斯此时正面临因受贿被调查的麻烦。', 'f', '1564.269', 'https://image.tmdb.org/t/p/original/7aDjAk9Rd1uQXAoAjl4UyR4d1mi.jpg', '{78811,168706}', '{US}', '2002-06-02 00:00:00', 0, 60, '{es,en,el,zh}', 'Ended', '', 'f', '8.000', 2081, 2, '{"id": 1438, "imdb_id": "tt0306414", "tvdb_id": 79126, "tvrage_id": 6296, "twitter_id": "Hbo_The_Wire", "facebook_id": "TheWire", "freebase_id": "/en/the_wire", "wikidata_id": "Q478360", "freebase_mid": "/m/0464pz", "instagram_id": "thewirehbo"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2591, 3849, NULL, 1438, '火线', 'https://image.tmdb.org/t/p/original/layPSOJGckJv3PXZDIVluMq69mn.jpg', NULL, 0, '{80,18}', 'http://www.hbo.com/the-wire', 'en', 'The Wire', '审视毒品问题对城市贫民阶层的影响，尤其探讨了以码头工人为代表的蓝领阶层的生存困境，他们中有些人通过帮助走私集团运送毒品和其他违禁品讨生活。', 'f', '1564.269', 'https://image.tmdb.org/t/p/original/scOZiOzUePpz7JnWRpjI8HcY1RU.jpg', '{78811,168706}', '{US}', '2003-06-01 00:00:00', 0, 60, '{es,en,el,zh}', 'Ended', '', 'f', '7.900', 2081, 2, '{"id": 1438, "imdb_id": "tt0306414", "tvdb_id": 79126, "tvrage_id": 6296, "twitter_id": "Hbo_The_Wire", "facebook_id": "TheWire", "freebase_id": "/en/the_wire", "wikidata_id": "Q478360", "freebase_mid": "/m/0464pz", "instagram_id": "thewirehbo"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2592, 3850, NULL, 1438, '火线', 'https://image.tmdb.org/t/p/original/layPSOJGckJv3PXZDIVluMq69mn.jpg', NULL, 0, '{80,18}', 'http://www.hbo.com/the-wire', 'en', 'The Wire', '探讨在部分人烟稀少的街区对非法毒品交易及卖淫的「事实性」合法化会有怎么样的潜在积极作用。这种做法在阿姆斯特丹和其他欧洲城市取得了积极成果，减少了市内的街头犯罪。', 'f', '1564.269', 'https://image.tmdb.org/t/p/original/mWo4dHE0XXsKgZOQQCtkHl3IHrf.jpg', '{78811,168706}', '{US}', '2004-09-19 00:00:00', 0, 60, '{es,en,el,zh}', 'Ended', '', 'f', '8.100', 2081, 2, '{"id": 1438, "imdb_id": "tt0306414", "tvdb_id": 79126, "tvrage_id": 6296, "twitter_id": "Hbo_The_Wire", "facebook_id": "TheWire", "freebase_id": "/en/the_wire", "wikidata_id": "Q478360", "freebase_mid": "/m/0464pz", "instagram_id": "thewirehbo"}');
