INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2629, 59465, NULL, 95, '吸血鬼猎人巴菲', 'https://image.tmdb.org/t/p/original/q4CbisNArigphVn608Faxijdw8N.jpg', NULL, 0, '{10765,35,18,10759}', '', 'en', 'Buffy the Vampire Slayer', '搬到加州桑尼戴尔后，巴菲-安妮-萨默斯只想做一个普通的青少年。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2630, 59466, NULL, 95, '吸血鬼猎人巴菲', 'https://image.tmdb.org/t/p/original/q4CbisNArigphVn608Faxijdw8N.jpg', NULL, 0, '{10765,35,18,10759}', '', 'en', 'Buffy the Vampire Slayer', '新吸血鬼斯派克（Spike）和德鲁西拉（Drusilla）以及新的杀手肯德拉-杨（Kendra Young）来到小镇，肯德拉-杨在第一季大结局中因巴菲的短暂死亡而被激活。桑德与科迪莉亚发生了关系，而威洛则开始接触巫术，丹尼尔-"奥兹"-奥斯本在被恰好是狼人的小表弟咬伤后变成了狼人。在这一季中，巴菲和吸血鬼安吉尔发展了一段感情，但安吉尔作为邪恶而残暴的安吉勒斯的黑暗过往有可能摧毁巴菲和这个世界。', 'f', '1441.414', 'https://image.tmdb.org/t/p/original/2D8jpFaKBglVEIPz7F4j79K4Aox.jpg', '{10567,2516,5842,1556,62934}', '{US}', '1997-09-15 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.700', 1628, 2, '{"id": 95, "imdb_id": "tt0118276", "tvdb_id": 70327, "tvrage_id": null, "twitter_id": null, "facebook_id": "", "freebase_id": "/en/buffy_the_vampire_slayer", "wikidata_id": "Q183513", "freebase_mid": "/m/0cskb", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2631, 59467, NULL, 95, '吸血鬼猎人巴菲', 'https://image.tmdb.org/t/p/original/q4CbisNArigphVn608Faxijdw8N.jpg', NULL, 0, '{10765,35,18,10759}', '', 'en', 'Buffy the Vampire Slayer', '巴菲从大城市回来后，发现她的朋友们一直在与邪恶势力战斗，而她却不在身边。正当她努力重新赢得母亲和朋友们的信任时，一个名叫费丝的新杀手来到了小镇，并很快赢得了巴菲所有朋友的信任。但菲丝的到来只是巴菲必须面对的新势力的开端。几天后的晚上，她遇到了安吉尔，他不知何故从巴菲送他去的地狱恶魔空间回来了，狂野而暴力。但是，巴菲最终必须面对的真正恶魔已经来到传送门的这一边，他正在为桑尼戴尔高中准备一个特别的毕业日惊喜。', 'f', '1441.414', 'https://image.tmdb.org/t/p/original/yCpvUKIxbqJdNtd8iO8c1emkyuB.jpg', '{10567,2516,5842,1556,62934}', '{US}', '1998-09-29 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '7.900', 1628, 2, '{"id": 95, "imdb_id": "tt0118276", "tvdb_id": 70327, "tvrage_id": null, "twitter_id": null, "facebook_id": "", "freebase_id": "/en/buffy_the_vampire_slayer", "wikidata_id": "Q183513", "freebase_mid": "/m/0cskb", "instagram_id": null}');
