INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2636, 4583, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '', 'f', '1213.906', 'https://image.tmdb.org/t/p/original/xaEj0Vw0LOmp7kBeX2vmYPb5sTg.jpg', '{1957,31810}', '{US}', '2001-02-14 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '0.000', 7719, 2, '{"id": 1668, "imdb_id": "tt0108778", "tvdb_id": 79168, "tvrage_id": 3616, "twitter_id": "FriendsTV", "facebook_id": "friends.tv", "freebase_id": "/en/friends", "wikidata_id": "Q79784", "freebase_mid": "/m/030cx", "instagram_id": "friends"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2637, 4573, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '瑞秋、莫妮卡、菲比、钱德、乔伊和罗斯悉数登场。罗斯刚刚因为他的同性恋妻子卡萝（Carol）而离婚。此时莫妮卡, 菲比和罗斯都单独居住，只有钱德和乔伊住在一个公寓里。这时莫妮卡的老朋友瑞秋穿着婚纱闯进了Central Perk咖啡馆，她刚刚逃脱了自己和未婚夫贝瑞（Barry）的婚礼，并搬来和莫妮卡一起住。很快瑞秋成为Central Perk的一名服务员，开始学着告别从前优裕的生活独立养活自己。此时罗斯的前妻已经怀有罗斯的孩子，後来她将这个男孩生下来，取名为班（Ben），由卡萝和她的同性恋女友苏珊（Susan）共同抚养。', 'f', '1213.906', 'https://image.tmdb.org/t/p/original/odCW88Cq5hAF0ZFVOkeJmeQv1nV.jpg', '{1957,31810}', '{US}', '1994-09-22 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.000', 7719, 2, '{"id": 1668, "imdb_id": "tt0108778", "tvdb_id": 79168, "tvrage_id": 3616, "twitter_id": "FriendsTV", "facebook_id": "friends.tv", "freebase_id": "/en/friends", "wikidata_id": "Q79784", "freebase_mid": "/m/030cx", "instagram_id": "friends"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2638, 4574, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '罗斯此时并不知道瑞秋已经对他有了感觉，他已经和在中国重逢的老同学,同是古生物学家的茱莉（Julie）开始一段了恋情。瑞秋对此很不开心，于是尝试破坏这一对恋人。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2639, 4575, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '瑞秋把在Central Perk的工作辞掉，开始尝试在时尚界找一份工作。後来她遇到了马克（Mark），马克在Bloomingdate''s为她找了一份工作，但罗斯始终确信Mark对瑞秋有企图，因此变得异常敏感和嫉妒。这种紧张关系在他们的周年纪念日是达到了顶点，瑞秋由于工作无法和罗斯共进晚餐，罗斯就带了食物到瑞秋办公室，但弄得一团糟直到瑞秋命令他回到了家。两人在回家後的争吵最终导致两人赌气分手（take a break）。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2640, 4576, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '罗斯决定与瑞秋复合，与邦妮分手。于是瑞秋写了一封长信表达自己的感受，信中提出要罗斯承担过去这一段错误的一切责任，但罗斯无法接受，于是很快又分手了。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2641, 4577, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '罗斯和艾米丽还是完婚了，但由于不能容忍生活里还有瑞秋，最终两人离婚了。罗斯搬出公寓，找到了跟大家很近新住处，但因为得罪上司而丢掉了博物馆的工作。菲比生下一个男孩两个女孩，希望留下一个孩子，但无奈弟弟不同意。一夜情后，钱德勒和摩妮卡决定秘密维持关系。直至被大家知道，两人的恋情才公之于众。乔伊获得一个做男主角的机会，但却因为资金问题被迫停止了。众人去拉斯维加斯看望乔伊，在飞机上罗斯和瑞秋再次重逢。钱德勒和摩妮卡决定在拉斯维加斯的小教堂结婚，刚到就遇到了酩酊大醉刚糊涂结了婚的罗斯和瑞秋。', 'f', '1213.906', 'https://image.tmdb.org/t/p/original/aEwLXWbo6gV1TNIv9veu4rRwsPZ.jpg', '{1957,31810}', '{US}', '1998-09-24 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.400', 7719, 2, '{"id": 1668, "imdb_id": "tt0108778", "tvdb_id": 79168, "tvrage_id": 3616, "twitter_id": "FriendsTV", "facebook_id": "friends.tv", "freebase_id": "/en/friends", "wikidata_id": "Q79784", "freebase_mid": "/m/030cx", "instagram_id": "friends"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2642, 4578, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '在发现两人已经结婚之後，两人决定到法院取消夫妻关系，但罗斯担心自己可能要离婚三次之多，所以谎称自己已经取消了。瑞秋後来发现之後逼着罗斯去取消，但由于瑞秋在取消申请中填写了关于罗斯的羞辱性语句，最後导致两人只能通过离婚解决问题。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2643, 4579, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '瑞秋和菲比决定把莫妮卡怀孕的消息保密。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2644, 4580, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '瑞秋证实自己怀孕了，第二集中大家发现罗斯其实是孩子的父亲，事情就发生在钱德和莫妮卡婚礼前的一个月。瑞秋和乔伊继续住在一起，这时乔伊忽然对瑞秋产生了感觉。当罗斯觉得自己在丧失了很多父亲的感觉时，乔伊只好建议瑞秋搬到罗斯那里住。後来乔伊表达了自己对瑞秋的感觉，但瑞秋婉拒了。最後一集，瑞秋给自己的女儿取名叫Emma。尽管Emma这个名字是莫妮卡从小就计划好了的，准备用在自己孩子身上的。', 'f', '1213.906', 'https://image.tmdb.org/t/p/original/eh6PPkrzkXsEksRJDcdtx9lZsqX.jpg', '{1957,31810}', '{US}', '2001-09-27 00:00:00', 0, 0, '{en}', 'Ended', '', 'f', '8.500', 7719, 2, '{"id": 1668, "imdb_id": "tt0108778", "tvdb_id": 79168, "tvrage_id": 3616, "twitter_id": "FriendsTV", "facebook_id": "friends.tv", "freebase_id": "/en/friends", "wikidata_id": "Q79784", "freebase_mid": "/m/030cx", "instagram_id": "friends"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2645, 4581, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '罗斯、瑞秋和Emma继续住在一起，直到一天他们由于当时两人的奇怪的关系争吵起来——两人住在一起，有孩子，但却不处于恋爱关系。于是瑞秋决定领着Emma搬回到乔伊那里。钱德勒的公司把他调职到俄克拉荷马州的塔尔萨，商量后。他决定独自前往塔尔萨。在圣诞夜，一名女职员想在办公室与钱德勒调戏，结果钱德勒辞了职，随后投身广告界。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2653, 7056, NULL, 2261, '约翰尼·卡森今夜秀', 'https://image.tmdb.org/t/p/original/qFfWFwfaEHzDLWLuttWiYq7Poy2.jpg', NULL, 0, '{10767}', '', 'en', 'The Tonight Show Starring Johnny Carson', '', 'f', '1384.641', 'https://image.tmdb.org/t/p/original/oA8QVTGlAN511uCAMDN60aVQUs1.jpg', '{5253,15492}', '{US}', '1987-01-10 00:00:00', 0, 60, '{en}', 'Ended', '', 'f', '0.000', 65, 2, '{"id": 2261, "imdb_id": "tt0055708", "tvdb_id": 70334, "tvrage_id": 6246, "twitter_id": null, "facebook_id": null, "freebase_id": "/en/the_tonight_show_starring_johnny_carson", "wikidata_id": "Q6057742", "freebase_mid": "/m/083vbf", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2654, 7034, NULL, 2261, '约翰尼·卡森今夜秀', 'https://image.tmdb.org/t/p/original/qFfWFwfaEHzDLWLuttWiYq7Poy2.jpg', NULL, 0, '{10767}', '', 'en', 'The Tonight Show Starring Johnny Carson', '', 'f', '1384.641', 'https://image.tmdb.org/t/p/original/oA8QVTGlAN511uCAMDN60aVQUs1.jpg', '{5253,15492}', '{US}', '1962-10-01 00:00:00', 0, 60, '{en}', 'Ended', '', 'f', '0.000', 65, 2, '{"id": 2261, "imdb_id": "tt0055708", "tvdb_id": 70334, "tvrage_id": 6246, "twitter_id": null, "facebook_id": null, "freebase_id": "/en/the_tonight_show_starring_johnny_carson", "wikidata_id": "Q6057742", "freebase_mid": "/m/083vbf", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2646, 4582, NULL, 1668, '老友记', 'https://image.tmdb.org/t/p/original/l0qVZIpXtIo7km9u5Yqh0nKPOr5.jpg', NULL, 0, '{35}', '', 'en', 'Friends', '乔伊和瑞秋的恋情只维持了三集，当他们发现他们之间的情感一直是纯洁的友情，他们根本不适应身体上的交往，于是他们决定还是只做朋友。剧情继续，Mike决定再次向菲比求婚，并于稍后两人举行了婚礼。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2647, 4689, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/8Ea2roow8yQqiWOtmOibsuTqXBW.jpg', '{1957,11461}', '{US}', '2009-10-05 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '0.000', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2648, 4690, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '故事将主要讲述年轻的FBI女特工Olivia Dunham（AnnaTorv扮演）奉命加入代号为“Fringe（边缘）”的秘密部门，与高深莫测的神秘科学家WalterBishop博士（JohnNoble扮演）合作调查一系列无法用科学解释的超自然现象。随着这些现象愈演愈烈，两人逐渐发现，其中有些麻烦可能是WalterBishop自己的研究所导致的，而更多的麻烦则和秘密的顶级研究机构“普罗米修斯公司”有关……真相一点一点被揭开，秘密却越来越深。', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/evhOVPj5IJyosoy6tByZ2YGPryD.jpg', '{1957,11461}', '{US}', '2008-09-09 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '7.600', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2649, 4691, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '几位制片人透露，编剧组目前已经制定出完整的「第二季剧情线索蓝图」。第一季结尾留下了很多疑问，其中最大的一个是：究竟存在多少个平行世界？Olivia已经亲身经历了其中的一个，她还会经历另一个吗？大多数DC漫画中所描述的「无限地球」概念（Infinite Earths），会出现在《危机边缘》中吗？', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/cp1T5g1bVkxFciXR10kiiS381qt.jpg', '{1957,11461}', '{US}', '2009-09-17 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '7.600', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2650, 4692, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '第三季的故事是延续第二季未讲述完的故事继续的，主要讲述奥莉维亚在平行空间探索的故事。', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/ywFHuCrfIOJcR8aov7ASgIVFTqR.jpg', '{1957,11461}', '{US}', '2010-09-23 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '7.700', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2651, 4693, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '彼得牺牲自己拯救了两个世界。这件事情已经过去一个星期，两个世界维持了停战协定，并被迫共同应对两个世界相交所带来的不确定因素。在我们的世界里，林肯的搭档在一次作战中牺牲，于是林肯加入边缘案件调查组。他参与调查的第一起案件与变形者有关，但这起案件与他自己有着非常紧密联系。', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/aiAL4miEX5mwJZ3fFZ2RXQ1lJwf.jpg', '{1957,11461}', '{US}', '2011-09-23 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '7.500', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2652, 4694, NULL, 1705, '危机边缘', 'https://image.tmdb.org/t/p/original/2yZXtM2Kky1Sy0kachbDlwybl3y.jpg', NULL, 0, '{10765,18,9648}', 'http://www.fox.com/fringe', 'en', 'Fringe', '第 5 季从第 4 季快闪剧集中描述的事件中接续，看似和平的观察者在 2015 年控制了我们的宇宙。现在，在 2036 年，他们已成为无情的统治者，无人反对。然而，未来等待的是边缘团队保护我们世界的最后一站。', 'f', '1073.651', 'https://image.tmdb.org/t/p/original/wZpn01u6QuCAGIH4CeN9HfysHpT.jpg', '{1957,11461}', '{US}', '2012-09-28 00:00:00', 0, 46, '{en}', 'Ended', '', 'f', '7.800', 2360, 2, '{"id": 1705, "imdb_id": "tt1119644", "tvdb_id": 82066, "tvrage_id": 18388, "twitter_id": null, "facebook_id": null, "freebase_id": null, "wikidata_id": null, "freebase_mid": "/m/03cf9ly", "instagram_id": null}');
