INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2753, 5424, NULL, 1891, '罗马', 'https://image.tmdb.org/t/p/original/erYsqVULwpRAiMVWAZDm3nHK1EU.jpg', NULL, 0, '{10759,18}', 'http://www.hbo.com/rome/', 'en', 'Rome', '　　公元前52年，罗马共和国正值鼎盛时期，执政官庞贝（里克•沃登 Rick Warden 饰）坐守都城，盟友凯撒（塞伦•希德 Ciarán Hinds 饰）征战高卢。期间，第13军团屡立战功，主将乌里纳斯（凯文•马克德 Kevin McKidd 饰）有勇有谋，手下波罗（雷•史蒂文森 Ray Stevenson 饰）虽嗜酒如命，却忠肝义胆。适逢凯撒得胜，屋大维遵母命赴前线慰问，不想途中遭劫，被经过的乌里纳斯和波罗救下。13军团凯旋，乌里纳斯与阔别8年的妻子相见，却各怀心事。波罗偶然间发现了乌里纳斯妻子红杏出墙的事实，为了保护长官的名誉，波罗在屋大维的帮助下，逼出了真相。凯撒准备独揽大权，一直等待时机。庞贝看出了他的野心，与元老院众人商议，其中以西塞罗为首的贵族势力，坚持认为凯撒为共和国叛徒，应诛杀之。而此时，凯撒的大将安东尼（杰姆斯•鲍弗 James Purefoy 饰）接任了护民官，与庞贝一伙展开周旋……', 'f', '794.895', 'https://image.tmdb.org/t/p/original/iGK1cbNM6gmBLoyWzrcmwG8qazR.jpg', '{3324}', '{GB,US,IT}', '2005-08-28 00:00:00', 0, 60, '{en}', 'Canceled', '', 'f', '7.900', 1192, 2, '{"id": 1891, "imdb_id": "tt0384766", "tvdb_id": 73508, "tvrage_id": 5047, "twitter_id": null, "facebook_id": null, "freebase_id": "/en/rome_(tv_series)", "wikidata_id": null, "freebase_mid": "/m/06k176", "instagram_id": null}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2754, 5425, NULL, 1891, '罗马', 'https://image.tmdb.org/t/p/original/erYsqVULwpRAiMVWAZDm3nHK1EU.jpg', NULL, 0, '{10759,18}', 'http://www.hbo.com/rome/', 'en', 'Rome', '公元前52年，罗马共和国建立400年后，罗马已经成为世界上最富有的城市，是拥有100万人口的世界性大都市，也是雏形中的帝国的中心。罗马共和国是建立在分享权利和激烈的个人竞争的基础上的，从来不允许搞个人独裁。但这些共和国的原则基石正在腐败的弥漫和道德的沦丧下逐渐崩溃。统治阶级穷奢极欲、挥霍无度，传统的斯巴达人的戒律和团结已经荡然无存。', 'f', '794.895', 'https://image.tmdb.org/t/p/original/vvwmV0ZdHNjiJy3bHOb62iv3jPD.jpg', '{3324}', '{GB,US,IT}', '2007-01-14 00:00:00', 0, 60, '{en}', 'Canceled', '', 'f', '7.800', 1192, 2, '{"id": 1891, "imdb_id": "tt0384766", "tvdb_id": 73508, "tvrage_id": 5047, "twitter_id": null, "facebook_id": null, "freebase_id": "/en/rome_(tv_series)", "wikidata_id": null, "freebase_mid": "/m/06k176", "instagram_id": null}');
