INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2792, 28882, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '一个17岁的弗吉尼亚少女埃琳娜，她的父母双双死于车祸，埃琳娜是那场事故中唯一的幸存者。她的弟弟杰米里带着她搬到姑妈珍娜家借住，他们很快就适应了新的环境。在好朋友邦妮和卡罗琳的帮助下，埃琳娜的脸上恢复了笑容，她又变成了以前那个天真烂漫的普通少女。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2793, 28883, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '故事紧接第一季最后一集。埃琳娜回到家中后发现叔叔John躺被凯瑟琳刺倒在血泊之中，而杰里米不省人事。在医院里，刚刚遭遇车祸的卡罗琳正在接受抢救，马特、邦妮和达蒙一同安慰心急如焚的福布斯警长。埃琳娜与达蒙谈起了当天晚上的种种怪事，包括他们那一吻。当埃琳娜坚决否认此事后，达蒙敏锐地意识到凯瑟琳已经回来了。凯瑟琳的回归让斯特凡和达蒙十分担心，他们开始调查凯瑟琳的行踪，希望能查到她的真实目的。他们都不希望凯瑟琳威胁到他们已经建立起来的「生活」。与此同时，泰勒仍在为父亲的死伤心难过。叔叔Mason Lockwood的突然回归给了他一个惊喜。Mason打算回家料理哥哥的后事，并帮助泰勒渡过难关。Mason已经掌握了控制狼人怒气的方法，他希望将这种方法传授给泰勒，然而泰勒却不一定能接受自己是狼人的现实。另一方面，Mason和达蒙相处得很不愉快。尽管Mason是个好人，可他一旦被达蒙逼急了，也会做出令人震惊的事情来。', 'f', '1364.448', 'https://image.tmdb.org/t/p/original/vZeCa9H1xJU9GqtIJ8mqsbVRFfF.jpg', '{1957,10067,2180,37423,1081}', '{US}', '2010-09-09 00:00:00', 0, 43, '{en}', 'Ended', '', 'f', '8.100', 8723, 2, '{"id": 18165, "imdb_id": "tt1405406", "tvdb_id": 95491, "tvrage_id": 21766, "twitter_id": "cwtvd", "facebook_id": "thevampirediaries", "freebase_id": null, "wikidata_id": "Q28537", "freebase_mid": "/m/05sy2k_", "instagram_id": "thecwtvd"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2794, 28884, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '第三季开始的剧情不会如第二季第一集延续第一季最后一集的内容，会从吸血鬼始祖克劳斯及相关人物介绍回顾故事发展，再转回延续第二季的内容，并且尼克劳斯和Elijah兄弟还会回来。第三季的第一集就是女主角埃琳娜的18岁生日。这一季中埃琳娜会升到高中三年级，但是这一季结束的时候不会毕业。随着第三季开始，泰勒和卡罗琳之间的友谊就会开花结果，迸发出爱情。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2795, 28885, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '埃琳娜转化为吸血鬼的过程是漫长的，因为埃琳娜要明确自己想要做一个怎样的吸血鬼；埃琳娜、斯特凡、达蒙之间的三角恋不会结束，因为埃琳娜会逐渐想起达蒙所让她忘记的一切，克劳斯会出现，但他将不是最大的敌人，因为会有更危险的人物登场，邦妮可能会走向黑暗的边缘。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2796, 28886, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '第五季开始，埃琳娜与达蒙如胶似漆，杰里米复活了，邦妮却死了，只剩下鬼魂在神秘瀑布镇上游荡，但只有杰里米看得见她，赛拉斯开始给神秘瀑布镇带来了威胁，而埃琳娜和卡罗琳大学生活刚开始，她们的古怪室友便离奇身亡，而她竟与埃琳娜的养父有着一丝联系。变成人类的凯瑟琳正受到赛拉斯的威胁，无奈之下只能向达蒙寻求保护，埃琳娜开始怀疑斯特凡的下落，并且她不断得到了关于斯特凡的幻觉，后来，斯特凡被救出，但在达蒙和埃琳娜找到他时，他，失忆了。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2797, 62019, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '在经历了第五季末旅行者们的疯狂行动之后，所有的吸血鬼都无法踏入“神秘瀑布镇”的边界线。幸运的是埃琳娜、斯特凡、泰勒、阿拉克里和恩佐都成功的走出了“另一边”复活；遗憾的是达蒙和邦妮却与“幸运之神”擦肩而过，随着“另一边”的崩塌，他们俩被卷入了1994年，重复循环同一天时间的日食日“时空监狱”中 。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2798, 67991, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '随着伊丽莎白警长和埃琳娜的离开，每个人都捡起来自己的生活。神秘瀑布镇的人们不会过多地关注像童话里那样沉睡的埃琳娜，因为莉莉和被困在那个荒无人烟的世界100多年的异教徒们已经决定将神秘瀑布镇作为他们的新家，同时他们也学着融入现实世界。可是异教徒们根本不喜欢受约束，并且非常饥饿，他们会把神秘瀑布镇当做是他们的“游乐场”。达蒙失去了埃琳娜等于失去了生活的方向和意义，他与同样失去爱人的阿拉里克一起沉积在痛苦中，邦妮为了帮助他们走出痛苦，陪同他们去了欧洲旅行散心。马特考取了神秘瀑布镇的警徽接替了伊丽莎白警长的位置，并且疏散了神秘瀑布镇上的居民。
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2799, 79312, NULL, 18165, '吸血鬼日记', 'https://image.tmdb.org/t/p/original/k7T9xRyzP41wBVNyNeLmh8Ch7gD.jpg', NULL, 0, '{18,10765}', 'http://www.cwtv.com/shows/the-vampire-diaries', 'en', 'The Vampire Diaries', '作为该系列的最后一季，第八季的主题开始是探索黑暗，之后便是主角们寻找救赎。
