INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2845, 78479, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '本季以美国民间传说“洛亚诺克事件”为故事背景，以纪录片的形式展示。2015年，谢尔比·米勒（莉莉·拉贝饰）、她的丈夫马特·米勒（安德烈·霍兰德饰）和马特的姐姐李·哈里斯（Adina Porter饰）为大热纪录片《我的洛亚诺克噩梦》以经历者的身份进行叙述拍摄。他们在镜头前讲述一年前在北卡罗来纳州居住的农舍里瘆人的经历，包括房子里游荡的鬼魂、手持菜刀的猪头人、食人族邻居、进行“人祭”的英国殖民者等等。纪录片情景再现的部分，由英国演员奥德丽·廷德尔（莎拉·保罗森饰）、多米尼克（小古巴·戈丁饰）、莫奈·图缪西美（安吉拉·贝塞特饰）、艾格尼丝（凯茜·贝茨饰）、奥黛丽的丈夫罗里（伊万·彼得斯饰）等出演。纪录片取得了巨大的成功。次年，制片人西德尼（夏安·杰克逊饰）乘胜追击，推出续集《回到洛亚诺克：地狱三天》。这次是真人秀的形式。他邀请了纪录片主演和故事主人公，回到了当初的农舍，开始为期三天的“地狱式”体验。然而在拍摄过程当中，离奇事件不断发生。在短短的三天里，剧组成员相继死亡，无一幸免。只有亲身经历过的人才知道，“洛亚诺克”，并不只是传说……', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/47oZ4lmHzEw7XwYhFsEN6W9vlhh.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2016-09-14 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '6.500', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
