INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2840, 3700, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '心理治疗师Ben（迪伦·麦克德莫特 Dylan McDermott 饰）因与女学生有染被妻子Vivien（康妮·布里登 Connie Britton 饰）发现，经协调决定带着女儿Violet一家搬到洛杉矶开始新生活。但各式奇怪的人接踵而来：亦老亦少的感女仆Moira（ 阿丽克丝·布莱肯瑞吉 Alexandra Breckenridge 饰）；能预知的诡异女孩Adelaide；穿黑色紧身橡胶服的神秘人；满脑子古怪念头的病人Tate（伊万·彼得斯 Evan Peters 饰），不请自来的邻居Constance（杰西卡·兰格 Jessica Lange 饰），令人不寒而栗的跟踪者Larry（丹尼斯·欧哈拉 Denis O''Hare 饰）。而地下室里的怪物；萦绕不去的幽灵；坛坛罐罐里的秘密实验，这些离奇事件也似乎在证实这所房子隐藏着不可告人的神秘......', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/2eAl7mNBzsKbq6kTUCLmgczAMkK.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2011-10-05 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.600', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2841, 3702, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '20世纪60年代，马萨诸塞州的荆棘崖疯人院。基特·沃克（伊万·彼得斯饰）因被指控为变态杀人犯“血脸杀手”，而被关押进了疯人院。这一消息极大的引起了新闻记者拉娜·温特斯（莎拉·保罗森饰）的兴趣。野心勃勃的她梦想着出版“血脸杀手”的故事并成名，于是便无视裘德修女（杰西卡·兰格饰）的警告，潜入了疯人院，但被心狠手辣的裘德修女以同性恋身份的理由关押进了疯人院。手段极端的裘德修女，用藤鞭惩罚犯错的修女，对病人进行非人的“电击疗法”；纯洁的玛丽修女（莉莉·拉贝饰）尽忠尽责，却被魔鬼附身，性情大变；疯人院医生亚瑟·阿尔顿（詹姆斯·克伦威尔饰），秘密地在实验室里进行着变态的人体实验；精神鉴定医师奥利弗·史莱森（扎克瑞·昆图饰），表面斯文正经，却心怀鬼胎；这群人都不像表面看起来那般，圣母像庇护下的疯人院却充满着邪恶的气息…', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/3KB77H9fem8VxDZQQ0B0eoqmbGA.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2012-10-17 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.500', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2842, 3703, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '少女佐伊·班森（泰莎·法米加 Taissa Farmiga 饰）意外害死男友，由此得知自己拥有女巫血脉。她被带到一所秘密的女巫学校，结识了拥有不同能力的麦迪逊、奎妮和楠三名女孩。未过多久，校长科迪莉亚（莎拉·保罗森 Sarah Paulson 饰）的母亲菲奥娜·古德（杰西卡·兰格 Jessica Lange 饰）返回学校。她是上一代公认的超级女巫，却因衰老和魔法的流失而焦虑不安。菲奥娜找到了被永生的黑人女巫玛丽·拉文（安吉拉·贝塞特 Angela Bassett 饰）活埋将近两百年的拉劳里夫人（凯茜·贝茨 Kathy Bates 饰），渴望弄清永生的秘密。谁知一连串事件却点燃了两派女巫沉寂多年的战火。 与此同时，另一伙狙杀女巫的神秘组织也剑拔弩张。21世纪，女巫的传奇仍在继续……', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/1BJl98sCwzlsr9E29YGL7ped1Tk.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2013-10-09 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.500', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2843, 62526, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '20世纪50年代。前德国歌舞演艺明星艾尔莎·马尔斯（杰西卡·兰格饰）组织了由一群畸形人组成的表演团体，在佛罗里达州朱庇特市开展畸形秀。随着畸形秀的人气不断下降，艾尔莎为了重新赢回观众，找来了长着两个头的连体人贝特和多特（莎拉·保罗森饰）。畸形秀成员主要包括“龙虾手”吉米·达林（伊万·彼得斯饰）、吉米的胡须茂盛的母亲艾瑟尔（凯茜·贝茨饰）、长着三个乳房的“三奶”德西蕾（安吉拉·贝塞特饰）等。本就处于社会底层的畸形人们在遭遇来自外在压力的同时，还不断遇到各种麻烦：连体姐妹作为杀人嫌疑犯，被警方要求带走调查；娇惯心理变态的富家公子丹迪·莫特（芬·维特洛克饰）疯狂追求连体姐妹，以杀人浴血为乐；职业骗子斯坦利（丹尼斯·欧哈拉饰）和玛姬（艾玛·罗伯茨饰）骗取畸形团的信任，打入内部，目的是为了夺取畸形人的器官以卖钱；看似无害的艾尔莎实则心怀鬼胎，为了隐藏自己的阴谋不惜出卖甚至谋杀畸形人。在这诡异的畸形秀中，人们不仅有着身体上的畸形，更多的是内心的畸形……', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/4LYbeGAYV4pKiiaNvFl4Wj8bFSE.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2014-10-08 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.200', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2844, 69193, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '2015年。科泰兹旅馆是一家建于上个世纪的神秘旅馆。这家旅馆常常出现顾客入住后便再也没有退房的骇人传闻。旅馆的建造者为詹姆斯·马奇（伊万·彼得斯饰），上世纪臭名昭著的变态连环杀人犯。在畏罪自杀后，作为鬼魂游荡于旅馆内，继续自己的杀人事业。如今旅馆的主人是伊丽莎白，人称“女伯爵”（Lady Gaga饰）。神秘而又魅力十足的女伯爵，对血液和性爱有无止境的需求。旅馆里有不少“长期住客”，包括人称“针筒萨莉”的瘾君子萨莉·麦肯纳（莎拉·保罗森饰）；女伯爵帅气的情人多诺万（马特·波莫饰）；多诺万的母亲，旅馆前台艾芮斯（凯茜·贝茨饰）和调酒师丽兹·泰勒（丹尼斯·欧哈拉饰）等。这些“长期住客”无外乎都是“吸血鬼”，鬼魂，还有甘愿为女伯爵服务的人类。入住旅馆的人们，若使这里的“长期住客”不满，则会被吸干吸净，或被残忍虐杀。洛杉矶警局探员约翰·劳（韦斯·本特利饰）为调查一起“十诫”连环杀人案件，来到了科泰兹旅馆。在这里，他偶然看见了自己失踪多年被判死亡的儿子霍尔登的身影。活在愧疚中太久的他决定在旅馆定居，探寻这里的秘密，却发现真相越加可怕……', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/bjCQKHlYrmxmUsv8FdnhqzxogeI.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2015-10-07 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '6.800', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2846, 90503, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '2016至2017年，以当时的美国大选为背景。在密歇根州的一个小镇上，艾丽·梅费尔-理查兹（莎拉·保罗森饰）经营着一家餐馆。自从特朗普上台后，艾丽抑制已久的各种恐惧症就逐渐显现。她开始在家中受到小丑的惊吓，但警察和她的妻子艾薇（艾丽森·皮尔饰）都认为她的精神出了问题。尽管艾丽在心理医师鲁迪·文森特（夏安·杰克逊饰）的帮助下一直在服用药物，但她时不时的惊慌崩溃影响到了与妻儿之间的感情。新 请的保姆温特·安德森（比莉·洛尔德饰）为艾丽的儿子灌输暴力的思想，古怪的新邻居哈里森（比利·艾希纳饰）和梅多（Leslie Grossman饰）不断为艾丽制造困扰，艾丽成为了某些人的目标。在小镇的另一边，极端右翼凯·安德森（伊万·彼得斯饰）是特朗普的拥护者。他的目标是统治世界，第一步则是成为市议会议员。他组织了一个邪教，在镇上制造谋杀案件，一边戴上面具造成恐慌的同时一边塑造自己的形象，冠冕堂皇地为自己赢得选票。政治背后的黑暗，是人们的恐惧之源…', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/gwSzP1cJL2HsBmGStN2vOg3d4Qd.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2017-09-05 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '6.700', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2847, 106028, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '在一次核爆炸彻底摧毁了世界后，人们建造了一个被称作“第三前哨站”的地下避风港，目的是为了保护拥有强大基因组合的幸存者。维纳布尔（莎拉·保罗森饰）和米德女士（凯茜·贝茨饰）是第三前哨站的主人，对前哨站的管理有一套严格的规则。前哨站的居民，盖兰特（伊万·彼得斯饰）、富家女可可（Leslie Grossman饰）、可可的助手马洛里（比莉·洛尔德饰）、主持人黛娜·史蒂文斯（Adina Porter饰）等等，在维纳布尔和米德女士残忍的统治下生存。不久后，反基督者迈克尔·兰顿（科迪·费恩饰）的到来打破了前哨站的平静：他要选出有价值的人，带到条件更好的“避难所”生活。但迈克尔绝非好心人，他在晚会上把前哨站的居民毒死了。紧接着，曾经的女巫们出现了——他们带着铲除迈克尔的决心，来到了前哨站，向迈克尔宣战……在“天启”发生的两年前，至尊女巫科迪莉娅（莎拉·保罗森饰）发现自己的魔力正在逐渐流失。而此时她注意到了，男巫学校那边，新晋男巫迈克尔·兰顿的出现，很可能就是导致她日渐衰弱的原因。不久科迪莉娅便发现了他打算毁灭世界的阴谋。为了阻止他得逞，科迪莉娅找回了自己的姐妹，默特尔（弗兰西丝·康罗伊饰）、佐伊（泰莎·法米加饰）、麦迪逊（艾玛·罗伯茨饰）、奎妮（加布蕾·斯迪贝饰）、米丝蒂（莉莉·拉贝饰），还有新加入的马洛里。为了女巫们的安全，科迪莉娅消除了可可和马洛里的记忆，把她们的女巫身份隐藏了起来，以此打入前哨站。女巫和恶魔之子之间的战争一触即发……', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/3Ua0MOkXe5kSJKRDMerDMAMjXKx.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2018-09-12 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.100', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2848, 126646, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '布鲁克·汤普森 (艾玛·罗伯茨饰)在遭遇连环杀手理察·拉米雷兹 (柴克·维拉饰）的袭击后，为了避避风头，她决定和一群在健身房认识的朋友，前往刚重新开放且偏远的红木夏令营做辅导员。这群辅导员包括幽默风趣的赛维尔·普林顿 (科迪·费恩饰)、运动好手柴特·克兰西 (盖斯·柯沃西饰)、医学系学生雷·鲍威尔(狄隆·霍顿饰)和精力充沛的蒙塔娜·杜克(比莉·卢德饰)。到达营地后，他们遇到了营地的主人，虔诚的玛格丽特·布斯(莱丝莉·葛罗斯曼饰)。她是1970年红木夏令营大屠杀的唯一生还者，左耳被砍下。红木营地的其他人包括其护士丽塔(安洁莉卡·罗斯饰)、活动指导崔佛·克许纳(马修·莫里森饰)和营地厨师伯蒂(塔拉·卡西恩饰)。在辅导员安顿下来的第一天晚上，当年红木夏令营大屠杀的凶手，人称“叮当先生”的本杰明·瑞克特(约翰·卡罗·林区饰)，逃离精神病院后重返营地，在那里展开他新一轮的暴力犯罪。然而，他的暴行也使众人的秘密被揭开，红木营地的过往真相亦逐渐清晰。而在红木营地里的成员之中，有谁能逃离这腥红炼狱？众人又各自隐瞒了什么？', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/uR2K0Ui9UsOqnzb5IrV6tLUcUHl.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2019-09-18 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.700', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
