INSERT INTO movies ("id", "tmdb_id", "imdb_id", "tmdb_series_id", "title", "backdrop_path", "belongs_to_collection", "budget", "genres", "homepage", "original_language", "original_title", "overview", "adult", "popularity", "poster_path", "production_companies", "production_countries", "release_date", "revenue", "runtime", "spoken_languages", "status", "tagline", "video", "vote_average", "vote_count", "source_type", "external_ids") VALUES (2850, 298367, NULL, 1413, '美国恐怖故事', 'https://image.tmdb.org/t/p/original/a4doyPOabvQor0RGkWdhVENAR3G.jpg', NULL, 0, '{18,9648,10765}', 'https://www.fxnetworks.com/shows/american-horror-story', 'en', 'American Horror Story', '神秘的死亡和失踪事件在这座城市中增加。与此同时，一位医生发现了一个可怕的发现，一位当地记者成为明天的头条新闻。AHS：NYC 是由 Ryan Murphy 和 Brad Falchuk 创作的获奖选集系列的第 11 季。', 'f', '1083.915', 'https://image.tmdb.org/t/p/original/r1CsIl9NaPXKG9J4hYyj3QWhD35.jpg', '{19328,68682,21659,1556,168706}', '{US}', '2022-10-18 00:00:00', 0, 0, '{en}', 'Returning Series', '', 'f', '7.300', 5453, 2, '{"id": 1413, "imdb_id": "tt1844624", "tvdb_id": 250487, "tvrage_id": 28776, "twitter_id": "AHSFX", "facebook_id": "americanhorrorstory", "freebase_id": null, "wikidata_id": "Q53922", "freebase_mid": "/m/0h3mh3q", "instagram_id": "ahsfx"}');
